(312, 2, '8.0', 'Je ne pensais pas trouver un institut de cette qualité dans cette partie du 11 e arrondissement ( entre faidherbe et nation ) de Paris. Je ne viens d''ailleurs jamais dans ce coin la car j habite l''ouest parisien mais j''étais la et j avais envie d''un soin alors je me suis lancé. Au final, tout fut parfait, au moins aussi bien que dans le salon que je fréquente en général et je pense que je reviendrai à l''occasion.', '1', '2012-10-02 18:05:45', NULL),
(313, 1, '10.0', 'Ici on travail encore a l''ancienne. Qualite d''ecoute et des soins. Fresia Vilches est une femme authentique qui ne monnaye pas ses services au rabais en encourageant des groupon ou autre deals maker. On ne nivelle pas le metier par le bas alors meme que celui souffre beaucoup d''un manque de professionnalisme. Ici on paye le bon prix pour le bon soin... Celui qui nous fait du bien!', '3', '2012-10-03 10:22:40', 0),
(314, 1, '10.0', 'Trop bon !', '3', '2012-10-03 14:00:26', 0),
(315, 2, '8.0', 'Rien a dire. La salle est facilement accessible car pas loin du centre de Lille. Les tarifs sont bons et les gars qui s occupent de la salle sont tres sympa et connaissent bien leur travail.', '3', '2012-10-03 16:02:07', 0),
(316, 1, '10.0', 'Tres bonne estheticienne. Epilation parfaite', '3', '2012-10-03 16:36:01', 0),
(317, 1, '10.0', 'Super endroit. Pas trop cher et très bon :)', '1', '2012-10-06 14:12:19', NULL),
(318, 1, '10.0', 'On se dit en voyant la devanture petit salon esthetique du 7e a Paris, rapport de proximite avec les clients ....mais ca c est vraiment a premiere vue. En fait elle sont trois et le salon est grand et surtout beau dans une athmosphere tres simple et en meme temps tres classe.. Sous la direction de pascale, les soins sont diligente avec manifestement beaucoup de justesse et de precision mais surtout beaucoup de qualite ... Ici on sait combien de sucres mettre dans les cafes que l''on propose a ses clients. Et pour cause, ses clients on s''interesse a eux, on les connait bien mais surtout, et c est le plus important on les aime. Voila la politique d''une maison qui resiste au temps dans un quartier ou la qualite ne se bricole pas... C''est ce que moi j appel la grande classe avec un grand C. ', '3', '2012-10-06 14:14:01', 0),
(319, 3, '6.0', 'Bof tres bof. Service vite fait et plutot mal fait. Personnel deborde et surtout responsable assez hautain ... Ce qui sauve l''endroit c est que c est pas cher pour buffet a volonte 16,90?...', '3', '2012-10-06 14:27:36', 0),
