(326, 1, '10.0', 'Tres tres bel institut de beaute dans le 9 em arrondissement. Dans ce salon on travaille encore dans les regles de l''art ce qui est loin d etre le cas partout.... Dote d''une politique interne tres rigoureuse; l higyene mais egalement prevention des risques sont pris tres au serieux par cet institut dans lequel, par exemple on fait systematiquement des tests avant de tenter une epilation definitive. Le personnel est particulierement pro et sympa. A recommander !', '3', '2012-10-15 18:57:42', 0),
(327, 1, '10.0', 'J adore aller dans cet endroit lillois par excellence. Place sur la grande place on peux meme quand il fait beau profiter de la terrasse. C est vraiment tres agreable. En plus les gens la bas sont accueillant et sympa. A faire pour ceux qui connaissent pas. ', '3', '2012-10-16 12:44:57', 0),
(328, 1, '10.0', 'Super salle de sport pas trop loin du centre. J aime bien cette salle car l''ambiance y est plutot bon enfant, simple et sans prise de tete. En plus elle est pas trop cher et assez proche du centre de Lille a 10 minutes de la grande place. ', '3', '2012-10-16 19:40:00', 0),
(329, 2, '8.0', 'Melange de yahourt glace avec des fruits, des bonbons ....Tres bon pour combler un petit creux !!!', '3', '2012-10-17 18:25:43', 0),
(330, 1, '10.0', 'Waouw !!!! Super restaurant dans lequel on retrouve dans les plats les saveurs de son enfance. Ce restaurant, qu''on trouve dans tous les grands guides y compris le michelin se trouvait il y a encore quelque temps rue chomel dans le 7 em arrondissement et pour notre plus grand plaisir il vient de reouvrir ses portes dans le 4eme. Comme le dit le patron qui travaille dans la restauration depuis 40 ans cuisine soignee vin de qualite. Je vous laisse savourer ce seduisant adage et leur cuisine qui a mon sens vaut le detour !!! Petite astuce quand on est sur la rue saint Antoine l''impasse guemenee c est sur la droite en venant de la bastille et il faut suivre le gorille blanc... La pour le coup il est pas dans les arbres mais sur une magnifique ardoise faite pour l occasion par un peintre du quartier. Ah si tous les restaurateurs etaient comme ca le monde irait mieux c est sur....Genial :)', '3', '2012-10-17 21:21:34', 0),
