(425, 1, '10.0', 'Merci pour l accueil chaleureux, l''ambiance agréable, le nom sympa et original ( paix à l''âme de flocon blanc ! ) et surtout pour les plats excellents, les vins souriants et même l''eau est à la hauteur ! On reviendra ! EXCELLENTE adresse ! On la recommande !!! Merci ...', '3', '2012-10-26 21:47:43', 1),
