(430, 2, '8.0', 'Plupart du personnel tres accueillant et aimable. Localisation au plein centre de la ville. Service de haute qualite. Tres recommandable.', '3', '2012-10-27 14:38:47', 0),
(431, 1, '10.0', 'Très satisfaite par l''accueil, le personnel. Beau lieu qui inspire la détente. Agréable gommage au sel. Massage très décontractant au top. En deux mot - faut revenir.', '3', '2012-10-27 14:43:37', 1),
(432, 1, '10.0', 'Moments très agréables. Soins et massage au top. 100% satisfaite.', '3', '2012-10-27 14:46:40', 1),
(433, 1, '10.0', 'Personnel très accueillant ! Service impec ! Massages au top ! Bref, je recommande à 100% ! Détente assurée ... Encore merci !', '3', '2012-10-27 14:50:24', 1),
(434, 2, '8.0', 'Tres bon a accueil, prise en charge rapide ( sauf le samedi ). La technique de lumiere pulsee marche, mais il faut a mon avis plus de 5 seances.', '3', '2012-10-27 14:55:07', 0),
(435, 1, '10.0', 'Beaucoup de délicatesse ', '3', '2012-10-27 14:57:42', 1),
