(452, 1, '10.0', 'Cadre super ! Personnel au Top. Je recommande vivement ce moment de détente. Merci a vous', '3', '2012-10-29 12:24:33', 1),
(453, 1, '10.0', 'J''ai connu cet institut par le biais de l''institut Caroline Nour dans le 12em arrondissement a Paris. Khadija m''a conseille d''aller voir une de ses copine qui tient l''institut des trois monde. Alors, la bas c''est simple, j''ai trouve son double, une super nana simple, rayonnante et ultra sympathique qui assure avec sa jeune collaboratrice les soins prodigues dans ce jolie petit institut niche au c?ur du 13em a cote de la place d''Italie. Accueil et professionnalisme au rendez vous bien sur !!! A decouvrir sans moderation....', '3', '2012-10-29 12:41:50', 0),
(454, 2, '8.0', 'Tres bon produits. Tres bon choix, manque peut etre un dessert un peu "light"', '3', '2012-10-29 12:45:41', 0),
