(458, 1, '10.0', 'Première impression, j''ai eu un peu d''hésitation car cela chatouillait, mais on s''adapte très vite et c''est très agréable. L''accueil est excellent. Personnel très aimable.', '3', '2012-10-29 13:01:01', 1),
