INSERT INTO `avis` (`id_avis`, `appreciation`, `note`, `commentaire`, `origine`, `date_avis`, `rester_contact`) VALUES
(469, 2, '8.0', 'Institude est super, l''accueil, service, produits...tous. Les meilleurs que j''ai trouve sur paris !', '3', '2012-10-29 20:44:08', 1),
(470, 1, '10.0', 'Le massage est très relaxant. J''ai beaucoup aime, je me suis endormie à plusieurs reprises. A refaire !!', '3', '2012-10-29 20:47:58', 1),
(471, 1, '10.0', 'Massage très efficace. C''est un moment de détente inégalable ! Vraiment à recommander pour les personnes qui ont des tensions au niveau du dos et des jambes. Merci pour ce moment de détente.', '3', '2012-10-29 20:54:36', 1),
(472, 2, '8.0', 'Accueil sympathique, cadre agréable cuisine traditionnelle avec une touche de modernité, service souriant... Nous reviendrons...', '3', '2012-10-29 20:57:43', 1),
(473, 1, '10.0', 'La prestation réalisée à été très agréable. Je suis très satisfaite et en parlerai à mes amies.', '3', '2012-10-30 10:23:22', 1),
(474, 2, '8.0', 'J''ai beaucoup apprécié le côté interractif de ce cours que cela soit dans les échanges avec l''animatrice ou les participantes. Et enfin je repars avec l''ensemble des points essentiels à un maquillage complet. A moi d''affiner maintenant! ', '3', '2012-10-30 10:33:49', 1),
(475, 1, '10.0', 'Excellent salon. Très bon relationnel clients. Recommande le programme de lumière pulsée dans ce salon. Très bon suivi.', '3', '2012-10-30 10:41:51', 1),
(476, 1, '10.0', 'Soin très agréable et efficace.', '3', '2012-10-30 10:44:52', 1),
(477, 1, '10.0', 'Institut facile d''accès. Personnel accueillant qui répond à chacune de ses interrogations. Facilité et disponibilité pour la prise de rendez-vous. Epilation à la lumière pulsée qui commence à faire son effet. Je suis satisfaite de la prestation et envisage de poursuivre!', '3', '2012-10-30 10:50:46', 1),
(478, 1, '10.0', 'Experience incroyable à faire en couple, entre copines ou solo. Relaxation total. Un vrai point de chute dans notre vie tourmentée.', '3', '2012-10-30 10:54:48', 1),
(479, 2, '8.0', 'Très contente du service. Ca repond à toutes mes attentes. Merci', '3', '2012-10-30 10:59:11', 1),
(480, 2, '8.0', 'Institut sympa, convivial de qualité. Prestation de qualité, tarif raisonnable. Je te le recommande. ', '3', '2012-10-30 12:08:43', 1),
(481, 1, '10.0', 'Moment de relaxation inoubliable ', '3', '2012-10-30 12:13:29', 1),
(482, 1, '10.0', 'Parfais, soin très agréables et très bien faits.', '3', '2012-10-30 12:18:12', 1),
(483, 1, '10.0', 'Parfais, soin très agréables et très bien faits.', '3', '2012-10-30 12:22:30', 1),
(484, 2, '8.0', 'Bon accueil. On s''occupe bien de vous. Travail fait avec précision et suffisamment de conscience professionnelle.', '3', '2012-10-30 16:31:56', 1),
(485, 1, '10.0', 'Très bon institut mais surtout très bonne esthéticienne. Laya est parfaite, sympathique, joviale, l''épilation en devient très agréable.', '3', '2012-10-30 16:36:26', 1),
(486, 1, '10.0', 'Toujours très bien accueillie. Toujours très propre, esthéticienne plus que douce. PARFAIT!', '3', '2012-10-30 17:04:06', 1),
(487, 3, '6.0', 'Cliente du lieu depuis plusieurs annees , je trouve que la qualite d''accueil a nettement baisse: vestiaire pres du lieu des soins sans lumiere et tres humide, on avait demande une cabine en dui lors de la reservation et nous ne l''avons pas eue, la musique tourne en boucle sans changer et le the est mauvais ! La seule chose chose de qualite: le massage est toujours parfait.', '3', '2012-10-30 17:27:08', 0),
(488, 1, '10.0', 'De bons conseils, un cours facile a suivre qui va me permettre d''ameliorer mon maquillage au quotidien. J''ai passe un tres bon moment entre filles. Hyper sympa.', '3', '2012-10-30 17:34:05', 0),
(489, 1, '10.0', 'Le cours est facile à suivre, l''institutrice est disponible, pleine de bons conseils, et très pédagogue pour la novice que je suis. Ça m''a donné des idées, autant pour un maquillage quotidien que de soirée. Un cours génial que je recommande vivement !', '3', '2012-10-30 17:38:55', 1),
(490, 1, '10.0', 'Institut très propre. Accueil parfait. Bonne prestation. Je recommande.', '3', '2012-10-30 20:15:40', 1),
(491, 1, '10.0', '', '3', '2012-10-30 20:18:45', 1),
(492, 2, '8.0', 'Ce fut tres agreable. ', '3', '2012-10-30 20:21:32', 0),
(493, 1, '10.0', 'Bonne accueil et rapide. Bonne prestation. Tarif attractifs pas rapport à d''autres enseignes. Emplacement idéal. Très bon salon et très beau ( ambiance zen favorisant la détente ).', '3', '2012-10-30 20:28:47', 1),
(494, 1, '10.0', 'Salut, je voudrais te parler d''un super centre esthétique rue de la victoire: l''institut OHM - Le personnel est très accueillant, toujours le sourire. Centre très agréable on se croirait aux caraïbes !!! Allez la chose à faire ... Venir tout simplement !', '3', '2012-10-30 20:34:54', 1),
(495, 2, '8.0', '', '3', '2012-10-30 20:36:54', 1),
(496, 1, '10.0', 'Une excellente professionnelle, toujours disponible et de bon conseils. Elle est l''amie esthéticienne dont on ne se passe plus.', '3', '2012-10-30 20:43:18', 1),
(497, 1, '10.0', 'Merveilleux décor, service et repas. Nous tacherons de revenir à cet établissement bien cache.', '3', '2012-10-30 20:49:38', 1),
(498, 1, '10.0', 'Bon, alors comment vous dire ca ... ??Dans ce salon situe a 100 m de l''etoile il ne se passe pas un jour sans qu''une star passe dans ce salon ... \n....bien sur en toute confidentialite !!! Marlene dispense depuis 20 ans ses services aupres d''une clientele parisienne et internationale. Francais, anglais et espagnol sont les langues officielles du salon... Mais les gens n''y viennent bien sur pas seulement pour parler mais pour se faire chouchouter par des mains expertes qui diligentent en toute simplicite et dans une atmosphere tres sympathique et familiale des soins de haute qualite...', '3', '2012-10-31 10:48:56', 0),
(499, 2, '8.0', 'Sensation surprenante au début par la suite très agréable. ', '3', '2012-10-31 10:54:42', 1),
(500, 1, '10.0', 'Le meilleur institut de beauté de Paris ! Marlène est la pro de la manucurie haute couture !!!', '3', '2012-10-31 10:57:53', 1),
