(1438, 1, '10.0', 'Merci de m'' avoir fait rentrer dans le salon, m'' avoir donné des conseils.\r\nLa coupe me plaît beaucoup.', '1', '2012-12-11 18:22:47', NULL),
(1439, 1, '10.0', 'Très contente équipe super sympa!', '1', '2012-12-11 18:25:49', NULL),
(1440, 1, '10.0', 'Très bon accueil et bonne prestation.\r\nTrès à l'' écoute du client\r\nCoupe et relooking reussit', '1', '2012-12-11 18:29:26', NULL),
(1441, 1, '10.0', 'Salon de coiffure agréable ou on obtient vite un rdv.\r\nLa jeune patronne Barbara coupe magnifiquement bien!\r\n\r\nAdresse à recommander', '1', '2012-12-11 18:33:20', NULL),
(1442, 2, '8.0', 'L accueil est très agréable. Une discrétion dans le contact est conservée et la qualité des soins est très satisfaisante. ', '1', '2012-12-11 18:38:40', NULL),
(1443, 2, '8.0', 'Accueil chaleureux avec de très bons conseils!', '1', '2012-12-11 18:42:50', NULL),
(1444, 1, '10.0', 'Depuis plusieurs années, 7 ans, Marlène s'' occupe de mes ongles, épilations... C est mon moment de détente... Dans beaucoup de sympathie.', '1', '2012-12-11 18:50:29', NULL),
(1445, 1, '10.0', 'Bravo kentin !\r\nUn bon moment de détente, je conseil à tout le monde le massage relaxant avec la serviette chaude sans parler des coiffures toujours réussies!', '1', '2012-12-11 18:54:38', NULL),
(1446, 1, '10.0', '', '2', '2012-12-12 23:06:41', 1),
(1447, 2, '8.0', 'Amabilité accueil chaleureux. Prix raisonable. Niveau personnel varier les origines. De très bonnes coiffeuses. A l''écoute de ce qu''on demande. Positif.', '3', '2012-12-13 21:36:36', 1),
(1448, 1, '10.0', '', '3', '2012-12-13 21:51:03', 0),
(1449, 1, '10.0', '', '3', '2012-12-13 21:52:38', 0),
(1450, 1, '10.0', 'Chez Barbara, tout le monde est attentif à nous, l''ambiance est très cool. Et le travail qu''ils font sur nos cheveux est extraordinaire. Et surtout le salon est nickel ce qui est essentielle d''après moi.', '1', '2012-12-13 22:05:08', NULL),
(1451, 2, '8.0', 'Enfin un coiffeur qui propose une couleur vegetale dans un temps court. Un personnel très à l''écoute, dans une ambiance calme sereine, avec de la bonne musique, et un bon café. Cependant une amélioration des bacs du haut serait nécéssaire', '1', '2012-12-13 22:08:44', NULL),
(1452, 1, '10.0', 'Très sympathique, et ouvert. Salon très prope; souhaitons lui une longue et belle carrière dans ce salon. Amicalement', '1', '2012-12-13 22:11:32', NULL),
(1453, 2, '8.0', 'ACCUEIL, SHAMPOO et COUPE = TRES SATISFAITE !', '1', '2012-12-13 22:14:20', NULL),
(1454, 1, '10.0', 'Compétent, à l''écoute et sympathique', '1', '2012-12-13 22:16:03', NULL),
(1455, 1, '10.0', 'Très bonne considération des besoins capillaires ! Merci', '1', '2012-12-13 22:18:36', NULL),
(1456, 1, '10.0', 'Un moment de délice dans un lieu superbe. Personnel très agréable. Soins de qualité. Courez-y !! A bientôt', '1', '2012-12-13 22:21:30', NULL),
(1457, 1, '10.0', 'Un excellent coiffeur. Très bonne ambiance. Il font attention à vous faire la coupe qui convient et dure... J''y retourne depuis 3 ans.', '1', '2012-12-13 22:26:53', NULL),
(1458, 1, '10.0', 'Très bon moment de détente passé aux thermes. Personnel agréable et compétent. A renouveler.', '1', '2012-12-13 22:28:55', NULL),
(1459, 2, '8.0', 'Bonne accueile, propre, avec soin. C''est une adresse qu''il faut pas raté.', '3', '2012-12-13 22:33:29', 1),
(1460, 2, '8.0', 'J''ai beaucoup aimé ce moment passé aux thermes St Germain. Très bon accueil. Hammam, rien à redire, gommage et massage parfait. J''ai donc vraiment et sincerement bien aimé', '1', '2012-12-13 22:37:18', NULL);
INSERT INTO `avis` (`id_avis`, `appreciation`, `note`, `commentaire`, `origine`, `date_avis`, `rester_contact`) VALUES
(1461, 1, '10.0', 'Un accueil chaleureux, des professionnelles à votre écoute et qui savent vous conseiller. Je recommande vivement. Le plus important, on se sent belle en ressortant. Je reviendrai !', '1', '2012-12-14 08:46:19', NULL),
(1462, 2, '8.0', 'A chaque fois que je viens, l accueil est super. Je ressors à chaque fois hyper contente. On vous écoute et des bons conseils nous sont donnés ! \r\n\r\nLe petit truc en + = le café est bon :-)', '1', '2012-12-14 08:50:34', NULL),
(1463, 1, '10.0', 'Mon salon de coiffure habituel. Service de qualité, très disponible et accueillant. Je le recommande sans hésiter.', '1', '2012-12-14 08:53:35', NULL),
(1464, 1, '10.0', 'Bravo à iris, la fée de la coupe effilée!\r\nDs le salon, on se croirait à Berlin !... C est tout son conforme\r\nLa musique est bonne ! ( pas de radio, de beaux cd..) - j y retourne !', '1', '2012-12-14 08:58:26', NULL),
(1465, 1, '10.0', 'Très bon accueil, les coiffeuses sont à l'' écoute et donne des conseils\r\ntrès satisfaisants !\r\nJe suis très très contente du résultat et conseille vraiment ce salon.', '1', '2012-12-14 09:02:27', NULL),
(1466, 1, '10.0', 'Moi, j y viens depuis des années, coupes et couleurs parfaites, l'' équipe est adorable. Je ne sais pas si j ai envie de partager cette super adresse en fait...', '1', '2012-12-14 09:06:39', NULL),
(1467, 2, '8.0', 'Personnel agréable et à l'' écoute, professionnel.', '1', '2012-12-14 09:09:42', NULL),
(1468, 1, '10.0', 'Deco très sympa, ambiance chaleureuse, décontractée et très accueillante et en plus, les coiffeurs/euses sont très pro et performants.', '1', '2012-12-14 09:13:00', NULL),
(1469, 1, '10.0', 'Très bon accueil !\r\nEt beaucoup de gentillesse.', '1', '2012-12-14 09:16:12', NULL),
(1470, 1, '10.0', 'Je recommande ce salon tout d''abord pour sa convialite, et surtout pour ponctualité des rendez vous et bien entendu pour le savoir faire ( couleur brushing)\r\n', '1', '2012-12-14 09:22:46', NULL),
(1471, 1, '10.0', 'Un salon de coiffure à conseiller ! \r\nUn accueil parfait, une ambiance chaleureuse.\r\nUn vrai moment de plaisir.', '1', '2012-12-14 09:43:42', NULL),
(1472, 2, '8.0', 'Salon très agréable dans son ensemble\r\nAccueil sympathique et personnalisé et souvent très attentionné \r\nParfait au niveau coloriste et shampoing. Coupe très bonne mais avec parfois un peu d attente.', '1', '2012-12-14 17:38:40', NULL),
(1473, 2, '8.0', '', '1', '2012-12-14 17:43:29', NULL),
(1474, 1, '10.0', 'Très bon service et efficace', '1', '2012-12-14 19:20:08', NULL),
(1475, 2, '8.0', 'Très bon accueil, le personnel s'' est très bien occupé de moi et àris son temps. Prix très correct. Adresse que je conseille. ', '1', '2012-12-14 19:26:56', NULL),
(1476, 2, '8.0', 'Bon accueil, trois personnes aimables.\r\nUn suivi complet, des explications précises.\r\nUn peu long l'' attente entre les prestations.', '1', '2012-12-14 19:31:22', NULL),
(1477, 2, '8.0', 'L'' accueil et le relationnel avec le client est parfait.\r\nLe soin est relaxant est très appréciable.\r\nSeule critique: la musique, parfois un peu trop rythmée !\r\nMerci beaucoup pour le thé ! \r\nJe ferai une pub positive auprès de mon entourage.', '1', '2012-12-14 19:36:08', NULL),
(1478, 1, '10.0', 'Je conseille à tous et toutes d'' aller se coiffer chez BARBARA\r\nIl y a une très bonne ambiance, Barbara et ses employés sont de vrais professionnels de la coiffure, ils ont toutes les meilleures techniques dignes des coiffeurs de stars. Perso, j'' y vais toutes les semaines et je suis très satisfaite.', '1', '2012-12-14 19:41:25', NULL),
(1479, 1, '10.0', 'Une découverte!\r\nConseils, coupe...\r\nJe suis convaincue et \r\nséduite.', '1', '2012-12-14 19:45:08', NULL),
(1480, 2, '8.0', 'Vraiment professionnelle, à l'' écoute du client', '1', '2012-12-14 19:49:01', NULL),
(1481, 1, '10.0', 'Moment très agréable. Relaxant.\r\nAccueil très sympathique.\r\nBeaucoup d'' empathie.\r\nExplications très judicieux. Bons conseils', '1', '2012-12-14 19:53:15', NULL),
(1482, 1, '10.0', 'Accueil, qualité de la coloration impeccables.', '1', '2012-12-14 19:56:40', NULL),
(1483, 2, '8.0', 'Accueil très sympathique\r\nService de qualité\r\nBonne écoute', '1', '2012-12-14 20:00:02', NULL),
(1484, 1, '10.0', 'J'' apprécie de me faire coiffer par Barbara ou Sylvaine\r\nJ'' ai des cheveux frisés et c'' est vraiment pas évident de trouver\r\ndes mains professionnelles.', '1', '2012-12-14 20:04:24', NULL),
(1485, 1, '10.0', 'Plus de 15 années que je vais  chez \r\nToujours le même plaisir. Et surtout, j'' ai tenté \r\nquelques infidélités mais suis systématiquement revenue...\r\nJamais aussi bien ailleurs.\r\n ', '1', '2012-12-14 20:09:34', NULL),
(1486, 1, '10.0', 'Accueil chaleureux, atmosphère agréable, professionnalisme.', '1', '2012-12-14 20:13:44', NULL),
(1487, 1, '10.0', 'Bien et disponible: salon agréable, sympa.\r\nBon à conserver.', '1', '2012-12-14 21:21:22', NULL),
(1488, 1, '10.0', 'Très bon accueil, écoute, et temps consacré à chaque client très appréciable.', '1', '2012-12-14 21:32:10', NULL),
(1489, 1, '10.0', 'Non seulement le lieu est chaleureux et agréable, mais c'' est un salon de coiffure et ce qui est essentiel, ce sont les coiffeurs qui ont beaucoup de talent  et qui sont totalement à l'' écoute. Je l'' ai déjà conseillé à l'' une de mes amies et je continuerai à le faire. Encore merci et à bientôt.', '1', '2012-12-14 21:37:16', NULL),
(1490, 2, '8.0', 'Bon accueil chaleureux. Ambiance agréable. J'' ai pu me détendre agréablement.', '1', '2012-12-14 21:41:34', NULL),
(1491, 1, '10.0', 'De bons conseils, bien ciblés, bien adaptés à la nature du cheveux.', '1', '2012-12-14 21:44:28', NULL),
(1492, 2, '8.0', 'Cadre agréable, malgré mon retard de 30 minutes, accueil\r\nTrès professionnel ! Moment reposant ! ', '1', '2012-12-14 21:48:15', NULL),
(1493, 2, '8.0', 'Je connais ce salon de coiffure depuis 2005... Très séduite par la démarche ( pas de brushing, colorations végétales) je suis toujours restée très fidèle = Gilles (le coloriste) et Arnaud( qui coupe les cheveux avec beaucoup de talent). Un seul bémol peut être = il arrive que l'' attente soit très longue avant d'' être prise en charge par Arnaud...', '1', '2012-12-14 21:54:15', NULL),
(1494, 1, '10.0', 'Pour une coupe classique, venez chez crescenzii.', '1', '2012-12-14 21:56:54', NULL),
(1495, 1, '10.0', 'Coiffeurs très sympathiques !\r\nSuper travail !\r\nJ'' adore mes  cheveux :-)', '1', '2012-12-14 21:59:59', NULL),
(1496, 2, '8.0', 'La musique devrait être plus présente au sein de la salle de massage (installer des enceintes) pour s'' évader pleinement.\r\nDes cabines seraient nécessaires pour le bien de tous, pour se changer librement et accéder au casier (pour ainsi éviter les aller-venues).\r\nLes prestations sont très satisfaisantes.', '1', '2012-12-14 22:05:32', NULL),
(1497, 1, '10.0', 'On y vient pour se faire couper les cheveux \r\net on y retourne bonne ambiance et détente.\r\nMieux après qu'' avant. Bravo !', '1', '2012-12-14 22:08:47', NULL),
(1498, 2, '8.0', 'Accueil toujours sympathique par l'' équipe aussi bien les coiffeurs que les coloristes. Quelques fois un jeu d'' attente !!!', '1', '2012-12-14 22:12:13', NULL),
(1499, 1, '10.0', 'C'' est toujours un moment de détente. Très agréable lorsque Jacques me coupe les cheveux: Nous parlons restaurants, voyages, spectacles...\r\nVraiment le service est excellent !!', '1', '2012-12-14 22:16:51', NULL),
(1500, 2, '8.0', 'Sympathique, serviable... Une institut à recommander.\r\nVenez nombreux !!!', '1', '2012-12-14 22:23:46', NULL),
(1501, 1, '10.0', 'Décoration, accueil, service et produits!\r\nImpeccable, revenir vite.', '1', '2012-12-14 22:26:56', NULL),
(1502, 1, '10.0', 'Merci Éric!\r\nC'' est à chaque fois mieux que ce que j'' espérais. Je viens les yeux fermés \r\net sons éblouie!', '1', '2012-12-14 22:29:55', NULL),
(1503, 1, '10.0', 'La qualité du service et l'' accueil de l'' équipe sont les valeurs de ce salon.\r\nJe suis clientes depuis plusieurs années et je le conseille régulièrement lorsque l'' on me le demande.\r\nTrès bonne équipe. Très bon service. Ne changez rien!!', '1', '2012-12-14 22:34:31', NULL),
(1504, 1, '10.0', 'Nous venons pour la 2 eme fois. C'' est toujours aussi agréable, on se fait chouchouter, on prend soin de nous. On avait hâte de revenir et nous ne sommes pas déçus.un vrai moment de cocooning!', '1', '2012-12-14 22:37:55', NULL),
(1505, 1, '10.0', 'Authentique coiffeur homme, toute la différence!\r\nJe n'' irais pas ailleurs, tant j'' étais déçu avec d'' autre.\r\nEn plus, toujours sympa et de bonne humeur.', '1', '2012-12-14 22:41:05', NULL),
(1506, 1, '10.0', 'Institut très chaleureux. Agréable bien accueillie\r\n5 min amincissante efficaces.', '1', '2012-12-14 22:45:11', NULL),
(1507, 2, '8.0', 'Bon accueil\r\nMenu original\r\nSommes très satisfaits.', '1', '2012-12-15 20:06:07', NULL),
(1508, 1, '10.0', 'Je suis très à l'' aise dans ce salon où les employés sont naturels.\r\nL'' essentiel: ils font un travail de qualité, \r\nColorants naturels, coupe adaptée au visage de chaque personne. Seul bémol: relativement cher mais cela compense par la gentillesse du patron qui rafraîchit la coupe gratuitement 1fois/2.', '1', '2012-12-15 20:12:00', NULL),
(1509, 1, '10.0', 'Un endroit tranquille au milieu de st germain des près.\r\nDes filles souriante à l'' accueil, une bonne ambiance\r\nUn peu familière je dirai. Pas trop chère. C'' est pas très grand.\r\nIl manque un peu le vestiaire mais la qualité de prestation est bonne alors ça récompense. À refaire.\r\n', '1', '2012-12-15 20:17:18', NULL),
(1510, 1, '10.0', '', '3', '2012-12-15 20:22:29', 0),
(1511, 2, '8.0', 'Je suis sensible à l'' accueil qui fut agréable à chaque fois que je suis venue au salon.\r\nLe styliste à su adapter la coupe de cheveux à mon style de vie et à la morphologie de mon visage.', '1', '2012-12-15 20:24:08', NULL),
(1512, 1, '10.0', 'Je viens depuis 4 ans. Je suis très satisfaite. Travail très soigné,\r\ntrès bon accueil, heure de rendez vous respectée. \r\nQue du positif !', '1', '2012-12-15 20:29:18', NULL),
(1513, 1, '10.0', 'Petit café idéal pour boire un verre entre amis. Accueil super sympa rapport qualité prix étonnant pour le quartier. Je reviendrais.', '1', '2012-12-15 20:33:46', NULL),
(1514, 1, '10.0', 'Excellent accesif. Très bon service.\r\nGentillesse et convivialité.\r\nMerci a vous toutes pour votre sourire.', '1', '2012-12-15 20:37:09', NULL),
(1515, 2, '8.0', 'Le salon est très sympathique comme toutes les personnes qui travaillent dans cet agréable salon.\r\nGilles est à notre écoute, ainsi qu'' Éric et Arnaud.', '1', '2012-12-15 20:41:26', NULL),
(1516, 2, '8.0', 'Prestations de qualité.', '1', '2012-12-15 20:49:52', NULL),
(1517, 1, '10.0', 'Satisfait des résultats grâce à Hélène ma kiné, mon bras est redevenu mobile comme avant je tiens à la remercier.', '1', '2012-12-15 20:53:37', NULL),
(1518, 1, '10.0', 'Enfin, je suis satisfait des soins de chez vous, depuis je suis revenu car je suis très content et je vous remerci du travail que vous faites.\r\nMerci beaucoup.', '1', '2012-12-15 20:57:49', NULL),
(1519, 1, '10.0', 'Accueil chaleureux, écoute du client, conseils judicieux sur la couleur et \r\nle soin des cheveux ainsi que la coupe.\r\nBon rapport qualité/prix.', '1', '2012-12-15 21:04:01', NULL),
(1520, 2, '8.0', 'Le cabinet est jeune et sympa et le maître des lieux Cyril, s'' occupe bien de ses patientes, il les motive pour s'' entretenir, c'' est parfois difficile mais c'' est bien.\r\nDommage pour ses chaussettes, elles ne sont pas à mon goût mais ce n'' est qu'' un détail...', '1', '2012-12-15 21:08:23', NULL),
(1521, 2, '8.0', 'Professionnalisme avec des exercices de rééducation qui me permettent de bien récupérer.\r\nAccueil sympathique. Parfois pas de place pour que je pose mes affaires dans la cabine car prise  par le personnelle.', '1', '2012-12-15 21:13:19', NULL),
(1522, 1, '10.0', 'Je connais monsieur Collin depuis environ 2 ans, je suis satisfaite de ses services. C'' est quelqu'' un qui est à l'' écoute et essaie de s'' adapter aux pathologies. Disponible et efficace.', '1', '2012-12-15 21:19:12', NULL),
(1523, 1, '10.0', 'Cabinet de kinésithérapie qui me donne entière satisfaction. Vraiment.', '1', '2012-12-15 21:21:32', NULL),
(1524, 1, '10.0', 'Très bon accueil, le personnelle très sympa, très bons professionnels!:-)\r\n', '1', '2012-12-15 21:24:50', NULL),
(1525, 1, '10.0', 'Les soins sont particulièrement bien suivis, surveillée, l'' accueil toujours souriant et les conseils chaleureux.', '1', '2012-12-15 21:28:14', NULL),
(1526, 1, '10.0', 'J'' ai aimé l'' accueil, la sympathie de l'' équipe et le professionnalisme en général.', '1', '2012-12-15 21:33:35', NULL),
(1527, 1, '10.0', 'J'' apprécie le professionnalisme et toute la sympathie de cette jeune Chloé, en lui remerciant même avant la fin du traitement de toutes les améliorations.', '1', '2012-12-15 21:38:02', NULL),
(1528, 1, '10.0', 'Il s'' agit d'' un cabinet de kinésithérapie très sérieux que je fréquente depuis de très nombreuses années et qui me donne toute satisfaction.', '1', '2012-12-15 21:44:52', NULL),
(1529, 1, '10.0', 'À recommander ! On prend soin de tes cheveux, et on te propose une coupe qui te va vraiment.', '1', '2012-12-15 21:49:05', NULL),
(1530, 2, '8.0', 'Accueil: Très chaleureux, excellent. Qualité du travail: excellent. Prix très raisonnable. Bref, tout mes enfants sont clients (4) et moi aussi.', '1', '2012-12-16 17:57:51', NULL),
(1531, 1, '10.0', 'Jusqu,à présent, j''ai toujours été satisfaite du service proposé. C''est rapide, efficace et en plus les esthéticiennes ont toujours le sourire !', '1', '2012-12-16 18:01:06', NULL),
(1532, 1, '10.0', 'Accueil très chaleureux et sympathique. Cadre très sympa, calme et agréable. Cuisine de qualité. Un très bon moment. A conseiller à vos amis.', '1', '2012-12-16 18:03:56', NULL),
(1533, 1, '10.0', 'Salon accueillant, pas de &quot;chichi&quot; \r\nEnsemble du personnel très sympa, compétent, à l''écoute et conseille sur les produits, la coupe...', '1', '2012-12-16 18:22:34', NULL),
(1534, 1, '10.0', 'Accueil super. Conseil coupe TOP et adapté \r\n2 ans de fidélité, jamais  été déçu. Merci', '1', '2012-12-16 18:32:27', NULL),
(1535, 1, '10.0', 'Enfin un institut &quot;niquel&quot; dans tous les domaines. Propreté, soins, accueil, esthéticiennes ! Je suis fidèle depuis plus de 3 ans et mes copines viennent egalement chez OHM.', '1', '2012-12-19 12:53:22', NULL),
(1536, 1, '10.0', 'Je suis ravie de l''accueil de la facon de travailler de la douceur. Cela m''encourage de frequenter cette institut. Je suis hyper contente.', '3', '2012-12-19 13:32:42', 0),
(1537, 1, '10.0', 'PARFAIT !!', '1', '2012-12-19 13:36:03', NULL),
(1538, 1, '10.0', 'Je suis une grande habituée, le service, les serveurs, la nourriture, tout est excellent ! Merci à vous pour tout ! Je suis toujours aussi heureuse de venir ici !', '1', '2012-12-19 13:39:24', NULL),
(1539, 1, '10.0', 'Je suis très satisfaite de l''institut frimousse. Je viens depuis presque 10 ans, ma fille à pris aussi le relai. Je recommanderai sans aucun soucis.', '3', '2012-12-19 13:49:35', 1),
(1540, 1, '10.0', 'Salut à tous, dans le quartier du hameau après le travail rien ne vaut pour se délasser et se déstresser qu''une petite visite chez Fresia qui vous accueille chaleureusement et vous fait des soins appropriés.', '1', '2012-12-19 13:55:38', NULL),
(1541, 2, '8.0', 'Professionnel, attentif à la demande de la cliente.', '1', '2012-12-21 16:18:37', NULL),
(1542, 1, '10.0', 'Accueil très sympathique, je recommande.', '1', '2012-12-21 16:24:19', NULL),
(1543, 2, '8.0', 'Découvert par hasard, ce salon répond à mes attentes, pas de brushing + henné + personnel à notre écoute.', '1', '2012-12-21 16:28:21', NULL),
(1544, 1, '10.0', 'Lieu très convivial, accueil super sympa.\r\nNous avons dîner un samedi soir et avons passé un très bon moment.\r\nLe cadre est  chaleureux et le personnel super cool.', '1', '2012-12-21 16:32:50', NULL),
(1545, 1, '10.0', 'Toute la famille se fait coiffer au salon du plus petit au plus grand, cheveux frisés, cheveux raides et cheveux de bébés. \r\nEnchantés nous sommes.', '1', '2012-12-21 16:37:24', NULL),
(1546, 1, '10.0', 'Excellent prestation\r\nAccueil agréable.', '1', '2012-12-21 16:41:16', NULL),
(1547, 1, '10.0', 'Je suis cliente depuis 29 ans et à St. Germain.\r\nJ '' habite maintenant en Province mais je continue à venir dans ce salon. \r\nJe suis très satisfaite.', '1', '2012-12-21 16:46:21', NULL),
