(1670, 1, '10.0', 'SUPER !!! Vraiment nous avons passer un agréable moment mon amie et moi. L''esthéticienne qui m''a fait le massage etait juste sympatique et le massage... Je n''ai pas de mots ! Le meilleur de ma vie ! Nous reviendrons avec plasir !!! Juste magique...', '1', '2012-12-29 18:37:41', NULL),
(1671, 1, '10.0', 'Vous pouvez y aller sans crainte d''abimer vos cheveux avec des couleurs. Ici les couleurs sont superbes, tiennent et rendent les cheveux plus beaux. Sans compter les soins Leonor Grey qui rendent vos cheveux soyeux. Allez-y tout de suite. L''accueil est excellent.', '1', '2012-12-29 18:41:28', NULL),
(1672, 1, '10.0', 'L''accueil est adorable, sourires, et bienvenu.\r\nOn se sent à l''aise.Le cadre est confortable et décoré avec goût.\r\nL''equipe, Audrey, Fred, Pasqual sont des &quot;pros&quot; et j''y ai trouvé mon style après des années.\r\nD''avance, Bravo!', '1', '2012-12-29 18:47:01', NULL),
(1673, 1, '10.0', 'Merci beaucoup pour cet agréable moment, on critique souvent facilement, mais moi je préfere vous faire part de mon avis positif. Malgré des clients accomodants vous avez su me faire oublier les bruits dérangeants grace à votre savoir faire. Je tenais a vous remercier aussi de ne pas avoir baclée le travail, comme beaucoup d''institut le fond quand on vient avec des coupons groupons.', '1', '2012-12-29 18:48:32', NULL),
(1674, 1, '10.0', 'Super couleur, super coupe, super ambiance. On a un RV et on attend très rarement.', '1', '2012-12-29 18:51:16', NULL),
(1675, 1, '10.0', 'Très bonne ambiance... je viens depuis de nombreuses années !\r\n', '1', '2012-12-29 18:51:48', NULL),
(1676, 1, '10.0', 'Très bonne adresse ! Coupes parfaites, couleurs personnalisées. Très bonne qualité, et accueil original et sympathique. Allez y vite !', '1', '2012-12-29 18:54:53', NULL),
(1677, 1, '10.0', 'Ya pas mieux dans le quartier, même si Bruno est moins en forme aujourd''hui.', '1', '2012-12-29 18:55:57', NULL),
(1678, 2, '8.0', 'Un moment merveilleux, massage niquel !! Détente et apaisent garantie ! La seule chose la musique est a mon avis, un peu trop forte ...', '1', '2012-12-29 18:59:56', NULL),
(1679, 1, '10.0', 'Très bon accueil, coupe réussie.\r\nJuste à regretter un peu de retard par rapport à l''horaire fixé. ', '1', '2012-12-29 19:00:07', NULL),
(1680, 1, '10.0', 'C.Comme Cheveux est un vrai salon de quartier= convivial super qualité de service( boissons, derniers journaux en vogue et manucure!) et surtout on sort toujours ravi de sa coupe et de son brushing! Merci a toute l''équipe!', '1', '2012-12-29 19:04:21', NULL),
(1681, 2, '8.0', 'Avis favorable pour la coloration naturelle qui respecte et soigne le cheveux. Très bons produits et conseils du coloriste sur le choix de la couleur. Très bonne coupe qui permet de se coiffer facilement. Le point fort du salon avec les produits naturels. Seul point négatif = cela ne me dérange pas mais peut freiner certaines personnes le fait de ne pas faire de brushing.', '1', '2012-12-29 19:04:55', NULL),
(1682, 1, '10.0', 'Promenade du dimanche matin, on tombe par hasard sur le salon de Michael. Parenthèse enchantée, coiffure parfaite. Nous reviendrons !', '1', '2012-12-29 19:08:16', NULL),
(1683, 1, '10.0', 'Je vous aimes', '1', '2012-12-29 19:10:14', NULL),
(1684, 4, '2.0', 'Accueil, amabilité du personnel, compétence du personnel.\r\nPour gommage et massage= 10/10.\r\nCe jour hammam en panne.Ventilation du hammam donnantsur la rue, chasse d''eau WC à réparer, Cabines de massage exigüe et bruyantes. On entend la douche et les bruits des autres cabines. Dommage.', '1', '2012-12-29 19:10:42', NULL),
(1685, 1, '10.0', '', '1', '2012-12-29 19:14:05', NULL),
(1686, 1, '10.0', 'Première coupe, très satisfait! Cadre agréable et gens sympathiques! Mention spéciale aux fauteuils très confortables...', '1', '2012-12-29 19:19:03', NULL),
(1687, 2, '8.0', 'Wesh mon pote ramène ta fraise c''est de la bebom. Ca flex bien sur le dancefloor on kiffe la vibes', '1', '2012-12-29 19:19:11', NULL),
(1688, 1, '10.0', 'Vous êtes toutes rapides, efficaces et souriantes. Il y a mème du très bon pain ! Que demander de plus ? Merci de continuer comme ça ...', '1', '2012-12-29 19:21:42', NULL),
(1689, 1, '10.0', 'Grâce à sid du salon Déforges et de ses très belles coupes de cheveux j''ai trouvé une copine qui adore ma coupe!!!', '1', '2012-12-29 19:22:25', NULL),
(1690, 1, '10.0', 'Excellent service.', '1', '2012-12-29 19:23:33', NULL),
(1691, 2, '8.0', 'J''ai découvert une nouvelle technique de coloration( dont le résultat est très bon).\r\nTrès bonne coupe.', '1', '2012-12-29 19:25:11', NULL),
(1692, 1, '10.0', 'Merci, merci, merci à toute l''équipe ainsi que votre bon pain. Domage que le lundi on doit aller ailleurs', '1', '2012-12-29 19:26:11', NULL),
(1693, 2, '8.0', 'COUPE DE LA BARBE AU CISEAU, UNE PREMIERE POUR MOI.\r\nON A VRAIMENT PRIS SOIN DE MOI ! MERCI.', '1', '2012-12-29 19:28:23', NULL),
(1694, 2, '8.0', 'Salon très chaleureux. Prestations &amp; personnel à la hauteur des attentes. Manque de place au niveau des bacs ( pour mes grandes jambes ! )', '1', '2012-12-29 19:29:24', NULL),
(1695, 1, '10.0', 'Les termes St Germain: Persomnel très accueillant agrèables. Moment de détente Inoubliable pourtant, Je me suis déjà faite masser dans d''autres instituts mais jamais ressentit comme ici. Nous reviendrons. MERCI NAWEL :)', '1', '2012-12-29 19:33:35', NULL),
(1696, 1, '10.0', 'Je te recommande sans hésiter d''aller chez Attitude beauté. Non seulement tu seras contente de la prestation ( mention particulière pour l''onglerie ) et en plus tu te sens très bien dans cet institut, comme une 2eme maison !', '1', '2012-12-30 18:28:58', NULL),
(1697, 1, '10.0', 'Service tout à fait satisfaisant !\r\nJ''ai beaucoup aimé la coupe qu''on m''a faite.', '1', '2012-12-30 19:23:57', NULL),
(1698, 1, '10.0', 'L''accueil est très chaleureux, les conseils &quot; technique couleur &quot; d''Audrey   \r\net &quot;  coupe &quot; de Fred toujours professionnels et sur mesure. Le temps d''un rendez vous, je suis chez des amis. Je suis toujours ravie de ma coiffure en partant et n''ai qu''une envie : vite revenir ! ', '1', '2012-12-30 19:30:00', NULL),
(1699, 1, '10.0', 'Le cadre est vraiment sympa et très agréable.\r\nLe déroulement parfait pour vraiment se détendre.', '1', '2012-12-30 19:33:20', NULL),
(1700, 1, '10.0', '', '1', '2012-12-30 19:36:56', NULL),
(1701, 1, '10.0', 'Très bonne ambiance\r\nBon accueil, très bon travail.', '1', '2012-12-30 19:39:35', NULL),
(1702, 2, '8.0', 'Je te recommande ce coiffeur parce que l''accueil est conviviale, ils sont très sympathique.\r\nTu reçois des conseils avec le sourire.', '1', '2012-12-30 19:44:51', NULL),
(1703, 1, '8.0', 'Très bon massage et gommage juste une remarque, la musique pourrait être plus douce et écouter dans chaque pièce. :-) plus intime et détendant.', '1', '2012-12-30 19:48:55', NULL),
(1704, 1, '10.0', 'Conseil, accueil chaleureux, brushing qui tient : vas y ! ', '1', '2012-12-30 19:51:12', NULL),
(1705, 1, '10.0', 'Salon découvert par hasard il y a deus ans environ, bien qu''habitant la banlieue j''ai abandonné mon précédent salon que je fréquentais depuis 20 ans ! Hehe! Bien entendu par la grande satisfaction de vos soins. Je suis enchantée et pour la couleur ainsi que pour la coupe. Merci.', '1', '2012-12-30 19:55:15', NULL),
(1706, 1, '10.0', 'Comme c''est agréable d''être accueillie avec le sourire.\r\nDe plus audrey est une personne très attentionnée qui essaie de vous satisfaire le mieux possible.', '1', '2012-12-30 19:57:59', NULL),
(1707, 1, '10.0', 'L''accueil est toujours aussi agréable quand je viens au salon. J''apprécie également les conseils avisés de ma coiffeuse et le bon soin apporté à mes cheveux et à ma coupe.', '1', '2012-12-30 20:01:10', NULL),
(1708, 1, '10.0', 'Mise à part le mal entendu sur l''heure du rdv, la séance à été bien agréable, le massage était parfait. Dommage que nous n''ayons pas pu profiter du hammam juste avant.\r\nJe recommande l''institut. Cadre également très agréable.', '1', '2012-12-30 20:04:28', NULL),
(1709, 2, '8.0', 'Accueil chaleureux, je viens ici non seulement pour me faire belle mais aussi pour me délasser.', '1', '2012-12-30 20:07:26', NULL),
(1710, 3, '6.0', 'Ma fille et moi avons appréciés nos entrées, notamment ma fille avec son feuilleté de maquereau.\r\nEn revanche, nous avons été un peu déçues par le lapin... Trop de sauce, trop de raisins, pas vraiment une fricassée car le lapin était trop bouilli.\r\nPar contre service attentionné, sérieux, produit frais...', '1', '2012-12-30 20:12:53', NULL),
(1711, 1, '10.0', 'Tu devrais aller chez atelier c, l''équipe est sya, de plus ils sont les seuls a utiliser les produits revlar.\r\nÇa fait des annees que j''y vais et j''y suis très satisfaite.', '1', '2012-12-30 20:16:47', NULL),
(1712, 1, '10.0', 'Après avoir essayer beaucoup de coiffeur dans Paris, enfin un salon qui prend soin de moi, qui fait ce qui me va ! Couleur, coupe, brushing, je suis ( enfin ! ) heureuse quand je sors d''ici.', '1', '2012-12-30 20:19:54', NULL),
(1713, 1, '10.0', 'Calme, douceur, odeurs...\r\nMerci ! ', '1', '2012-12-30 20:22:14', NULL),
(1714, 2, '8.0', 'Salon très professionnel. Isabelle, coloriste de grand talent et Nathalie fait d''excellentes coupes de cheveux. Personnel aimable et poli. Ambiance agréable.\r\nAttention au &quot; masticage &quot; de cheming-gum d''un employé !', '1', '2012-12-30 20:26:36', NULL),
(1715, 2, '8.0', 'Salon très agréable et très professionnel.\r\nDepuis 12 ans, l''accueil et les coiffeurs sont très compétents. J''y vais très régulièrement et toujours satisfaite.', '1', '2012-12-30 20:29:56', NULL),
(1716, 2, '8.0', 'Une belle pause au milieu de la grisaille parisienne de ce mois de décembre.\r\n1h30 de pur repos, totalement relaxée par des mains expertes.', '1', '2012-12-31 16:43:23', NULL),
(1717, 1, '10.0', 'Excellent service. Accueil de qualité. Parfait.', '1', '2012-12-31 16:45:42', NULL),
(1718, 1, '10.0', 'Très mignon avec ses nouvelles lunettes.', '1', '2012-12-31 16:48:43', NULL),
(1719, 1, '10.0', 'Enfin un vrai coiffeur! Venez nombreux!', '1', '2012-12-31 16:51:59', NULL),
(1720, 1, '10.0', 'Très bon coiffeur! Je le suis depuis des années et il ne m''a jamais déçue! Je lui envoie plein d''amis qui sont également très contents.\r\nJe recommande!', '1', '2012-12-31 16:57:14', NULL),
(1721, 1, '10.0', 'Super coupe par Carolin qui est a l''écoute de mes besoins et &quot;coquetteries&quot;.', '1', '2012-12-31 16:59:28', NULL),
(1722, 1, '10.0', 'Superb!\r\nNos encanto\r\nEl segundo ano que venimos desde méxico.', '1', '2012-12-31 17:04:34', NULL),
(1723, 2, '8.0', 'Très bien.', '1', '2012-12-31 17:07:17', NULL),
(1724, 1, '10.0', 'Rien à redire!', '1', '2012-12-31 17:09:14', NULL),
(1725, 2, '8.0', 'Moment agréable de détente après un hammam détoxifiant, un bon gommage et massage! Tout va mieux!', '1', '2012-12-31 17:12:22', NULL),
(1726, 1, '10.0', 'Encore une fois ravie du coup de ciseau de Mickaël. Jamais de mauvaise surprise.Les produits utilisés sont de très bonne qualité et les couleurs toujours très naturelles. Le meilleur coiffeur des batignolles sans aucun doute!!!', '1', '2012-12-31 17:16:48', NULL),
(1727, 1, '10.0', 'Ce fut une belle soirée! Bonne ambiance conviviale.\r\nNous avons bien diné et rentrons très contentes!\r\nOn vous recommande cette jolie adresse!', '1', '2012-12-31 17:23:30', NULL),
(1728, 1, '10.0', 'Le salon est esthétiquement beau.\r\nL''ambiance et l''équipe chaleureuse et la coupe est super! Merci! ', '1', '2012-12-31 17:28:21', NULL),
(1729, 1, '10.0', 'Continuez!', '1', '2012-12-31 17:30:20', NULL),
(1730, 2, '8.0', 'Accueil sympathique.', '1', '2012-12-31 17:33:27', NULL),
(1731, 1, '10.0', 'Un grand merci à l''atelier C pour leur patience et leur très bon travail. Sans eux, mes cheveux auraient très certainement été coupés, sans réflexion préalable, mais grâce à l''Atelier C, la longueur à pu être gardée. Un grand merci à eux trois !', '3', '2012-12-31 17:34:31', 1),
(1732, 1, '10.0', 'Super gentils!!', '1', '2012-12-31 17:35:46', NULL),
(1733, 1, '10.0', 'Accueil parfait.\r\nTrès professionnel.\r\nConseils personnalisés.\r\nA recommander +++', '1', '2012-12-31 17:38:17', NULL),
(1734, 2, '8.0', 'C''est la 1er fois que je suis fidèle à un coiffeur.', '1', '2012-12-31 17:38:25', NULL),
(1735, 2, '8.0', 'Prestation de qualité.\r\nBon rapport qualité-prix.\r\nPersonnel qualifié et agréable.', '1', '2012-12-31 17:40:16', NULL),
(1736, 3, '6.0', 'Service très sympa et chaleureux. Les solutions proposées sont peut être un peu viellottes.', '1', '2012-12-31 17:41:07', NULL),
(1737, 2, '8.0', 'Super soin au chocolat!\r\nMoment de détente et de relaxation assuré, petit plus pour le massage et l''odeur de cacao à la fin du soin!', '1', '2012-12-31 17:43:04', NULL),
(1738, 1, '10.0', 'Salon très agréable. Personnel très accueillant. Excellente prestation. Je reviendrais avec plaisir. Gisèle coiffure devient mon salon de coiffure.', '1', '2012-12-31 17:45:16', NULL),
(1739, 1, '10.0', 'Très satisfaite. Prête à revenir à l''occasion d''un séjour à Paris.', '1', '2012-12-31 17:46:42', NULL);
INSERT INTO `avis` (`id_avis`, `appreciation`, `note`, `commentaire`, `origine`, `date_avis`, `rester_contact`) VALUES
(1740, 1, '10.0', 'Plus de 10 ans que je viens à l''ATELIER C et jamais déçue. L''accueil chaleureux et le sourire de Sophie sans oublier les blagues de Norbert et surtout c''est une équipe de choc. De bons conseils et à l''écoute, je leur confie ma tête sans souci. Allez-y !', '1', '2012-12-31 17:49:12', NULL),
(1741, 1, '10.0', 'Equipe sympa, massage divin! A refaire! Bon pour moi c''est déjà la 3 éme fois alors c''est que c''est bien!\r\nGommée et massée des pieds à la tête, c''est tout ce qu''on aime!', '1', '2012-12-31 17:50:57', NULL),
(1742, 1, '10.0', 'Très bien. Parfait. Et surtout Nathalie.', '1', '2012-12-31 17:51:20', NULL),
(1743, 3, '6.0', 'Massage très agréable dans une belle ambiance.\r\nIl manque un espace pour se rafraîchir ( petite piscine) et quelques huiles essentielles dans le hammam...', '1', '2012-12-31 17:53:44', NULL),
(1744, 2, '8.0', 'Accueil agréable, bonne écoute, respect des conseils des clientes et des clients. Je propose de mettre un séchoir chauffant pour les serviettes pour l''hiver &quot;seulement&quot;', '1', '2012-12-31 17:55:17', NULL),
(1745, 2, '8.0', 'Espace de détente très agréable.\r\nEspace atypique et propre. ', '1', '2012-12-31 17:56:08', NULL),
(1746, 2, '8.0', 'Reposant, relaxant.\r\nTrès bonne adresse et a faire au plus vite!', '1', '2012-12-31 17:58:24', NULL),
(1747, 2, '8.0', 'Un moment très agréable, seule ou entre amies!', '1', '2012-12-31 18:00:09', NULL),
(1748, 1, '10.0', 'Accueil très sympathique. Je suis très satisfaite de l''échange avec la personne qui s''est occupée de moi. Je m''aperçois que la relation établie est meilleure que dans les grands instituts. Je reviendrai. Merci', '1', '2012-12-31 18:00:52', NULL),
(1749, 2, '8.0', 'Ce cadeau m''a été offert par une amie et j''ai particulièrement apprécié! Un massage relaxant: la masseuse était très douée ( Idha je pense) ', '1', '2012-12-31 18:03:03', NULL),
(1750, 1, '10.0', 'Très bel endroit, intimiste, un endroit calme. Les coiffeuses attentionnées et gentilles', '1', '2012-12-31 18:03:31', NULL),
(1751, 1, '10.0', 'Très satisfaite du hammam et surtout du massage. Masseuse très professionnelle.\r\nUn service agréable.\r\nA recommander. Merci à bientôt !!!', '1', '2012-12-31 18:05:57', NULL),
(1752, 2, '8.0', 'Je suis très contente de la prestation assurée par ma coiffeuse. Elle s''occupe très bien de ses clientes régulières et des nouvelles.', '1', '2012-12-31 18:07:43', NULL),
(1753, 1, '10.0', 'J''ai passé un super moment, totalement relaxant, un cadeau de mon amoureuse j''y retournerai!', '1', '2012-12-31 18:08:40', NULL),
(1754, 1, '10.0', 'Très beau salon ou on se sent bien. Quant à la coiffeuse, très bonne professionnelle. J''y reviens tous les mois.', '1', '2012-12-31 18:10:50', NULL),
(1755, 2, '8.0', 'Plats très bien cuisinées, gentillesse du service, cadre très agréable.', '1', '2012-12-31 18:11:34', NULL),
(1756, 1, '10.0', 'De très bons conseils !', '1', '2012-12-31 18:13:08', NULL),
(1757, 1, '10.0', 'Deuxième passage chez vous et de plus en plus conquise= service au top, souriant et de bon conseil, plat excellents.\r\nOn reviendra mais nombreux. Adresse à faire connaitre.', '1', '2012-12-31 18:14:16', NULL),
(1758, 1, '10.0', 'Accueil parfait. Champoing relaxant. Coupe répondant à mes attentes, stylisée. Bonne ambiance.', '1', '2012-12-31 18:15:18', NULL),
(1759, 1, '10.0', 'Je suis très contente de mon salon de coiffure que je fréquente depuis 6 ans.\r\nAccueil, ambiance, travail, tout me convient! \r\nMerci.. et bonne santé à tous!', '1', '2012-12-31 18:18:02', NULL),
(1760, 1, '10.0', 'Accueil très sympathique et professionnel.\r\nMerci pour ce bon moment.\r\nAu plaisir de vous revoir.\r\n', '1', '2012-12-31 18:23:05', NULL),
(1761, 1, '10.0', 'Aller chez le coiffeur, c''est lâcher prise, c''est un moment de détente et de plaisir. Voila pourquoi je n''envisage pas d''aller ailleurs que chez &quot;mon&quot; coiffeur et en plus c''est un rituel que j''effectue bien volontier, avec ma maman. L''une comme l''autre adorons la qualité de l''accueil, l''écoute, le professionnalisme, et que l''on prenne soin de nous !', '1', '2012-12-31 18:25:18', NULL),
(1762, 1, '10.0', 'Une nouvelle tête à chaque fois, toujours aussi efficace et professionnelle. Venez nombreux et nombreuses!', '1', '2012-12-31 18:26:57', NULL),
(1763, 2, '8.0', 'Untrès bon accueil, et surtout un professionalisme assuré! \r\nOne ne peut pas être déçue.\r\nJe le recommande vivement pour les ongles en tout cas. Merci', '1', '2012-12-31 18:31:54', NULL),
(1764, 2, '8.0', 'Accueil et disponibilité au top voilà plus de 10 ans que Sabine me fait mon balayage et j''en suis toujours aussi contente et les amies le remarque et me félicite ! Merci encore', '3', '2012-12-31 18:35:15', 1),
(1765, 2, '8.0', 'Je suis tout à fait satisfaite du soin manucure et pose de vernis de l''institut Ongles et Beauté. Un service de qualité et de très bon conseils pour l''entretient dans le temps de ses ongles et en plus à deux pas de chez soi, c''est parfait!  ', '1', '2012-12-31 18:35:22', NULL),
(1766, 1, '10.0', 'Très sympa et très bons conseils.', '1', '2012-12-31 18:37:16', NULL),
(1767, 1, '10.0', 'Très satisfaite. Bon résultat et bon conseil.', '1', '2012-12-31 18:39:33', NULL),
(1768, 1, '10.0', 'De la minutie. Goût du travail bien fait. Bravo.', '1', '2012-12-31 18:43:43', NULL),
(1769, 1, '10.0', 'Coiffeuses EXTRA!!! Coiffure toujours impeccable, si dans un futur nous pouvions pousser les murs??? Ambiance ++++', '1', '2012-12-31 18:43:58', NULL),
(1770, 2, '8.0', 'Très bon accueil, service parfait. Satisfaite.', '1', '2012-12-31 18:46:12', NULL),
(1771, 1, '10.0', 'Sabine nous fidélise par son professionnalisme et sa bonne humeur !... Excellente technicienne les couleurs sont parfaites et la coupe toujours adaptée au visage.', '1', '2012-12-31 18:46:37', NULL),
(1772, 1, '10.0', 'J''ai été très bien accueilli: sourires, thé et gâteaux.\r\nLa prestation était excellente, je reviendrai avec plaisir.', '1', '2012-12-31 18:49:14', NULL),
(1773, 1, '10.0', 'Très bon institut. Compètence, amabilité.\r\nSoins bien adaptés. Les conseils sont judicieux.\r\nPropreté des cabines.', '1', '2012-12-31 18:54:04', NULL),
(1774, 2, '8.0', 'Ce commercant me donne satisfaction. Je le recommande à mes amis. Compétence et honnete', '1', '2012-12-31 18:54:33', NULL),
(1775, 2, '8.0', 'Moment de détente et relaxation, personnel et cadre agréable, très bon accueil, a faire connaitre. Merci les amis pour ce cadeau !', '1', '2012-12-31 18:56:51', NULL),
(1776, 1, '10.0', 'Mickaël a toujours des nouveautés à nous proposer et reste un as de la coiffure!', '1', '2012-12-31 18:58:40', NULL),
(1777, 1, '10.0', 'Accueil chaleureux, on se sent à la maison. Je ressors toujours satisfaite quant à ma coiffure ( couleur des mèches, coupe ). Sabine est devenue une amie.', '1', '2012-12-31 19:00:04', NULL),
(1778, 1, '10.0', 'Personnel très aimable et accueillant. Salon clair, bien situé, chef cool ainsi que Sophie toujours de bon conseils.\r\nProduit abordable.\r\nJe recommande ce salon.', '1', '2012-12-31 19:02:10', NULL),
(1779, 1, '10.0', 'L''accueil est très agréable et je suis toujours satisfaite - et bien coiffée !', '1', '2012-12-31 19:02:31', NULL),
(1780, 1, '10.0', 'Je suis très contente de la personne qui prend soin de moi.', '1', '2012-12-31 19:04:27', NULL),
(1781, 2, '8.0', 'Sandrine, coiffeuse à recommander, travail soigné, conseil pour tout cheveu. Très humaine avec ses clients, surtout ceux de l''hopitâl saint Antoine. Peu faire beaucoup pour son travail bien fait, sérieux.', '1', '2012-12-31 19:05:40', NULL),
(1782, 1, '10.0', 'Endroit agréable et bonne ambiance !', '1', '2012-12-31 19:07:34', NULL),
(1783, 1, '10.0', 'J''ai enfin trouvé un bon coiffeur à paris. Mickael est non seulement passionné mais aussi un professionnel de talent qui trouve votre couleur, votre coupe et reste à votre écoute. En plus les produits utilisés sont excellents.', '1', '2012-12-31 19:10:40', NULL),
(1784, 2, '8.0', 'Soin agréable et bien expliqué à chaque étape.\r\n', '1', '2012-12-31 19:12:40', NULL),
(1785, 1, '10.0', 'La coupe courte sur cheveux extra fins est la chose la plus difficile au monde ! Michael réalise le miracle: il épaissit, ds la souplesse et renforce le cheveux. Une couleur subtile, je suis conquise.', '1', '2012-12-31 19:16:00', NULL),
(1786, 1, '10.0', 'J''ai vraiment passé un très agréable moment. La relaxation est au rendez-vous. C''était vraiment super, en espérant pouvoir revivre cette expérience à nouveau. Gommage intense + massage très relaxant = très bon moment !', '1', '2013-01-01 00:46:47', NULL),
(1787, 1, '10.0', 'Je recommandrais sans hésiter cet institut qui ne manque pas de professionalisme. Très bonne accueil.Délicieux gommage à la mangue et massage bien appuyé fait par Ariel.\r\nBref à refaire! Encore merci.', '1', '2013-01-02 12:46:16', NULL),
(1788, 1, '10.0', 'BRAVO à Gilles 20/20 satisfaction totale.\r\nPour la coupe 1 Bemol, trop d''attente!! en bas. Sinon rien à dire. Sauf 1 carte avec des points serait la bienvenue pour obtenir de temps à autre une coupe gratuite.', '1', '2013-01-02 12:51:54', NULL),
(1789, 1, '10.0', 'Tout c''est très bien!', '1', '2013-01-02 12:55:01', NULL),
(1790, 1, '10.0', 'Très contente de ma nouvelle coiffure.\r\nJoseph est super sympa et a beaucoup de talent.', '1', '2013-01-02 12:58:12', NULL),
(1791, 1, '10.0', 'Service impeccable.\r\nUn plaisir d''y revenir.\r\nMerci', '1', '2013-01-02 13:01:08', NULL),
(1792, 1, '10.0', 'Salon très agréable.\r\nCoiffure et couleur Satisfaite!', '1', '2013-01-02 13:03:48', NULL),
(1793, 1, '10.0', 'Je suis un québécois en mission pour trois ans a Paris et je suis très heureux d''avoir trouvé Bruno Crescenzii comme &quot;BARBIER&quot;. Les salons de coiffure pour hommes sont rare à Paris et celui-ci est près de mon bureau.', '1', '2013-01-02 13:07:37', NULL),
(1794, 1, '10.0', 'À première vue un salon basique mais la différence est vite faite lorsque la patronne vous prend en main pour éviter une attente trop longue.En plus de ça elle est plus maniaque que moi ! Delire! et le moindre cheveux de travers ou pas coupe comme il faut, ne lui échappe pas.Autant dite que la règle du satisfait ou rembourse n''a pas besoin d''être appliquée ! Adresse à conserver.', '1', '2013-01-02 13:38:59', NULL),
(1795, 1, '10.0', 'Soin très agréable. Adapté au type de peau. Institut agréable', '1', '2013-01-05 12:58:36', NULL),
(1796, 1, '10.0', 'Vos miches .... aussi belle que celles ... Bravo. Je sais que vous avez de l''humour en plus du goût.', '1', '2013-01-05 13:01:26', NULL),
(1797, 1, '10.0', '', '1', '2013-01-05 13:16:49', NULL),
(1798, 2, '8.0', 'C''est bien! Les teintures végétales surtout, et les carrés courts. Ca manque un peu d''espace mais bon...', '1', '2013-01-05 13:28:55', NULL),
(1799, 1, '10.0', 'C''est cool !!!!!! ', '3', '2013-01-05 13:29:46', 0),
(1800, 1, '10.0', 'Je suis venue pour ne plus avoir à faire de brushing... Promesse tenue coiffage à la maison en 10 min et super résultat... Conseils avertis et gentillesse de toute l''équipe. Restez comme vous êtes et je reviendrais souvent. Avec la couleur vegetale j''ai retrouvé des cheveux souples et soyeux...Génial! MERCI.', '1', '2013-01-05 13:32:52', NULL),
(1801, 2, '8.0', 'Le burger était bon et la formule pas chère mais la crème brûlée n''était pas top. Donc vas-y pour le burger, mais pas le dessert.\r\nLa salade en entrée était un peu triste.', '1', '2013-01-05 13:34:48', NULL),
(1802, 1, '10.0', 'Très grand salon. Un coiffeur talentueux pour récupérer une coupe et me redonner un visage !! Merci pour l''accueil et la prise en charge', '3', '2013-01-05 13:35:57', 1),
(1803, 1, '10.0', 'Service impeccable, formules parfaites, qualité/prix super et surtout Bon hamburgers! Ambiance convivial entre amis et même avec client sympa!', '1', '2013-01-05 13:37:45', NULL),
(1804, 2, '8.0', 'Excellent service, aimable serveuse.\r\nMenu abordable, frite maison...', '1', '2013-01-05 13:40:02', NULL),
(1805, 1, '10.0', '', '3', '2013-01-05 13:40:05', 0),
(1806, 4, '2.0', 'Un peu déçue. Portion de frites trop peu conséquente.\r\nKetchup jamais arrivé.\r\nMais service agréable. Ambiance un peu bruyante néanmoins.', '1', '2013-01-05 13:44:28', NULL),
(1807, 1, '10.0', 'Merci de prendre soin de moi !', '1', '2013-01-05 13:59:10', NULL),
(1808, 1, '10.0', 'Un acceuil chaleureux, de très bons conseils et toujours le sourire, c''est fort agréable. Je reviendrai et parlerai a mon entourage d''ATELIER C.\r\nMerci à l''équipe.', '1', '2013-01-05 14:02:57', NULL),
(1809, 2, '8.0', 'La demoiselle qui s''occupe du massage et l''épilation est très douce, sait mettre à l''aise, l''huile utilisée sent très bon, l''espace massage est relaxant, manque peut être d''un point d''eau accessible à celle qui veulent se laver les mains mais c''est pas indispensable.', '1', '2013-01-05 14:06:52', NULL),
(1810, 2, '8.0', 'Bon accueil.\r\nBon conseils...\r\nJe suis ravie d''avoir découvert cette adresse.', '1', '2013-01-05 14:10:13', NULL),
(1811, 1, '10.0', 'Merci pour l''écoute, l''échange chaleureux.\r\nJe suis très satisfaite. Ca faisait longtemps que je cherchais ça!\r\nA bientôt!', '1', '2013-01-05 14:13:38', NULL),
(1812, 2, '8.0', 'Relooking maquillage+ coiffure réussi.\r\nPlein de conseil pour le maquillage, je le recommande.\r\nA faire au moins une fois.', '1', '2013-01-05 14:16:21', NULL),
(1813, 1, '10.0', 'Merci pour le soin complet avec shiatsu de la tête. Les produits utilisés sont bio et sentent bon les fleurs.', '1', '2013-01-05 14:19:08', NULL),
(1814, 1, '10.0', 'Massage très agréable tant au niveau des mouvements que de la durée. Une envie d''insistance sur les bras et les mains.  ', '1', '2013-01-05 14:22:26', NULL),
(1815, 2, '8.0', 'Massage relaxant et décontractant.\r\nGommage très agréable.', '1', '2013-01-05 14:24:45', NULL),
(1816, 1, '10.0', 'Un lieu très convivial et agréable pour se faire chouchouter un samedi pluvieux.\r\nVous confiez vos cheveux à de très bonnes mains!', '1', '2013-01-05 14:27:25', NULL),
(1817, 1, '10.0', 'Tout est réussi!! La coupe, la couleur, l''accueil, le service quoi !! Merci beaucoup. :-)', '1', '2013-01-05 14:30:33', NULL),
(1818, 1, '10.0', 'Ambiance très sympa. Très professionnel.\r\nA l''écoute de nos envies. Bon conseillers.\r\nQue du plus, avec café, bonne humeur et bon moment de détente.', '1', '2013-01-05 14:34:16', NULL),
(1819, 2, '8.0', 'La coiffeuse m''a conseillé une Reconstruction.\r\nJ''ai été super satisfaisante, mes cheveux n''ont jamais été aussi soyeux et volumineux!\r\nMerci encore au super conseil de Lili ( la coiffeuse! )', '1', '2013-01-05 14:38:35', NULL),
(1820, 1, '10.0', 'J''ai découvert ce salon grâce à Beauté Privée.\r\nJe suis enchantée aussi bien de l''accueil, délicieux gâteau au chocolat fait par la &quot;patronne&quot;, que par les prestation et la coupe.\r\nJe reviendrai.', '1', '2013-01-05 14:44:53', NULL),
(1821, 2, '8.0', 'Accueil et rapidité du rendez-vous (immédiat) très appréciès. Par contre moins convaincue par le nettoyage &quot;en profondeur&quot; ( demande à extraire les points noirs autour des lèvres, mais apparement impossible) et massage visage trop court.', '1', '2013-01-05 14:48:45', NULL),
(1822, 3, '6.0', 'Ensemble délicieux, dommage que le pain du burger soit beurré :(', '1', '2013-01-05 14:51:39', NULL),
(1823, 2, '8.0', 'Bon conseil tant au niveau colorimétrie que coupe de cheveux.\r\nJe reviendrai et je conseille ce salon.', '1', '2013-01-05 14:58:56', NULL),
(1824, 1, '10.0', 'Service très Satisfaisant.\r\nLes couleurs Magnifique et coupe.\r\nPersonne très sympathique.', '1', '2013-01-05 15:04:11', NULL),
(1825, 1, '10.0', 'Rapide, sympathique. De bons conseils.', '1', '2013-01-05 15:06:47', NULL),
(1826, 1, '10.0', 'Accueil chaleureux ambiance de quartier dynamique et simple. La coupe est revisitée si nécessaire et créative. Merci pour ces petits moments de bien être.\r\nA conseiller +++ ', '1', '2013-01-05 15:09:57', NULL),
(1827, 1, '10.0', '', '1', '2013-01-05 15:12:23', NULL),
(1828, 1, '10.0', 'Excellente expérience que je recommande!\r\nSoins et conseils très professionnels. Accueil agréable.\r\nJe reviendrai très vite!', '1', '2013-01-05 15:15:38', NULL),
(1829, 3, '6.0', 'Bonne adresse café gourmand hors de prix!\r\nMerci de penser a changer la hotte!', '1', '2013-01-05 15:43:46', NULL),
(1830, 1, '10.0', 'Très bon salon et très agréable comme environnement à recommander.', '1', '2013-01-05 15:46:33', NULL),
(1831, 1, '10.0', 'Coiffeur très sympa.\r\nEt très bon coiffeur.', '1', '2013-01-05 15:48:36', NULL),
(1832, 2, '8.0', 'J''ai passé un moment très agréable! Le modelage californien est à la fois relaxant et tonique.\r\nJe n''ai pas vu le temps passer!', '1', '2013-01-05 15:52:22', NULL),
(1833, 2, '8.0', 'Très bon repas,cadre agréable, service simple mais efficace. Peut-être faudrait-il ajouter un peu plus de fromage dans le hamburger pour qu''il soit encore plus gourmand...', '1', '2013-01-05 15:56:36', NULL),
(1834, 1, '10.0', 'J''ai été massé par Nawel c''était formidable.\r\nElle s''est réellement parfaitement occupée de moi .\r\nJ''ai passé un moment de détente.\r\n= BILAN TRES POSITIF en espérant vivement me refaire massé par Nawel +++ thé et personnel sympathique. ', '1', '2013-01-05 16:01:05', NULL),
(1835, 1, '10.0', 'Venu pour la premières fois avec mon père il y a sept ans, j''ai tout de suite été ravi par l''accueil chalereux de ce salon, qui m''a fidélisé pour de bon.', '1', '2013-01-05 16:04:44', NULL),
(1836, 1, '10.0', 'Génial. Comme d''habitude.', '1', '2013-01-05 16:07:22', NULL),
(1837, 1, '10.0', 'Etant donné que je suis la seule femme que tu coiffes je peux confirmer que tu coiffes aussi bien les femmes que les hommes, ambiance au top, toujours bien reçu avec le sourire et des blagues pas drôle.', '1', '2013-01-05 16:12:41', NULL),
(1838, 2, '8.0', 'Service souriant sympa et rapide ( j''étais bousculée par des horaires et ils ont assuré !)', '1', '2013-01-05 16:16:11', NULL),
(1839, 2, '8.0', 'La coupe est bien faite, mais plus particulièrement les contours.', '1', '2013-01-05 16:18:44', NULL),
(1840, 1, '10.0', 'Toujours accueillant, il arrive à récuperer mes coupes &quot;sauvages&quot; lorsque j''ai moi même taillé ma chevelure... c''est encore le cas aujourd''hui.', '1', '2013-01-05 16:28:41', NULL),
(1841, 1, '10.0', 'Simple et efficace! Mon coiffeur préféré à Paris! Des dégradés pas trop effilés et une repousse impec ! Pareil pour les couleurs et mèches vous pouvez y aller les yeux fermés.', '1', '2013-01-05 16:34:44', NULL),
(1842, 1, '10.0', 'Rien à dire!!! Je vous le conseille vraiment!\r\nCela fait des années que je viens très régulièrement au salon de Jean-Louis Deforges.\r\nJe suis aussi bien satisfaite de l''académie que du salon. ', '1', '2013-01-05 16:39:57', NULL),
(1843, 2, '8.0', 'Tu es accueillie comme chez des amis, on t''offre le thé ou le café, les journaux, les conseils éclairés. Les fauteuils sont moelleux et tu peux aussi bénéficier d''un massage du cuir chevelu. Le bonheur !', '1', '2013-01-06 12:46:28', NULL),
(1844, 1, '10.0', 'Tu me poses la question, je te répond: ce qui compte le plus pour moi dans ma relation avec les personnes qui animent un institut de beauté c''est: l''Accueil ! Il faut que ce soit dès le premier contact; que ce soit pas seulement de façade ou commercial. &quot;Attitude beauté&quot; en dehors des soins qui me satisfont, m''offrent ce contact que j''aime.', '1', '2013-01-06 13:45:58', NULL),
(1845, 2, '8.0', 'Juste un petit tapis pour poser les pieds pour éviter que les pieds soient directement sur le carrelage froid lors d''un soin de pied. Douceur et gentillesse sont au rendez vous ainsi que le sourire très agréable + le thé très bon ... Merci, je reviendrai...', '1', '2013-01-06 16:47:05', NULL),
(1846, 1, '10.0', 'Bravo à Marceline pour sa coupe et son accueil rafraichissant.', '1', '2013-01-07 19:34:51', NULL),
(1847, 1, '10.0', 'Un salon accueillant, professionnel, une équipe de Choc.\r\nFidèle depuis l''ouverture.', '1', '2013-01-07 19:40:38', NULL),
(1848, 2, '8.0', 'Bon accueil, bonne présentation, plats originaux pour des burgers mais servis un peu trop froids.', '1', '2013-01-07 19:44:35', NULL),
(1849, 1, '10.0', 'accueil très agréable. Les coiffeuses sont aux petits soins et comme clients je suis très satisfaite de leurs services.\r\nCela fait plusieurs fois que je viens et je reviendrais.', '1', '2013-01-07 19:49:21', NULL),
(1850, 1, '10.0', 'Super salon.\r\nComme d''habitude une équipe géniale.\r\nSandrine à une technique exceptionnelle.\r\nJe ne change plus de salon!!!', '1', '2013-01-07 19:52:48', NULL),
(1851, 2, '8.0', 'A l''écoute, donne beaucoup de conseil.\r\nPas pressé par le temps. Soucis de répondre à la demande du client.\r\nTrès bonne prestation. Bon rapport Q/P.\r\nJe reviendrai', '1', '2013-01-07 19:58:19', NULL),
(1852, 2, '8.0', 'Etonant d''avoir 3 entrées sur 4 avec supplement??!!\r\nFrites trop frits(cuits)\r\nSinon bon gout et service agréable.\r\n', '1', '2013-01-07 20:04:39', NULL),
(1853, 2, '8.0', 'C''était bon, mais il manquait le fromage dans le classic burger.\r\nPas de bières en pression -10 points.', '1', '2013-01-07 20:11:03', NULL),
(1854, 1, '10.0', 'Meme si pour moi les cheveux c''est très important, ma coiffeuse a su me montrer que j''avais toutes les raisons de laisser mes cheveux entre ces mains.\r\nJe lui fais à présent une total confiance!', '1', '2013-01-07 20:14:31', NULL),
(1855, 1, '10.0', 'Je suis contante de ma coiffeuse.', '1', '2013-01-07 20:16:15', NULL),
(1856, 2, '8.0', 'Endroit sympa, beaucoup de choix dans les burgers. Ca manque de bonne musique ;-)', '1', '2013-01-07 20:19:24', NULL),
(1857, 3, '6.0', 'Bon rapport qualité prix. Restaurant sympa.\r\nPetites critiques: apporter un peu plus de finesse ex dans le pain de hamburger, la tarte au chocolat un peu trop consistante.', '1', '2013-01-07 20:22:44', NULL),
(1858, 3, '6.0', 'Frites trop cuites.', '1', '2013-01-07 20:25:08', NULL),
(1859, 1, '10.0', 'Très bon à tous les niveaux avec un sourire très professionnel( efficace, rapide et discret).\r\nMerci infiniment pour ce délicieux moment!\r\nN''habitant pas loin, nous reviendrons!', '1', '2013-01-07 20:28:44', NULL),
(1860, 1, '10.0', 'J''adore ma coiffure et mes adorables coiffeuses!! &lt;3', '1', '2013-01-09 19:27:04', NULL),
(1861, 1, '10.0', 'Très bon service. J''ai deménagé aux Etats-Unis et sa me fait plaisir de pouvoir revenir dans ce salon quand je rentre à Paris. J''ai toujours aimé les coupes ici et je vous recommenderai de venir.', '1', '2013-01-09 19:30:15', NULL),
(1862, 1, '10.0', '', '1', '2013-01-09 19:32:10', NULL),
(1863, 2, '8.0', 'Très bon commerçant sérieux et sympatique.\r\nRigolo à bientot .', '1', '2013-01-09 19:43:16', NULL),
(1864, 2, '8.0', 'Ce salon est toujours de bon conseil sur l''entretient et la réparation des cheveux.\r\nLe coiffeur est plein de fait et de savoir faire.\r\nMerci également pour la disponibilité des rdv toujours arrangeant sur les horaires.', '1', '2013-01-09 19:47:14', NULL),
(1865, 2, '8.0', 'L''accueil est toujours au RDV. L''institut est top! Un moment de bonheur intense ou on oublie stress et soucis. Et surtout qu''on est à Paris! Un petit regret: le massage du crâne, mais c''est un détail. Je suis prête pour la fin du monde!!! YEAH!', '1', '2013-01-09 19:51:26', NULL),
(1866, 1, '10.0', 'Super repas, le service est génial!\r\nJe reviendrai... :)', '1', '2013-01-09 19:53:23', NULL),
(1867, 1, '10.0', '', '1', '2013-01-09 19:55:08', NULL),
(1868, 2, '8.0', 'Bon burger même si le pain n''est pas très moelleux et pourrait être meilleur.', '1', '2013-01-09 19:57:41', NULL),
(1869, 2, '8.0', 'Moment agréable, même si trop court,mais n''est-ce pas toujours trop court ? :)\r\nBon accueil, une propreté impeccable et un thé à la menthe pour finir en beauté!\r\nUne serviette à disposition et un temps de massage plus long serait un gros plus!', '1', '2013-01-09 20:03:07', NULL),
(1870, 1, '10.0', 'Depuis 2002, je suis très satisfaite de ce salon très agréable et tout en musique. Cela est super. A très bientôt et de bonnes fêtes de fin d''année 2012.', '1', '2013-01-09 20:07:34', NULL),
(1871, 1, '10.0', 'Beau plafond. Bon burger.\r\n+ de sauce dans la salade.', '1', '2013-01-09 20:10:20', NULL),
(1872, 4, '2.0', 'Les frites sont grillées, trop cuites, le steak du hamburger est bon mais le pain est moyen..\r\nEn résumé, je ne conseillerai pas ce restaurant.', '1', '2013-01-09 20:12:54', NULL),
(1873, 2, '8.0', 'Massage relaxante et très energissante  en meme temps. Merci', '1', '2013-01-09 20:15:24', NULL),
(1874, 2, '8.0', 'Décor sympa, service efficace, bons burgers mais pas de bacon!\r\nBon desserts.', '1', '2013-01-09 20:17:42', NULL),
(1875, 2, '8.0', 'Massage ++++\r\nHamam ++\r\nGommage ++\r\nMerci et bonne fêtes de fin d''année!!', '1', '2013-01-10 19:34:44', NULL),
(1876, 2, '8.0', 'J''ai toujours été satisfait des coupes de cheuveux.', '1', '2013-01-10 19:36:40', NULL),
(1877, 2, '8.0', 'Accueil super comme d''habitude.\r\nRien à dire passons un bon moment avant Laurent Gerra.', '1', '2013-01-10 19:40:35', NULL),
(1878, 1, '10.0', 'Suis très ravie des prestations et du temps consacré aux soins.\r\nJe reviendrai avec plaisir.', '1', '2013-01-10 19:45:07', NULL),
(1879, 3, '6.0', 'Bonne prestation des plats. La viande est bonne ce qui pourrait être amélioré:- un burger au cheddar + oignons.\r\n              - une autre recette de tiramisu! Pas assez sucrée et le mascarpone était trop &quot;lourd&quot;.\r\nLa serveuse a été impeccable, serviable, aimable, très bon service!', '1', '2013-01-10 19:49:51', NULL),
(1880, 2, '8.0', 'Conseil très avisés merci beaucoup! Très à l''écoute, vous avez pris votre temps merci beaucoup. Je n''ai pas encore sauté le pas de la coupe courte, mais c''est déjà un grand pas pour moi le carré long. La prochaine fois!\r\nMerci encore.', '1', '2013-01-10 19:53:48', NULL),
(1881, 1, '10.0', 'Je sors du soin hammam, gommage, massage, c''est un délice!', '1', '2013-01-10 19:56:19', NULL),
(1882, 2, '8.0', 'Super bon accueil et brushing encore mieux que je voulais.', '1', '2013-01-10 19:58:40', NULL),
(1883, 3, '6.0', 'Pas mal du tout.\r\nManque du bacon et ketchup.\r\nTrès bon cheese cake!', '1', '2013-01-10 20:01:56', NULL),
(1884, 2, '8.0', 'Très sympa, de bon conseils.\r\nEnvie de changer plein de chose\r\n= &quot; regonflée &quot;.', '1', '2013-01-10 20:04:39', NULL),
(1885, 1, '10.0', 'Très satisfaite. Je faisais de nombreuses erreurs que je vais pouvoir rectifier maintenant.\r\nCouleur, coupe et maquillage tout est à mon goût. Bon accueil de surcroit ( on est chouchouté pendant plusieurs heures.) A bientôt.', '1', '2013-01-10 20:08:55', NULL),
(1886, 2, '8.0', 'J''ai passé un moment agréable dans ce centre.\r\nPour commencer le hammam été à mon goût ( très concentré en brume). Par la suite un gommage agréable efficace et pour finir un massage relaxant. Pour conclure j''ai aimé ce moment prévilégié . + thé en fin.\r\nPersonnel très sympathique.', '1', '2013-01-10 20:14:21', NULL),
(1887, 1, '10.0', 'RAS.\r\nFélicitation aux cuisiniers.\r\nBon rapport qualité-prix.\r\nBonne, voire très bonne adresse dans un quartier chic.', '1', '2013-01-10 20:17:56', NULL),
(1888, 1, '10.0', 'Bon service et je reviendrais.', '1', '2013-01-10 20:20:21', NULL),
(1889, 1, '10.0', 'De très bon conseil. Un grand merci. J''en ressort ravie.', '1', '2013-01-10 20:22:44', NULL),
(1890, 1, '10.0', 'Chez Bruno, c''est non seulement le meilleur salon de coiffure de Paris. C''est aussi un endroit chaleureux, un club en quelque sorte, ou l''on rit dans la gentillesse et l''amitié. Bref, on y va pour des moments qui font oublier le stress et le froid. Et l''on ressort toujours plus beau!\r\nBravo, Bruno et Jacques. Et merci!', '1', '2013-01-10 20:28:57', NULL),
(1891, 2, '8.0', 'Génial sans commentaires! A refaire!', '1', '2013-01-10 20:30:45', NULL),
(1892, 3, '6.0', 'Globalement content. La viande a l''air de bonne qualité. La soupe très bonne mais la salade un peu légère. Dommage qu''il n''y ait pas de mayonnaise maison. Voilà pour le repas. Sinon, pour un endroit qui s''appelle un amour de burger, j''ai trouvé que ça manquait un peu de coeur et de chaleur. Mais bien sûr ça n''engage que moi. Très bonne continuation. PS: Mon ami trouve que je suis sévère.', '1', '2013-01-10 20:39:29', NULL),
(1893, 2, '8.0', 'C''était très bon, mais il faudrait faire votre mayonnaise vous même! :) \r\nC''était super! La salle du fond est bien.', '1', '2013-01-11 19:35:14', NULL),
(1894, 1, '10.0', 'Je recommande ce salon ou la coiffeuse est très accueillante et a toujours le sourire. Elle a su s''adapter à mes besoins et m''a conseillée sur l''entretient de ma coiffure. J''ai fait un Tie ans Die et j''en suis très satisfaite, c''est le resultat que je voulais et le prix est très convenable! J''y retournerais c''est sûr!!', '1', '2013-01-11 19:39:32', NULL),
(1895, 2, '8.0', 'Soins tout à fait agréables, dommage pour le temps d''attente entre chaque soin.', '1', '2013-01-11 19:41:38', NULL),
