(1899, 2, '8.0', 'Mon ami a la flemme alors c''est moi qui écrit. Il dit:&quot; Le cheescake était très bon, la sauce,les oignons. Le pain: peut mieux faire. Dommage pour les bières. Très bonne sauce. Très bon cheesecake. Même si je l''ai déjà dit&quot;.\r\nPs: mon amie a été trop sévère.', '1', '2013-01-11 20:00:07', NULL),
