(2010, 1, '10.0', 'On prend grand soin de vos cheveux dans ce salon! Si vous désirez une belle couleur n''hésitez pas, venez là! Et de très belles méches.', '1', '2013-01-19 15:23:29', NULL),
(2011, 2, '8.0', 'Service= TB et rapide.\r\nLe choix des plats est varié et les plats que nous avons choisi étaient bons.', '1', '2013-01-19 15:27:19', NULL),
(2012, 1, '10.0', 'Je confie mes cheveux à Michael depuis que mes cheveux blanc on fait leur apparition et je suis très contente de son talent de coloriste.', '1', '2013-01-19 15:31:35', NULL),
(2013, 1, '10.0', 'Coiffeuses très gentille et très accueillante.\r\nContente de ma coupe.\r\nJe reviendrai.', '1', '2013-01-19 15:35:31', NULL),
(2014, 2, '8.0', 'Cadre sympathique, viande excellente (cote de boeuf) et très bonne ambiance malgrès une disposition des tables, a priori, peu évidente.', '1', '2013-01-19 15:38:38', NULL),
(2015, 2, '8.0', 'Très bon accueil et très bon jus d''orange pressé!\r\nManque juste le beurre salé...', '1', '2013-01-19 15:41:38', NULL),
(2016, 2, '8.0', '+ Cuisine simple et excellente (de qualités)\r\n+ Service sympa donne envie de revenir...\r\n-Peut être le bruit mais on est dans un bistrot de Paris!', '1', '2013-01-19 15:45:25', NULL);
INSERT INTO `avis` (`id_avis`, `appreciation`, `note`, `commentaire`, `origine`, `date_avis`, `rester_contact`) VALUES
(2017, 1, '10.0', 'Super bon! Changez rien!! Service impec! \r\n= Très bonne qualité, prix très corrects, et bonne musique! ( pas de radio).', '1', '2013-01-19 15:48:19', NULL),
(2018, 1, '10.0', 'Merci Sarah.', '1', '2013-01-23 19:46:57', NULL),
(2019, 3, '6.0', 'C''est très sympa de proposer une option végétarienne, j''ai beaucoup apprécié! Cependant même si le burger végétarien est bon, ce n''est pas un vrai burger, on aurait aimé avoir un steack végétarien ou du tofu pour les protéines... Dommage aussi qu''il ne soit pas dans la formule!', '1', '2013-01-23 19:51:52', NULL),
(2020, 1, '10.0', 'Merci pour cette coiffure qui m''a bien plut.\r\nElle a eu beaucoup de succés.\r\nJe reviendrait avec plaisir.', '1', '2013-01-23 19:56:28', NULL),
(2021, 1, '10.0', 'Servi rapidement avant notre spectacle à l''olympia.', '1', '2013-01-23 19:59:00', NULL),
(2022, 1, '10.0', 'Acceuil chaleureux, très belle performance.\r\nJe reviendrai!', '1', '2013-01-23 20:02:05', NULL),
(2023, 2, '8.0', 'Mention particulière pour le pain du burger excellent! et pas sec, moelleux.\r\nBonne frites aussi! Merci!\r\nPS: La salade aux noix mérite peut être pour justifier son nom un peu plus de noix! Parcequ''on peut toujours faire mieux.', '1', '2013-01-23 20:07:02', NULL),
(2024, 1, '10.0', 'Très bonne coiffeuse\r\nTrès accueillente\r\nTrès aimable\r\nVraiment je suis contente de être coiffé dans son salon.', '1', '2013-01-23 20:12:35', NULL),
(2025, 2, '8.0', '+ Service très rapide et efficace\r\n+ Menu bon marché\r\n+ Déco/ Environnement agréables\r\n- Frites un peu grasses.', '1', '2013-01-23 20:15:16', NULL),
(2026, 1, '10.0', 'Bon resto, produit bonne qualité!\r\nLe supléments de 3 euros sur presque toutes les entrées c''est un peu bizard...', '1', '2013-01-23 20:18:00', NULL),
(2027, 2, '8.0', 'Ca c''est un burger digne de ce nom.\r\nDe la bonne viande, du bon pain et des produits de qualité.\r\nLes frites étaient bonnes aussi.\r\nPas assez de choix dans les bières ( seul bémol ).', '1', '2013-01-23 20:20:51', NULL),
(2028, 1, '10.0', 'J''aime l''ambiance et ils sont trop gentil.', '1', '2013-01-23 20:23:42', NULL),
(2029, 1, '10.0', 'J''aime l''ambiance et ils sont trop gentil.', '1', '2013-01-23 20:23:42', NULL),
(2030, 1, '10.0', 'Equipe très agréable et professionnelle je vous conseille.\r\nBonne continuation à eux.', '1', '2013-01-23 20:34:01', NULL),
(2031, 1, '10.0', 'Très bien!\r\nSatisfaite du résultat.', '1', '2013-01-23 20:36:12', NULL),
(2032, 1, '10.0', 'Satisfaite du résultat, balayage et coiffure au top.', '1', '2013-01-23 20:39:15', NULL),
(2033, 1, '10.0', 'Je suis très satisfaite du relooking. Vous semblez très attentifs aux attentes personnelles. Merci pour cette séance!', '1', '2013-01-24 19:21:54', NULL),
(2034, 3, '6.0', 'Bon repas même si les frites étaient trop sèches. \r\nBon accueil.', '1', '2013-01-24 19:24:33', NULL),
(2035, 1, '10.0', 'Avis favorable.', '1', '2013-01-24 19:26:22', NULL),
(2036, 3, '6.0', 'Correc''! Sauce des frites idéale pour les amateurs de fromage mais pas pour les autres...\r\nLes burgers manquent de sauce.', '1', '2013-01-24 19:28:37', NULL),
(2037, 1, '10.0', 'Très heureuse du salon Solivans, j''ai toujours été bien reçus.\r\nSalon chaleureux. Merci a vous de votre travail. Mes cheveux sont superbe.', '1', '2013-01-24 19:32:32', NULL),
(2038, 2, '8.0', 'Salut,\r\n-Pain trop épais\r\n-Sauce au fromage inutile: remplacer par le ketchup/mayo/barbec/coleslam.\r\n-Frites très bonnes.\r\n-Autre option dans menu sans surplus de coût mais on reviendra.', '1', '2013-01-24 19:36:26', NULL),
(2042, 2, '8.0', 'Un accueil chaleureux, une patronne souriante et dynamique, toujours au plus près des demandes de ses client(e)s. Voilà quelque bonne raisons de revenir au Solivan Hair!\r\nMerci Murielle pour votre bonne humeur. \r\nTestez-vous même!', '1', '2013-01-25 13:28:22', NULL),
(2043, 3, '6.0', 'Très bon . Mais un peu long! \r\nXOxo :)', '1', '2013-01-25 13:30:34', NULL),
(2044, 2, '8.0', 'Je connaissais déjà l''établissement, mais dans de plus petits locaux.\r\nLe burger est toujours aussi bon mais il pourrait être plus fourni.\r\nLe rapport qualité/prix est très satisfaisant.', '1', '2013-01-25 13:39:46', NULL),
(2045, 1, '10.0', 'Je me sens très satisfait de ma coiffure. J''ai été très bien reçu par la coiffeuse et très bien traité. \r\nJe reviendrai souvent.', '1', '2013-01-25 13:45:08', NULL),
(2046, 1, '10.0', 'Merci de mettre les jours et horaires d''ouverture sur la porte.\r\nMerci.', '1', '2013-01-25 13:47:56', NULL),
(2047, 2, '8.0', 'Très bon. Produits frais. \r\nDesserts maisons que du bonheur.\r\nPeut-être un choix de sauces serait intéressant.', '1', '2013-01-25 13:50:40', NULL),
(2048, 1, '10.0', 'On passe un bon moment, de très bon conseil, très contente du resultat.', '1', '2013-01-25 13:56:31', NULL),
(2049, 2, '8.0', 'Excellent burgers! Variété dans la carte.\r\nUne adresse très agréable. Les enfants on appréciés et c''est très rare!', '1', '2013-01-25 14:39:51', NULL),
(2050, 3, '6.0', '- Les frites sont tièdes mais très bonne!\r\n- Le pain est trop épais et un peu sec.\r\n- La viande est top! Sauce au cantal très bonne!', '1', '2013-01-25 14:42:46', NULL),
(2051, 1, '10.0', 'En tant qu''artiste il est agréable de compter sur un établissement qu''est à l''écoute du client.\r\nUn accueil et un professionnalisme remarquable lié a beaucoup de gentillesse. \r\nMerci Pascale.', '1', '2013-01-25 14:48:27', NULL),
(2052, 3, '6.0', 'La déco est sympa, la musique également.\r\nPour ce qui est du burger, il manque de gourmandise.\r\nPour ce qui est du cheesecake, il manque un peu de serveur.\r\nEnsemble satisfaisant.', '1', '2013-01-25 14:51:52', NULL),
(2053, 1, '10.0', 'C''est la troisième fois que je viens, jamais déçue!', '1', '2013-01-25 14:54:07', NULL),
(2054, 2, '8.0', 'Tout est très très très (x1000) bon sauf la sauce au fromage dans le petit pot blanc.', '1', '2013-01-25 14:56:39', NULL),
(2055, 1, '10.0', 'J''ai aimé mon hamburger et les frites et surtout le ketchup.', '1', '2013-01-25 15:05:20', NULL),
(2056, 1, '10.0', 'Très satisfaite.\r\nInstitut a recommander.', '1', '2013-01-25 15:08:00', NULL),
(2057, 2, '8.0', 'Ca fait 20 ans que je viens ici.', '1', '2013-01-25 15:14:08', NULL),
(2058, 2, '8.0', 'Je suis satisfaite de ce salon.\r\nBeaucoup de bon conseils aussi.', '1', '2013-01-25 15:16:19', NULL),
(2059, 2, '8.0', 'Toujours bien accueillie, je me sans bien dans ce salon.\r\nPersonnel très sympa.', '1', '2013-01-25 15:19:15', NULL),
(2060, 1, '10.0', 'Très satisfaite.', '1', '2013-01-25 15:20:58', NULL),
(2061, 1, '10.0', '', '1', '2013-01-25 15:24:31', NULL),
(2062, 2, '8.0', '', '1', '2013-01-28 19:44:47', NULL),
(2063, 1, '10.0', 'Votre salon de coiffure est un véritable havre de paix; convivialité, fidélité, conseil, ponctualité sont au rendez-vous. On peut traverser paris et plus! Pour avoir l''assurance d''une coupe qui dure, d''une couleur parfaite; aucun reproche ne vous est fait lorsque vous avez voulu jouer aux apprenties-sacières! On viendra vous &quot;repêcher!!', '1', '2013-01-28 19:50:46', NULL),
(2064, 1, '10.0', 'Les prix imbattable.\r\nEt c''est pour quoi je suis là!', '1', '2013-01-28 19:53:56', NULL),
(2065, 1, '10.0', '', '1', '2013-01-28 19:55:26', NULL),
(2066, 1, '10.0', 'Je suis très satisfaite de l''acceuil du salon, de toute le personnel, bien coiffé.\r\nRendez-vous respecté et peu d''attente pour se faire coiffer.', '1', '2013-01-28 19:58:58', NULL),
(2067, 2, '8.0', 'Personnel agréable et sympathique.\r\nPrix raisonnable.\r\nNouvelle décoration pour la nouvelle année 2013 sera super. Ce salon reste mon préferé dans le quartier.', '1', '2013-01-28 20:02:42', NULL),
(2068, 1, '10.0', 'J''ai été très bien reçu, on m''a donné des conseils et astuces sans même que j''ai eu besoin de demander. Je conseille vraiment cet endroit!', '1', '2013-01-28 20:06:18', NULL),
(2069, 1, '10.0', '- C''est mon deuxième soin cellulaire et je suis vraiment éblouie par la qualité des produits frai pénétrent très en profondeur.. Le doigté de l esthéticienne.. et le résultat: éclat du teint et reposé!', '1', '2013-01-28 20:11:43', NULL),
(2070, 1, '10.0', '', '3', '2013-01-28 20:36:58', 0),
(2071, 2, '8.0', 'Bone continuation. Pas de changement particulier à noter.', '1', '2013-01-28 20:40:46', NULL),
(2072, 1, '10.0', '-C''est un institut ou l''on est toujours bien accueilli\r\n-Les esthéticiennes sont des pros = douces et le travail est parfait.\r\n-Continuez!!!', '1', '2013-01-28 20:45:59', NULL),
(2073, 2, '8.0', 'Merci de m''avoir reçu aussi rapidement.\r\nJe suis très satisfaite du service rendu.', '1', '2013-01-28 20:48:09', NULL),
(2074, 1, '10.0', '5 pour l''accueil et la qualité du service.\r\nMerci pour votre sourire :)', '1', '2013-01-28 20:50:50', NULL),
(2075, 1, '10.0', 'Très gentille ésthéticienne, super service allez y faire un tour vous ne serez pas déçus! \r\nJe reviendrais régulierment.', '1', '2013-01-28 20:54:42', NULL),
(2076, 1, '10.0', '', '3', '2013-01-30 14:56:48', 0),
(2077, 1, '10.0', '', '3', '2013-01-30 15:06:40', 0),
(2078, 1, '10.0', '', '3', '2013-01-30 15:13:19', 0),
(2079, 1, '10.0', 'R.A.S comme dab.\r\nUniquement les augmentations.....', '1', '2013-01-30 19:27:17', NULL),
(2080, 1, '10.0', 'Salut, le meilleur salon! J''y vais 1 fois par semaine, je suis accro à mon coiffeur Patrick, je le conseil à tous le monde et d''ailleurs mes soeurs en sont accro aussi!', '1', '2013-01-30 19:30:30', NULL),
(2081, 1, '10.0', 'On est toujours très bien reçu, même au pied levé, grand disponibilité de toute l''équipe.\r\nSourire et gentillesse ( et café) sont toujours au RDV.', '1', '2013-01-30 19:37:42', NULL),
(2082, 1, '10.0', 'Merci pour ce soin agréable.', '1', '2013-01-30 19:40:45', NULL),
(2083, 1, '10.0', 'Très satisfaite du service, Accueil chaleureux et excellent massage. Je vous recommanderai!\r\nMerci!', '1', '2013-01-30 19:43:21', NULL),
(2084, 1, '10.0', '', '1', '2013-01-30 19:47:07', NULL),
(2085, 1, '10.0', 'Le service est toujours très bien, nous sommes accueillis comme à la maison et c''est très appréciable. Chenda est très gentille et avenante et respecte ce que veut le client.', '1', '2013-01-30 19:49:29', NULL),
(2086, 1, '10.0', '', '1', '2013-01-30 19:52:04', NULL),
(2087, 1, '10.0', 'Bonjour, je vais chez Patrick 1 fois/ semaine, c''est le meilleur coiffeur pour moi, c''est ma petite soeur qui me la presenter, je peux plus me passé de lui.', '1', '2013-01-30 19:54:20', NULL),
(2088, 1, '10.0', 'Cette seance était très agréable, détendante, reposante.\r\nA la fin je ne voulais plus sortir mes pieds de l''eau. Et j''ai eu l''impression que les poissons étaient aussi un peu triste de mon départ. Je reviendrai! &quot; verveine&quot;.', '1', '2013-01-30 19:58:50', NULL),
(2089, 2, '8.0', 'Gommage efficace. On a la peau hyper douce.\r\nEnsuite le modelage super relaxant. Je repars reposée et detendue!! Merci beaucoup.', '1', '2013-01-30 20:01:54', NULL),
(2090, 1, '10.0', 'Personnel très sympa. En principe très peu de temps d''attente.\r\nJe suis toujours satisfaite de ma coupe.\r\nDécor et ambiance sympa.', '1', '2013-01-30 20:04:15', NULL),
(2091, 1, '10.0', 'Juste à coté de chez moi, toujours accueillant, souriant et de bons conseils.\r\nQuand on est nulle en cheveux comme moi, il faut y aller!!', '1', '2013-01-30 20:08:40', NULL),
(2092, 1, '10.0', 'J''ai bien apprécié le soin. Je le conseille pour toutes personnes qui souhaitent en faire. c''est vraiment un moment de détente.', '1', '2013-01-30 20:11:18', NULL),
(2093, 1, '10.0', 'Super salon de coiffure ou l''accueil est formidable.\r\nTarif résonnable pour une prestation haut de gamme.\r\nConvivial et pro à la fois, je viens très régulièrement pour une coupe de cheveux. Ils n''offre pas encore une coupe de champagne, mais un café ou un thé. A conseiller!', '1', '2013-01-30 20:17:48', NULL),
(2094, 1, '10.0', 'Merci de votre gentillesse, ne changer rien car mieux ne serait pire !!!\r\nTrès cordialement.', '1', '2013-01-31 19:18:04', NULL),
(2095, 1, '10.0', 'C''était très bon. Très bon choix de vin!', '1', '2013-01-31 19:21:06', NULL),
(2096, 1, '10.0', 'Je suis très content de l''accueil du travail accompli.\r\nA conseiller, salon chaleureux et très aimable.', '1', '2013-01-31 19:23:15', NULL),
(2097, 1, '10.0', 'J''ai été très satisfaite de cet institut dont l''accueil est très chaleureux.', '1', '2013-01-31 19:25:45', NULL),
(2098, 2, '8.0', 'Très bon service, bons produits et bonne recette.\r\n( surveiller les matières grasse! )', '1', '2013-01-31 19:30:12', NULL),
(2099, 1, '10.0', 'Excellent diner, je referai bien mes 600 bornes pour sa carte, présentation et service chaleureux.\r\nMerci pour sa qualité.', '1', '2013-01-31 19:32:55', NULL),
(2100, 1, '10.0', 'Très bon acceuil, serviable et agréable sont les atouts des personnels de cet entreprise.\r\nDes prix très interessant.\r\nDes coupes parfaites et de très bonne qualité.', '1', '2013-01-31 19:38:19', NULL),
(2101, 2, '8.0', 'J''ai passé un moment de détente très agréable, j''ai découvert le gommage/ massage aux sels de la mer noir. Surprenant l''effet drainant et stimulant! La peau est très douce. Le petit bémol le choix de la musique dans l''entrée et elle est un peu forte à mon goût. \r\nJe recommande vivement ce lieu.', '1', '2013-01-31 19:42:58', NULL),
(2102, 2, '8.0', 'J''ai fait un nettoyage de peau, complet, efficace, super modelage, très bon produit, très grand professionnalisme.', '1', '2013-01-31 19:45:50', NULL),
(2103, 2, '8.0', 'L''ambiance était excellente! Un beau restaurant.\r\nNous sommes de l''australie et nous venons au bistrot Gorille chaque fois que nous sommes ici à Paris! Merci!', '1', '2013-01-31 19:48:43', NULL),
(2104, 1, '10.0', 'Je recommanderais ce moment très agréable à tout un chacun aussi bien pour les soins et les produits.', '1', '2013-01-31 19:51:35', NULL),
(2105, 1, '10.0', 'Je te le conseille vivement!\r\nPatrick est un professionnel et ce que j''apprécie chez lui il est très à l''écoute et fait ce que tu désires, et à tjrs de bus conseils.', '1', '2013-01-31 19:57:20', NULL),
(2106, 1, '10.0', 'La meilleure équipe, toujours disponible et tout le week end. Les soins sont très très bien faits. \r\nMoi, je ne vais que là!', '1', '2013-01-31 20:01:16', NULL),
(2107, 2, '8.0', '', '1', '2013-01-31 20:12:03', NULL),
(2108, 1, '10.0', 'Je suis très satisfaite de l''épilation sourcil.\r\nTrès bon accueil.', '1', '2013-01-31 20:14:31', NULL),
(2109, 2, '8.0', 'Accueillant (thé)\r\nSympathique.\r\nBonne connaissance de la clientèle.\r\nSatisfait des coupes demandées et obtenues.', '1', '2013-01-31 20:22:59', NULL),
(2110, 1, '10.0', 'Ma fidélité aux salons Jacques Dumont depuis successivement leur création et une preuve de ma satisfaction me semble-t-il!\r\nQualité de l''accueil, qualité des produits du coiffage donc un très beau cadre.', '1', '2013-02-01 19:22:48', NULL),
(2111, 1, '10.0', 'Un accueil bien amical qui fait passer le temps rapidement, Toujours content.', '1', '2013-02-01 19:24:50', NULL),
(2112, 1, '10.0', 'Excellente prestation, travail soigné et très sérieux. Je suis éblouie du résultat.\r\nDe plus, l''accueil est excellent, beaucoup de gentillesse.\r\nUne ambiance zen et reposante.\r\nUn vrai cocon de bien-être.', '1', '2013-02-01 19:28:38', NULL),
(2113, 2, '8.0', 'Merci à Patrick, il connait très bien les cheveux asiatiques ça fait presque 2 ans , je passe toujours à Pretty Hair pour faire la coupe. Je suis contente de sa coupe et de l''ambiance de cette boutique. Mais aujourd''hui la dame qui s''est occupée du shampoing n''était pas super patiente... Un peu dommage!', '1', '2013-02-01 19:32:55', NULL),
(2114, 1, '10.0', 'Je suis très satisfaite j''aimerai revenir au sallon pour une autre nouvel &quot;look&quot;.', '1', '2013-02-01 19:35:30', NULL),
(2115, 1, '10.0', 'Personnel très très accueillante, souriante.... même + satisfait du bon travail.', '1', '2013-02-01 19:38:16', NULL),
(2116, 1, '10.0', 'Très bon salon: - Accueil très sympathique\r\n- Personnel de très bon conseil\r\n- Tarifs intéressants\r\nAllez-y, vous sortirez du salon très satisfait!', '1', '2013-02-01 19:40:57', NULL),
(2117, 1, '10.0', 'Assez contente de la coupe.', '1', '2013-02-01 19:43:03', NULL),
(2118, 3, '6.0', 'Gommage très efficace et qui rend la peau très agréable douce et chaleureuse. Cependant, cela fait quand même mal et brûle mais cela rend meilleur avec l''huile après.', '1', '2013-02-01 19:46:15', NULL),
(2119, 2, '8.0', 'Mère de 2 enfants de moins de 3 ans pas facile d''aller chez le coiffeur pour eux.\r\nMais tout s''est très bien passé.\r\nRapidité et efficacité. Ils sont beaux tous les deux!', '1', '2013-02-01 19:49:32', NULL),
(2120, 1, '10.0', 'Accueil + compétence.\r\nTrès satisfait.', '1', '2013-02-01 19:51:33', NULL),
(2121, 1, '10.0', 'Très sympas, bonne accueil, et bon travail!\r\nMais un peu chère.', '1', '2013-02-01 19:55:04', NULL),
(2122, 1, '10.0', '', '1', '2013-02-01 19:56:53', NULL),
(2123, 1, '10.0', 'Depuis plusieurs années je viens dans ce salon donc je suis satisfaite tout pour le travail que l''amabilité.', '1', '2013-02-01 20:00:33', NULL),
(2124, 2, '8.0', 'Je suis satisfaite des services proposée par le salon.\r\nLe personnel est agréable.\r\nL''ambiance est calme et sérieuse, j''aime bien.', '1', '2013-02-01 20:03:09', NULL),
(2125, 1, '10.0', 'Très bon accueil, j''ai apprécié le petit café. Concernant la coiffeuse: très mignone et surtout très pro!!!\r\nBon rapport qualité/prix.\r\nJ''y retournerais à conseiller.', '1', '2013-02-01 20:18:41', NULL),
(2126, 1, '10.0', 'Cela fait, maintenant plusieurs années que je fréquente le salon. C''est donc parce que j''apprécie la qualité de coiffure et couleur, ainsi que l''accueil sympathique.', '1', '2013-02-02 14:38:54', NULL),
(2127, 1, '10.0', 'Coifée à domicile car handicapée. Je suis très satisfaite des prestations de grande qualité technique et humaines pour moi qui handicapée c''est très important.', '1', '2013-02-02 14:42:50', NULL),
(2128, 1, '10.0', 'Je suis satisfaite par les soins qui me sont donnés dans le salon.', '1', '2013-02-02 14:44:38', NULL),
(2129, 1, '10.0', 'J''ai aimes l''accueil et la coiffure.', '1', '2013-02-02 14:47:09', NULL),
(2130, 1, '10.0', 'Très respectueux des horaires. Monsieur Collin maitrise bien son savoir faire et nous en fait profiter...\r\nA mon avis, ses mains lui réservent un bel avenir.', '1', '2013-02-02 14:52:24', NULL),
(2131, 1, '10.0', 'Je remercie profondément la personne qui s''est occupée de moi durant mes séances de kinés.\r\nTrès compétente dans son travail et surtout très aimable, de tout coeur merci.\r\nBonne chance dans son nouveau lieu de travail.', '1', '2013-02-02 14:55:42', NULL),
(2132, 1, '10.0', 'Grande satisfaction pour toutes les prestations.', '1', '2013-02-02 14:57:23', NULL),
(2133, 2, '8.0', 'Quelques qui peuvents supplementaires seraient parfaits dans les activités &quot; bien être&quot; ! ( sauna...).', '1', '2013-02-02 15:02:19', NULL),
(2134, 2, '8.0', 'La salle d''attente est petite mais nous y passons très peu de temps, les patients avec leurs pathologies toutes différentes ont toujours le sourire. Le kiné qui me suit s''est adapté à mes problèmes et même si je râle je tiens compte de ses conseils et je fais quelques exercices chez moi.\r\nGlobalement c''est un cabinet à recommander à mes amis.', '1', '2013-02-02 15:06:07', NULL),
(2135, 1, '10.0', 'Cher Mr Collin.\r\nJe suis satisfaite de vos services, nous avons trop besoin de vos mains, sans kiné que ferions nous.\r\nMerci Cyril.', '1', '2013-02-02 15:09:38', NULL),
