(2137, 1, '10.0', 'Les soins donnés dans ce cabinet de kinésithérapie sont excellents, car les medecins diplomés qui y exercent sont très compétents. Je donne 10/10 au docteur Cyril Collin qui me soigne, après 2 mois d''hopital. Merci pour ma remise en forme, auquel s''ajoute son humanité et sa gentillesse. Ce qui ne gache rien.', '1', '2013-02-02 15:19:55', NULL),
(2138, 1, '10.0', 'Une équipe super sympa. Ils s''occupent bien de moi, même très bien. Je suis très contente après chaque soin.\r\nBonne relation clientèle, de bon conseils.\r\nAimable et souriants.', '1', '2013-02-02 15:23:01', NULL),
