(2322, 1, '10.0', 'Hair Design Joseph, un véritable professionnel.\r\nTrente ans que je lui confie mon visage, toujours un nouveau style et surtout adaptée à ma personnalité.\r\nLes bons coiffeurs se font rare sur la place de Paris alors ne cherchez plus, venez chez Joseph c''est un artiste ! Bonne année 2013', '1', '2013-02-14 20:07:16', NULL),
(2323, 1, '10.0', 'Voilà plusieurs années que je viens dans ce salon.\r\nJ''aime le calme, le professionnalisme et le sourire de Cathy... et tous.', '1', '2013-02-14 20:10:23', NULL),
(2324, 1, '10.0', 'C''est le seul salon de coiffure ou je me suis toujours senti à l''aise et ou je n''ai jamais été déçue de ma coiffure à la sortie. En plus, les nouveaux locaux sont magnifiques.', '1', '2013-02-14 20:14:33', NULL),
(2325, 1, '10.0', 'Super repas!!!\r\nOn adore s''y retrouver entre potes.', '1', '2013-02-14 20:17:07', NULL),
