(2327, 1, '10.0', 'Accueil très agréable. Explications claires et précise quand aux différents soins proposer, sans pour cela faire du forcing pour caser quoi que ce soit-coupe réussit prix correct et ce plus un petit thé ou café aux choix. Adresse a retenir le secteur ne brillant pas par ces bons coiffeurs!', '1', '2013-02-18 10:32:57', NULL),
(2328, 1, '10.0', 'Fantastique!!!', '1', '2013-02-18 10:43:54', NULL),
