(2402, 1, '10.0', '', '1', '2013-02-19 10:45:20', NULL),
(2403, 1, '10.0', 'Je suis entièrement satisfaite des prestations proposées par mon coiffeur. Le cadre est agréable, le personnel est disponible et compétant, l''accueil et chaleureux ma coiffeuse est très performante. Pour ma part j''ai enfin trouvé mon vrais coté plongeait et une couleur qui fait des envieuse. ', '1', '2013-02-19 10:51:02', NULL),
