(2405, 1, '10.0', 'Enfin une bonne coiffeuse qui connaît son métier et qui vous met à l''aise et qui utilise des produit à base d''huile essentielle et elle accueille avec une vrai envie de revenir après.', '1', '2013-02-19 11:02:52', NULL),
(2406, 1, '10.0', 'Accueil très sympathique et cordial. Très bonne professionnelle conseillant sans imposait. Ses conseil sont à suivre car elle connaît bien son métier et ceux-ci sont donc avisés, les prix sont raisonnables. Un endroit à recommander. Salon propre et bien tenu.', '1', '2013-02-19 11:12:11', NULL),
(2407, 1, '10.0', 'Le vin est trop cher', '1', '2013-02-21 15:06:06', NULL),
