(2416, 2, '8.0', 'Je donne la note &quot;4&quot; uniquement parce que je n''avais pas assez faim pour goûter le dessert!!!\r\nmerci à toute l''équipe de &quot;La bonne cécile&quot; pour ce super accueil et ce super repas! Nous reviendrons et n''hésiterons pas à le recommander!', '1', '2013-02-21 15:50:15', NULL),
