(2419, 2, '8.0', 'C''est très sympa. Le cheese catre est très bon.\r\nLes accompagnement sont bons surtout les haricots verts très bien assaisonnés. ', '1', '2013-02-25 11:39:53', NULL),
(2420, 1, '10.0', '24 Janvier 2013\r\nExcellente étape gastronomique où la gentillesse de l’hôtesse\r\nn''a d''égale que la qualité de ses plats  ', '1', '2013-02-25 11:46:49', NULL),
