(2719, 1, '10.0', 'J''apprécie particulièrement la compétence, la rigueur des professionnels, sans parler des conseils de qualité sur toutes les prestations ( soins des cheveux, couleur, coupe et produits ).', '1', '2013-04-02 13:09:20', NULL),
