(2727, 1, '10.0', 'Hello, quoi dire, comme tu le sais, c''était super pour moi, calme, détente, accueil et en plus même pas besoin de rapporter ses affaires ! Ils ont tout ce qu''il faut pour se changer !! SUPER !!', '1', '2013-04-02 14:12:07', NULL),
