(2730, 1, '10.0', 'Super accueil, cadre sympa sans &quot;chichis&quot;, coupe et conseils top. On propose aussi un massage shiatsu super relaxant !. A essayer', '1', '2013-04-09 13:35:09', NULL),
(2731, 1, '10.0', 'Un accueil chaleureux, une ambiance bistrot très sympa et des plats de grande qualité. L''andouillette est une merveille et le confit de canard un délice ! Idéal entre amis pour une soirée inoubliable.', '1', '2013-04-09 14:36:45', NULL),
(2732, 2, '8.0', 'Accueil chaleureux. Restaurant très agréable que nous découvrons pour la 1ère fois. Service &quot;sans faille&quot;. Très bonne cuisine et présentation correcte. Nous avons passé un très bon moment et je pense que nous reviendrons', '1', '2013-04-09 15:08:07', NULL),
(2733, 1, '10.0', 'Très bonne ambiance. Donne envie de faire la fête.', '1', '2013-04-09 15:12:46', NULL),
(2734, 1, '10.0', 'Super brunch, pas cher, copieux et endroit tranquille et génial le dimanche !!!', '1', '2013-04-09 18:05:05', NULL),
(2735, 1, '10.0', 'C''est top, chef !', '1', '2013-04-09 18:20:59', NULL),
(2736, 1, '10.0', 'Moi, ce que j''aime ici, c''est tout d''abord de ressortir toujours très satisfaite de ma tête !...Et puis, bien sur, aussi, le fait que je me sente très à l''aise, un peu comme à la maison ! Pas de papotages superficiels comme dans beaucoup de salons... Merci à Emilie et François pour ça. On est bien chez vous !', '1', '2013-04-12 13:26:40', NULL),
(2737, 1, '10.0', 'Excellent accueil, un personnel souriant, très professionnel et efficace. Un résultat parfait. A recommander fortement !!', '1', '2013-04-12 13:31:15', NULL),
(2738, 1, '10.0', 'Personnel qualifié, de contact très agréable. C''est avec plaisir que je viens me faire coiffer toutes les semaines. Conseils avisés', '1', '2013-04-12 13:34:34', NULL),
(2739, 2, '8.0', 'Gouteux, appétissant et très bon !', '1', '2013-04-12 13:38:08', NULL);
INSERT INTO `avis` (`id_avis`, `appreciation`, `note`, `commentaire`, `origine`, `date_avis`, `rester_contact`) VALUES
(2740, 1, '10.0', 'C''est un dermatologue qui m''a fait retrouver Arnaut et gilles. J''étais ravie, et me demande toujours pour quelle raison j''ai bien pu les oublier. L''accueil, le professionnalisme, le souci du détail, du mieux être les caractérisent. Je ne perdrai plus jamais contact et m''attache à être leur ambassadrice.', '1', '2013-04-12 13:46:22', NULL),
(2741, 1, '10.0', 'Gentillesse et disponibilité dans ce salon; excellente compétence pour les balayages dont on m''a fait beaucoup de compliments.', '1', '2013-04-12 13:51:14', NULL),
(2742, 2, '8.0', 'Je viens dans ce salon depuis 10 ans avec la même satisfaction quant aux conseils, à la qualité de l''accueil, aux innovations ( technique de coiffure, vente de créations bijoux par exemple ). Sandrine c''est la classe !', '1', '2013-04-12 13:58:44', NULL),
(2743, 1, '10.0', 'J''adore venir dans ce salon pour l''offre complète qu''il y a, l''ensemble du staff, looké, hétéroclite, souriant, la clientèle elle aussi très hétéroclite. J''adore le mélange des genres.', '1', '2013-04-12 14:04:10', NULL),
(2744, 1, '10.0', 'Un salon chaleureux, toujours à notre écoute, avec des produits de qualité. On se sent ici en confiance.', '1', '2013-04-17 16:03:27', NULL),
(2745, 2, '8.0', 'Bon salon, à la fois pour la coiffure. Une équipe sympathique et un bon accueil. ', '1', '2013-04-17 16:33:42', NULL),
(2746, 1, '10.0', 'Excellente écoute, ambiance douce, massage relaxant génial... Je reviendrai ! Et j''ai été reçue sans RV !', '1', '2013-04-17 16:37:11', NULL),
(2747, 1, '10.0', 'Excellent accueil. Le massage est un + très apprécié. Conseils coiffure bienvenus. Je reviens, donc c''est bon signe, ou que je n''aime pas aller chez le coiffeur', '1', '2013-04-17 16:42:08', NULL),
(2748, 2, '8.0', 'Salon de coiffure pour toute la famille ( tout le monde vient chez moi ). Les coupes sont de qualité. J''ai déja recommandé ce salon autour de moi et le conseil a été suivi.', '1', '2013-04-17 16:46:09', NULL),
(2749, 1, '10.0', 'L''accueil est très très sympathique. Très bon professionalisme de tout le personnel. En un mot, tout est parfait mais il ne faut pas trop l''ébruiter, sinon on va attendre... Mais ce ne sera pas grave, ici on se détend.', '1', '2013-04-17 16:57:48', NULL),
