(2754, 2, '8.0', 'Quand l''hiver traine en longueur, quand le soleil vous manque, quand le boulot vous stresse poussez la porte des petits chandeliers, Riad sera votre guide pour une halte, une respiration et vous puiserez dans ce décor presque familial, cette cuisine des iles le soleil qui manque à votre quotidien.', '1', '2013-04-19 18:08:19', NULL),
(2755, 1, '10.0', 'Super accueil, superbe ambiance. Toujours bien accueillie meme à l''improviste. Je suis toujours contente de ma couleur et de ma coupe et je ne change pas de coiffeur.', '1', '2013-04-19 18:33:07', NULL),
