(2762, 1, '10.0', 'Hello, voilà quasi 7 mois que je reviens régulièrement: changement de &quot;cantine&quot; parce qu''il faut l''avouer, le crier haut et fort : QUALITÉ. QUALITÉ QU ALITE QUALITÉ plus Marie, Ben et les autres une super équipe !! C''est bon voire très bon et ils sont super sympa ! ça sort du cœur !!', '1', '2013-04-23 13:54:23', NULL),
