(2772, 1, '10.0', 'Tu veux passer une bonne soirée, conviviale et bien manger ? C''est l''adresse idéale. Se laisser guider par l''humeur du chef et accompagner le tout d''un bon vin. C''est juste parfois. J''y retourne chaque fois lors de mes déplacements avec grand plaisir', '1', '2013-04-24 11:07:50', NULL),
