(2817, 1, '10.0', 'Accueil convivial et sympathique, expertise capillaire, je reviendrai !\r\n', '1', '2013-05-06 12:54:52', NULL),
(2818, 1, '10.0', 'Je suis toujours très satisfaite en sortant de l''atelier M.Grinberg. Je ne fais confiance qu''à ce coiffeur qui coiffe toujours de la manière qui nous va le mieux ! merci à lui :)', '1', '2013-05-06 13:01:53', NULL),
(2819, 2, '8.0', 'L''accueil est très agréable, on est pris en main dès notre arrivée. Ils sont disponibles et à l''écoute.', '1', '2013-05-06 13:07:30', NULL),
(2820, 1, '10.0', 'Du bonheur à l''accueil, du bonheur dans l''assiette, du bonheur dans le verre et de la convivialité. Adresse à retenir, à garder, et surtout à transmettre.', '1', '2013-05-06 13:13:59', NULL),
(2821, 2, '8.0', 'Je trouve que le salon est accueillant et l''équipe est très chaleureuse. Je suis vraiment satisfaite de la prestation pour laquelle je suis venue. Merci beaucoup', '1', '2013-05-06 13:20:01', NULL),
(2822, 2, '10.0', 'Service excellent, rapide et accueillant !\r\nCadre chaleureux et bien agencé.\r\nCarte variée et inventive dans les entrées ainsi que dans les desserts mais qui reste traditionnelle dans ses plats, où l''on s''attend à plus d''originalité.\r\nCuisine délicieuse: cuissons maîtrisées des poissons comme des viandes, dressage impeccable. Cependant, léger manque d''assaisonnement (sel, poivre) des plats principaux.\r\n\r\nMention spéciale pour les gambas pannées accompagnées de leur sauce tartare, ainsi que de l''ensemble des desserts !\r\n\r\nEn résumé : Un très bon restaurant qui reste abordable. Je le conseille tant pour sa cuisine que pour son cadre !', '1', '2013-05-10 19:23:23', NULL),
(2823, 4, '8.0', 'Nourriture correcte et service excellent et inhabituel à Paris !', '1', '2013-05-13 10:02:42', NULL),
(2824, 1, '10.0', 'Très bon repas, ultra satisfaisant continuer comme ça à recommander à tout les amateur de bonne bouff.', '1', '2013-05-13 10:23:36', NULL),
(2825, 2, '8.0', 'Soirée très agréable. Plats &quot;originaux&quot;, menu peut-être pas avec assez de choix (surtout les desserts) personnel très gentil nous reviendrons.', '1', '2013-05-13 10:29:41', NULL),
(2826, 1, '10.0', 'Excellent food + service\r\nDuck confit amazing', '1', '2013-05-13 10:40:27', NULL),
(2827, 1, '10.0', 'Very, very good food.\r\nAnd very good service. :)', '1', '2013-05-13 10:47:42', NULL),
(2828, 2, '8.0', 'Cher R...,\r\nton cadre est agréable, relaxant, soigné.\r\nLe service correspond à la définition du mot : il est serviable, disponible et aimable. En gros, tes collègues cuisiniers sont des professionnels qui manipulent bien des ingrédients de qualité. Ils devraient encore soigner l''assaisonnement des salades.', '1', '2013-05-13 10:59:16', NULL),
(2829, 1, '10.0', 'Extra !\r\nLe saumon dans sa profiterole était un délice !\r\nsuper rapport qualité prix.', '1', '2013-05-13 11:38:49', NULL),
(2830, 1, '10.0', 'taste good !', '1', '2013-05-13 11:47:11', NULL),
(2831, 1, '10.0', 'Un accueil comme à la maison, sourire et bonne humeur, conseils avisés. Discussion sur les méfaits du tabac, les avantages et inconvénients de la cigarette électronique, ect... avec l''essentiel des assiettes préparées avec amour (et oui!)\r\nmention spéciale au fois gras mi-cuit maison !', '1', '2013-05-13 12:17:26', NULL),
(2832, 1, '10.0', 'En visite avec notre famille sur Paris, nous avons découvert La fable d''Anvers. Le service est parfait, les produits sont d''une fraîcheur indiscutable. Et d''une saveur... Une adresse à partager...', '1', '2013-05-13 14:31:28', NULL),
(2833, 2, '8.0', 'Très bon accueil + très bon service\r\nMagret de canard + sauce chocolat\r\népicé : à troubler !!\r\nNous recommandons vivement ce restaurant.', '1', '2013-05-13 14:46:31', NULL),
