(2960, 2, '8.0', 'Serveur bien sympa, et décontracté, cuisine de qualité tout à fait honorable, bref, une bonne expérience. \r\nJe n''ai pas payé (repas offert par les organisateurs), donc difficile de juger le rapport qualité-prix...', '1', '2013-05-22 15:59:56', NULL),
(2961, 1, '10.0', '', '1', '2013-05-22 16:06:06', NULL),
(2963, 1, '10.0', '- Accueil Impeccable\r\n- Service Impeccable\r\n- Coiffeuses Professionnelles\r\n- Rien à dire...!', '1', '2013-05-22 17:29:38', NULL),
(2964, 1, '10.0', 'Je recommande Ongles et beauté à 200% !\r\nLa prestation que j''ai pu avoir a été rapide et impeccable ! En plus j''ai été très bien accueillie par les deux esthéticiennes !\r\nPetit plus : un fond musical zen', '1', '2013-05-23 15:04:48', NULL),
(2965, 1, '10.0', 'La dorade royale était parfaite. Le service souriant et avenant, on a passé une très bonne soirée, aidée par le champagne :)', '1', '2013-05-23 15:09:08', NULL),
(2966, 1, '10.0', 'très bon accueil\r\ntrès bon service\r\ntoujours à l''écoute des besoins', '1', '2013-05-23 15:10:48', NULL),
(2967, 1, '10.0', 'Le déjeuner était très bon. Nous avons été agréablement surpris par cet endroit\r\nBonne continuation', '1', '2013-05-23 15:14:34', NULL),
(2968, 1, '10.0', '', '1', '2013-05-23 15:15:58', NULL),
(2969, 2, '8.0', 'Cuisine de très bonne qualité dans un cadre agréable. Rapport qualité prix très avantageux. Bonne accueil.', '1', '2013-05-23 15:19:46', NULL),
(2970, 1, '10.0', 'Nous avons passé un excellent moment : cuisine savoureuse, accueil et service impeccable et sympathique !', '1', '2013-05-23 15:24:10', NULL),
(2971, 1, '10.0', '- Tout était parfais.\r\n- Bonne soirée.', '1', '2013-05-23 15:31:20', NULL),
(2972, 2, '8.0', 'Un cadre agréable et accueillant des plats délicieux pour un prix tout à fait raisonnable \r\nPersonnel chaleureux et à votre écoute.\r\n4/5 car la perfection n''existe pas', '1', '2013-05-23 15:41:12', NULL),
(2973, 1, '10.0', 'Quelle surprise aujourd''hui ? Je m''en régale d''avance.\r\nFidèle cliente, je ne me lasse pas de déjeuner régulièrement au restaurant Di Como. Les saveurs originales, la qualité des produits émoustillent les papilles.\r\nUn endroit où s''allient le beau et le bon, le plaisir quoi !', '1', '2013-05-23 15:48:33', NULL),
(2974, 1, '10.0', 'Le comptoir est un café très sympa,\r\nles serveurs sont accueillants et souriants.\r\nLes attentes du clients son pleinement respectées.\r\nLes coût sont bien et son liés à la qualité des aliments\r\ncette ambiance attire les les clients.\r\ncontinuez comme çà =)', '1', '2013-05-23 15:58:30', NULL),
(2975, 2, '8.0', 'C''est top ! et créatif,  il faut y revenir pour le fun !', '1', '2013-05-23 18:30:43', NULL),
(2976, 1, '10.0', 'Accueil très chaleureux et et compétence sont au rendez-vous.', '1', '2013-05-23 18:36:02', NULL),
