(2982, 2, '8.0', '1- Bon rapport qualité/prix des plats - Quantités raisonnable \r\n2- Plat de pintade original\r\n3- Parfait café trop sucré. Mais agréable biscuit croustillant\r\n4- Café pas assez chaud\r\n5- Espace et tables trop étroits. Décoration agréable -Eclairage trop tamisé. Table branlante\r\n6- Personnel compétent et professionnel\r\n7- Table mal équilibrée.', '1', '2013-05-24 11:43:58', NULL),
