(3018, 1, '10.0', 'C''est toujours un immense plaisir de venir se régaler chez Di Como : une cuisine raffinée et recherchée, des plats du jours qui jouent toujours le rôle de &quot;bonne surprise&quot;, un cadre apaisant et convivial et une équipe au petit soin... Le vrai restaurant italien tel qu''il est vraiment rare de le rencontrer dans un quartier si prisé de la capitale française.', '1', '2013-05-24 18:02:06', NULL),
(3019, 1, '10.0', '', '1', '2013-05-24 18:19:44', NULL),
(3020, 1, '10.0', 'Super restaurant très accueillant ou l''on a plaisir à revenir. Pizza super.', '1', '2013-05-24 18:25:12', NULL),
(3021, 1, '10.0', 'établissement toujours égal à lui-même :\r\ncuisine délicieuse\r\naccueil très bon\r\nambiance très plaisante \r\n', '1', '2013-05-24 18:31:46', NULL),
(3022, 1, '10.0', 'Très sympa your happy hour', '1', '2013-05-24 18:36:29', NULL),
(3023, 1, '10.0', 'Très belle carte des plats servis rapidement et très bons.\r\nConseils judicieux.\r\nTrès beaux vins, au verre (rare)\r\nTrès belle soirée. Merci', '1', '2013-05-24 18:42:00', NULL),
(3024, 1, '10.0', 'Merci beaucoup pour cette assiette de légumes - toujours attentive à vos clients et leurs besoins/envies', '1', '2013-05-24 18:47:02', NULL),
(3025, 1, '10.0', 'A la descente de l''avion, après deux mois de froid... juste une parenthèse de sérénité et de bien-être.', '1', '2013-05-24 18:54:56', NULL),
(3026, 1, '10.0', 'EXCELLENTE RSTAURATION D''UN TRES RARE INSTRUMENT', '1', '2013-05-27 17:48:30', NULL),
