(3028, 1, '10.0', '', '1', '2013-05-27 17:55:14', NULL),
(3029, 3, '6.0', 'Si tu passes dans le quartier, prends le temps de t''arrêtés déjeuner chez DI COMO, c''est bon, les filles sont super sympas, les prix raisonnables...', '1', '2013-05-27 18:00:34', NULL),
(3030, 1, '10.0', 'Crumble croustillant, lieu charmant, à bientôt au printemps', '1', '2013-05-27 18:10:07', NULL),
