(3032, 1, '10.0', 'Accueil chaleureux. Bonne cuisine - c''est du fait maison ! Cadre sympathique. A recommander et venir, c''est passer un bon moment, se régaler et... revenir encore et encore', '1', '2013-05-27 18:20:08', NULL),
(3033, 1, '10.0', 'C''est une amie qui m''a fait connaitre ce salon, il y''a de nombreuses années. Je n''ai pas du tout envie de changer', '1', '2013-05-27 18:23:56', NULL),
(3034, 1, '10.0', '', '1', '2013-05-27 18:27:26', NULL),
(3035, 3, '6.0', 'Attention au service on a pas eu de caraffe d''eau.\r\nLe dinner (osso bucco) excellent ! Bravo.\r\nLe café Gourmand aussi, ne baissez pas en qualité svp !\r\nEn revanche, le vin était mauvais, je pense que vous devriez le retirer de votre carte (bourgogne)', '1', '2013-05-27 18:36:14', NULL),
(3036, 1, '10.0', 'Tranquilité, calme et accueil caractérisent ce salon.\r\nUn moment de repos et de pause appréciable.', '1', '2013-05-27 18:42:23', NULL),
(3037, 1, '10.0', 'Super salon, personnel très accueillant et compétant. Je suis toujours satisfaite de ma coiffure, de plus, le cadre est très agréable.', '1', '2013-05-27 18:47:58', NULL),
(3038, 1, '10.0', 'Excellentes endives braisées, et les tartare huitre coquille st Jacques était delicieux\r\nBien sur le soufflé gd mamie est parfait léger, parfumé et souflé :)', '1', '2013-05-27 18:55:57', NULL),
(3039, 2, '8.0', 'angcostantino@gmail.com\r\nNous aimons bien trouver la table avec la serviette (exusez mon français : je veux dino quo nous aimons appuyer sur un surfisco nettoyée la forchette...) Mais tout a eté parfait...!!!', '1', '2013-05-27 19:03:51', NULL),
(3040, 1, '10.0', 'Accueil très agréable, service efficace et aimable et de bon conseil. Visite du chef très agréable.\r\nLes plats et desserts sont délicieux et faits maison !', '1', '2013-05-27 19:08:23', NULL),
(3041, 2, '8.0', 'Repas gouteux, copieux et vraiment très bon.\r\nBravo au cuisinier. Service agréable et accueillant. Restaurant non prévue et agréable surprise', '1', '2013-05-27 19:12:45', NULL),
(3042, 2, '8.0', '- Ambiance habituelle &quot;sympa&quot; retrouvé à chaque fois que je viens\r\n- Jarré de veau / choucroute - aujourd''hui - bien  préparé et goûteux.\r\nA la prochaine', '1', '2013-05-27 19:19:05', NULL),
(3043, 1, '10.0', 'Très bon service, très bon accueil.\r\nIl faudrait prolonger l''happy hour', '1', '2013-05-28 10:32:34', NULL),
(3044, 2, '8.0', 'Très bonne cuisine, simple et sophistiqué\r\nbeaucoup de saveur et de parfum / Ambiance charmante\r\nun peu bruyant', '1', '2013-05-28 10:53:01', NULL),
(3045, 1, '10.0', 'Une souris d''agneau... Un plat qu''on ne cuisine jamais !\r\nmais qu''on peut découvrir à la table d''Anvers. Une adresse à recommander. Le service, en plus, est impeccable. Et le cadre est très classe - Bravo... un beau souvenir', '1', '2013-05-28 10:59:42', NULL),
(3046, 2, '8.0', 'Un excellent accueil !\r\nChaleureux, à l''écoute avec \r\nune pizza 4 fromages délicieuse\r\nune belle adresse à découvrir', '1', '2013-05-28 11:03:07', NULL),
(3047, 1, '10.0', 'Le best du quartier \r\nSinon je ne reviendrais pas depuis 10 ans, depuis que j''habite au Buttes Chaumont. ', '1', '2013-05-28 11:07:22', NULL),
(3048, 1, '10.0', 'Première fois aujourd''hui, une équipe professionnel et à l''écoute de mes besoins.\r\nContente de vous avoir trouvés. Je reviendrais', '1', '2013-05-28 11:14:53', NULL);
INSERT INTO `avis` (`id_avis`, `appreciation`, `note`, `commentaire`, `origine`, `date_avis`, `rester_contact`) VALUES
(3049, 1, '10.0', 'RAS, si je n''était pas satisfaite de toi, je ne ferais pas autant de Km (2h de transports aller simple)\r\nNe change rien et Merci pour toutes les attentions', '1', '2013-05-28 11:20:30', NULL),
(3050, 1, '10.0', 'Un moment de détente inoubliable... c''était trop court !\r\non en voudrait encore. Encore merci pour cette excellent moment.', '1', '2013-05-28 11:35:39', NULL),
(3051, 1, '10.0', 'Super accueil\r\nsurtout pour les Membres de MY HAPPINESS (lol)', '1', '2013-05-28 11:40:39', NULL),
(3052, 2, '8.0', 'Excellent repas en sortant du théatre.\r\naccueil, qualité des plats et rapidité du service\r\nson au rendez-vous', '1', '2013-05-28 11:45:04', NULL),
(3053, 2, '8.0', '- Bon service même si une assiette a été retirée trop rapidement\r\n- Nous recommandons cette adresse', '1', '2013-05-28 11:48:52', NULL),
(3054, 2, '8.0', 'Très bonne manger ! servis impeccable grand qualité des plats et prix contenu !', '1', '2013-05-28 11:54:17', NULL),
(3055, 1, '10.0', 'C''est le meilleur restaurant que je connaisse.\r\nLe service est impeccable et la cuisine est excellente.\r\nSans oublier l''ambiance bien sûr.', '1', '2013-05-28 12:00:21', NULL),
(3056, 1, '10.0', 'Bon croque-monsieur avec salade copieuse.\r\nService rapide.\r\nTrès belle vue.', '1', '2013-05-28 12:03:34', NULL),
(3057, 2, '8.0', 'Très bon ! Le cumin dans le poisson vraiment bien.\r\nCadre agréable. Il faut juste baisser un peu le chauffage !!', '1', '2013-05-28 12:08:20', NULL),
(3058, 1, '10.0', 'Suis satisfaite de tout le personnel toujours très souriant et aimable envers la clientèle. La coiffure et autres soins très bien exécutés. C''est la raison de ma venue hebdomadaire depuis plus d''un an. Salon connu par Colette Grobglas', '1', '2013-05-28 12:16:21', NULL),
(3059, 2, '8.0', 'Service aimable, bon plats !\r\nA recommander a mes amis\r\nJe vais revenir en été pour la terasse', '1', '2013-05-28 12:21:55', NULL),
(3060, 1, '10.0', '', '1', '2013-05-28 12:24:10', NULL),
(3061, 1, '10.0', 'Très convivial.\r\nPersonnel très agréable.\r\nBon rapport qualité / prix', '1', '2013-05-28 14:44:00', NULL),
(3062, 2, '8.0', '', '1', '2013-05-28 14:47:29', NULL),
(3063, 1, '10.0', 'Accueil très chaleureux. Petit institut très convivial. Les soins sont de qualité et les esthéticiennes très souriantes et prevenantes. A recommander', '1', '2013-05-28 14:51:56', NULL),
(3064, 1, '10.0', 'Je vous recommande ce délicieux bistrot où la cuisine est aussi bonne que l''accueil - chaleureux - de patron\r\nune merveille à Montparnasse !', '1', '2013-05-28 15:06:33', NULL),
(3065, 1, '10.0', 'Le conseil d''un ami ! Le travail d'' un pro !\r\nJL y a toujours une solution chez &quot;Léon&quot;', '1', '2013-05-28 15:10:37', NULL),
(3066, 1, '10.0', 'C''est un endroit, très sympa, convivial, accueil chaleureux et adapté, le chef nous propose une cuisine copieuse et savoureuse, 1 vrai bonheur pour les papilles et une invitation au voyage...\r\nA connaitre absolument !!', '1', '2013-05-28 15:15:19', NULL),
(3067, 1, '10.0', 'Cuisine portugaise et familiale. On es toujours bien servis par Rita, avec le sourire et des plats qui sentent bon le Portugal.\r\nA connaitre absolument !', '1', '2013-05-28 15:18:50', NULL),
(3068, 1, '10.0', 'Bon accueil, les personnes sont souriantes !\r\nService rapide et nourriture très bonne.\r\nL''espace intérieur est un peu petit.', '1', '2013-05-28 15:22:22', NULL),
(3069, 1, '10.0', 'Très sympa... surtout avec le massage !', '1', '2013-05-28 15:30:26', NULL),
(3070, 3, '6.0', 'Excellente table\r\nUn goût authentique\r\nUn onctueux au chocolat !!!', '1', '2013-05-28 15:37:57', NULL),
(3071, 1, '10.0', 'On se sens bien ici\r\nsuper accueil, avec toujours le sourire très professionnel et très bon conseille pour tout type de cheveux, que se soit la couleur ou la coupe', '1', '2013-05-28 15:42:35', NULL),
(3072, 1, '10.0', 'Bon accueil du patron - chaleur, gentillesse\r\nVariés et excellents', '1', '2013-05-28 16:17:01', NULL),
(3073, 1, '10.0', 'Salon très sympa. Bon conseils pour la coupe\r\nAccueil très agréable. Je recommande très fortement.', '1', '2013-05-28 16:23:57', NULL),
(3074, 1, '10.0', 'Salle décorée avec goût - Ambiance à la fois élégante et décontrastée \r\nDu hors-d''oeuvre au dessert, plats cuisinés avec raffinement et joliment présentés. Service attentionné ', '1', '2013-05-28 16:32:23', NULL),
(3075, 1, '10.0', 'An excellent meal\r\nFriendly staff', '1', '2013-05-28 17:56:04', NULL),
(3076, 1, '10.0', 'EXCELLENT PROFESSIONNEL,\r\nEXCELLENT ACCUEIL,\r\nJE LUI RESTE FIDELE !', '1', '2013-05-28 18:00:33', NULL),
(3077, 1, '10.0', 'Nous recommandons cette table à tous nos amis de l''olive matino à la grappa en passant par le tiramisu, tout est parfait et typique. l''accueil et le service sont conviviaux et très sypathique.\r\nNous avons passé un moment agréable.\r\nMerci, continuer', '1', '2013-05-28 18:21:54', NULL),
(3078, 1, '10.0', 'Je recommande cet institut Le personnel et très qualifié, de très bonnes connaissances sur tout les sujets concernent l''esthétique. Les esthéticiennes sont très agréables. Si j''habitais à Paris, je reviendrai sans hesitation. Merci beaucoup.\r\nPS :Je suis moi même esthéticienne', '1', '2013-05-28 18:29:08', NULL),
