(3352, 2, '8.0', 'Nous sommes déjà venus, et la qualité des plats est toujours là, tout comme l''accueil.\r\nNous sommes venus en réservant par la fourchette, et l''accueil est le même qu''en venant traditionnellement.\r\nPeut-être de la rapidité au début du service (arrivé à 19h45)', '1', '2013-06-11 14:53:43', NULL),
(3353, 2, '8.0', '&quot;Cuisine très agréable et fine en bouche, ingrédients de très bonne qualité, une carte variée, pour tout les goûts, à recommander sans hésitation.&quot;', '1', '2013-06-11 14:57:53', NULL),
(3354, 1, '10.0', 'Super plats, bonne ambiance, bon accueil et le service est génial. Equipe au top !\r\nMerci Mme RITA', '1', '2013-06-11 17:18:47', NULL),
