(3359, 1, '10.0', 'L''institut est très agréable, chaleureux. dès qu''on rentre, on s''y sent bien equipe dynamique, très agréable, attentive et surtout professionnelle.\r\nJ''adore !!', '1', '2013-06-11 18:18:33', NULL),
(3360, 1, '10.0', '5/5', '1', '2013-06-11 18:22:32', NULL),
(3361, 1, '10.0', 'Très agréable - les produits sont doux et sentent bons.\r\nLe massage détend - 1h30 de détente. On se sent fraîche et reposée !', '1', '2013-06-11 18:28:24', NULL),
(3362, 1, '10.0', 'Tres bon accueil\r\nService rapide\r\nExcellente cuisine', '1', '2013-06-11 18:37:48', NULL),
(3363, 1, '10.0', 'C''est toujours un plaisir de venir, accueil sympa, ambiance détendu. Pas obligé de raconté sa vie, juste un échange simpa.\r\nEt le plus important mes cheveux sont bien traités, toujours contente du résultat.\r\nBons conseils et écoute. A tester ABSOLUMENT.', '1', '2013-06-11 18:56:35', NULL),
(3364, 1, '10.0', 'Waouuuu,je recommande ce salon et plus precieusement Caroline avec qui je passe d''agréables moments,accesssible et amicale,c''est la seule coloriste et excellente coiffeuse  avec qui je suis prête à revivre des experiences capilaires uniques!!!!!je suis comblée et mes amies l''on adoptée.merci ma caro et à très vite.', '1', '2013-06-12 00:53:06', NULL),
(3365, 1, '10.0', 'Très bonne nourriture, dans un cadre simple et chaleureux. Une belle découverte culinaire.\r\nMention spécial au service. A ne pas rater si vous êtes dans le quartier.', '1', '2013-06-12 11:14:28', NULL),
(3366, 2, '8.0', 'Très agréable salon de coiffure, tenu par une coiffeuse qui connait réellement son métier donc on y retourne ', '1', '2013-06-12 11:17:39', NULL),
(3367, 2, '8.0', 'Cadre, sympathique cuisine raffinée et très bon accueil\r\nNous avons passé un moment agréable.', '1', '2013-06-12 11:22:13', NULL),
(3368, 1, '10.0', 'Je te recommande ce nouveau restaurant Italien. La déco est très sympa, l''accueil très chaleureux et les pizzas sont originales et goûteuse - A refaire !', '1', '2013-06-12 11:27:55', NULL),
(3369, 1, '10.0', 'Très bon restaurant avec un large choix de plats très gouteux et prix raisonnable.\r\nJe vous le conseil !', '1', '2013-06-12 11:33:00', NULL),
