(3373, 2, '8.0', 'Très bien accueil, service attentionné. Bon conseil sur les vins. Le menu permet d''avoir un bon aperçu de la carte, à un prix raisonnable. Parfait pour un dîner romantique.', '1', '2013-06-12 14:56:00', NULL);
