(3376, 1, '10.0', 'Pousser la porte des &quot;Rillettes&quot; et vous entrez dans un endroit comme chez vous - un accueil parfait, des conseils avisés, un service aux petits oignons et des plats raffinés. UN vrai bonheur.', '1', '2013-06-14 15:45:22', NULL),
(3377, 1, '10.0', '', '1', '2013-06-14 15:49:32', NULL),
