(3394, 1, '10.0', 'Rentré dans ce lieu par hazard et quel bel hazard !\r\nAprès un petit spectacle sympa, un bistro au nom évocateur \r\nUne cuisine de qualitée, simple et raffinée, un service agréable soucieux du bon déroulement de la soirée achevée par la visite du chef.', '1', '2013-06-14 17:54:34', NULL),
