(3397, 1, '10.0', 'Vous arrivez : les odeurs vous embrassent.\r\nVous vous asseyez : la bonne humeur vous enveloppe.\r\nVous commander : la saveur de la langue napolitaine accompagne vos désirs.\r\nVous n''avez qu''une volonté : revenir.', '1', '2013-06-14 18:12:21', NULL),
