(3403, 1, '10.0', '', '1', '2013-06-17 10:23:50', NULL),
(3404, 2, '8.0', 'Elles sont charmantes, souriantes, alertes\r\nToujours souriantes. Les vins sont bon, et la nourriture.\r\ndu soleil varié.Un brin de créativité serait la bien venue !', '1', '2013-06-17 10:28:36', NULL),
