(3409, 1, '10.0', 'Tous les mois, je fais trois quarts d''heure de trajet en métro pour me faire coiffer dans le salon de Hair design par Mr Joseph. La maison ? C''est que c''est excellent coiffeur et que l''ambiance dans son salon est toujours bonne.', '1', '2013-06-17 10:50:40', NULL),
(3410, 2, '8.0', 'Ce que j''ai aimé : 2-v facile à obtenir, changement d''heure aussi, l''accueil est agréable, l''espace grand, et bien aménagé, calme et reposant, service soignée, merci.', '1', '2013-06-17 10:56:57', NULL),
