(3412, 1, '10.0', 'Rien de mieux que de dîner à la Tavola Di Gio\r\npour retrouver les saveurs de l''Italie !\r\nL''accueil y est toujours sympathique !', '1', '2013-06-17 11:09:49', NULL),
