(3439, 2, '8.0', 'Bon rapport qualité/prix dans un cadre agréable et calme.\r\nOn conseille le carpaccio de saint jacques ainsi que le bar accompagné d''un risotto aux asperges.\r\nLe service de qualité. Restaurant à conseiller', '1', '2013-06-17 17:15:36', NULL),
