(4278, 1, '10.0', 'Nous avons passé une très bonne soirée au Galion.\r\nLa carte est variée, les plats sont savoureux et bien présentés.\r\nDe plus, le cadre est très agréable.\r\nNous recommandons vivement ce restaurant.', '1', '2013-07-11 15:50:04', NULL),
(4279, 1, '10.0', 'Des produits excellents et surtout un coup de ciseau exceptionnel : moi qui n''était pas adepte des coiffeurs par manque de confiance, depuis que j''ai trouvé Michaël je ne viens que chez lui, avec plaisir et l''assurance d''une coupe parfaite et qui dure.', '1', '2013-07-11 15:57:15', NULL),
(4280, 1, '10.0', 'Très belle endroit où je reviendrait sans hésiter, surtout aves les beaux jour qui arrive pr profiter de cette belle terrasse ensoleillée ! On y mange bien, le personnel est très accueillant.', '1', '2013-07-11 17:09:24', NULL),
(4281, 1, '10.0', 'Très bonne cuisine, sensible et attentif aux critiques et attentes des clients. Service impeccable, conviviale !\r\nUn dessert (Tarte Tatin) exquis. Et un digestif apréciable !', '1', '2013-07-11 17:13:54', NULL),
