(4689, 1, '10.0', 'Sceptique sur la cuisson atomik (= unilatérale) de la côte de bœuf... et finalement conquis ! Parfaite cuisson, assortissement de poivres et sels délicieux ! Complété par une bonne sélection de vins à petits prix. Une bonne adresse.', '1', '2013-08-20 11:18:48', NULL),
