(4692, 2, '8.0', 'Très bon accueil\r\nEtant donné le nombre de clients, le service est malgré tout rapide et agréable\r\nExcellente cuisine raffinée\r\npetit bémol : salle petite donc bruyante : il est parfois difficile de s\\''entendre', '1', '2013-08-20 11:33:31', NULL),
(4693, 1, '10.0', 'Excellent service ! Personnel très accueillant, Belle sélection de vin et plats très fins. LE soufflé au chocolat est une pure merveille. La meilleur adresse de la place du Marché St Honoré !', '1', '2013-08-21 10:39:28', NULL),
