(4862, 1, '10.0', 'Très bonne adresse découverte grâce à un amis.\r\nBonne ambiance, bon vin, magret très bien cuisiné, quand à l\\''os à moelle, très rare sur Paris est à savourer !', '1', '2013-09-06 10:04:53', NULL),
