(4865, 2, '8.0', '', '1', '2013-09-09 15:57:36', NULL),
(4866, 1, '10.0', 'Jolie découverte de ce soir, arrivée à l\\''aveuglette,\r\n1ere étape : le plaisir de découvrir le nom des plats et d\\''en sourire, puis goûter ces plats et apprécier ! (Miam le tiramisu PC !)', '1', '2013-09-09 16:01:32', NULL),
(4867, 1, '10.0', 'Un salon où le professionnalisme n\\''empêche pas la convivialité et fait de chaque visite un instant de plaisir.\r\nBref une adresse à recommander sans hésitation', '1', '2013-09-09 16:18:26', NULL),
(4868, 1, '10.0', 'Ambiance sympa - plats de qualité.\r\nBonne musique.\r\nBons conseils.', '1', '2013-09-09 16:24:28', NULL),
(4869, 2, '8.0', 'Comme toujours, depuis des années, accueil, service impeccable et nous nous régalons !!', '1', '2013-09-09 16:28:29', NULL),
(4870, 1, '10.0', 'Instant délicieux. Ici et maintenant comme le vin que je viens de déguster... Exactement ce que j\\''avais envie. Cuisine authentique. Délicieuse. Fraiche comme j\\''adore avec un service convivial. J\\''adore', '1', '2013-09-09 16:32:51', NULL),
(4871, 1, '10.0', 'Une vrai professionnelle de la couleur, depuis des années, je l\\''ai même suivie quand elle s\\''est installée car ses balayages sont les plus beaux !! Et tout le monde me demande son adresse ! Quelle meilleur satisfaction.', '1', '2013-09-09 16:37:59', NULL),
(4872, 1, '10.0', 'Très savoureux, très bon, très rapide, très réactif, très dynamique, très agréable.\r\nNous reviendrons avec plaisir !', '1', '2013-09-09 16:43:10', NULL),
(4873, 1, '10.0', 'Très bon rapport qualité-prix pour la formule.\r\nCuisine originale tout en restant classique et joliment présentée.', '1', '2013-09-09 16:53:40', NULL),
(4874, 2, '8.0', 'Très bon accueil, personnel très gentil et a l\\''écoute.\r\nDonne envie d\\''essayer de nouveaux soins.', '1', '2013-09-09 16:56:52', NULL),
(4875, 1, '10.0', 'Nous adorons venir au Mesturet, à cause d\\''abord de l\\''accueil toujours chaleureux et sympathique, et puis d\\''une cuisine bien française avec des produits de nos régions. L\\''ambiance nous met toujours dans l\\''euphorie. Compliments au patron si présent et attentif.', '1', '2013-09-09 17:06:55', NULL),
(4876, 2, '8.0', 'Dommage de ne pas avoir eu le mille feuilles...', '1', '2013-09-09 17:11:23', NULL),
