(4879, 1, '10.0', 'Accueil très sympathique\r\nTrès bon conseils et bonne écoute.\r\nEnfin un salon où on n\\''a pas l\\''impression d\\''être \\&quot;à la chaîne\\&quot; !', '1', '2013-09-09 17:29:37', NULL),
