(32, '32_Logo VITA.jpg', 'Vitaform', '315 Rue Léon Gambetta ', '', '59800', 'Lille', 2, NULL, 'France', '', NULL, 'Situé au cœur de Lille VITA form vous propose des cours variés et originaux, un suivi et un encadrement au top : fitness, danse, spinning, musculation, power-plate, cardio-training high-tech…\r\n\r\nParce que le sport est bénéfique pour la santé, la qualité de vie, et la forme physique et morale, il est important pour tous de faire du sport dans de bonnes conditions.\r\n\r\nPour cela VITA form permet à chacun de s''épanouir physiquement sous l''encadrement de professeurs diplômés dans une ambiance sympathique et conviviale.\r\n\r\nLa diversité de notre centre en fait un endroit parfait pour tout ceux qui souhaite garder ou retrouver la forme.\r\n\r\nSi vous aimez, voulez, devez, vous bouger et pratiquer une activité sportive, quel que soit votre condition physique, votre niveau, votre objectif, n''hésitez pas à nous rendre visite…\r\n\r\nDonnez du VITA à votre forme !!!\r\n\r\nA très bientôt, sportivement vôtre.\r\nJoseph et Anthony', '8.90', '100', 0, 1, 1, 1, 1, 1, 1, 'Culture-loisirs-et-sports/Vitaform_Lille_59800', 83, 4, 5),
