(63, '63_caroline nour.jpg', 'Caroline Nour', '111 Rue de Charenton ', '', '75012', 'Paris', 1, NULL, 'France', '0143441220', NULL, 'Les instituts Spa Caroline Nour sont heureux de vous accueillir dans un cadre reposant et chaleureux aux couleurs de l''Orient...\r\nBois et pierres visibles pour une ambiance feutrée qui vous permettront de retrouver le bien être et la tranquilité tant recherchés.\r\nGrâce aux mains expertes des esthéticiennes, vous trouverez calme et sérénité.', '9.30', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Caroline-Nour_Paris_75012', 34, 2, 8),
(64, '64_vilchez logo.jpg', 'Vilches Fresia FV Esthétique ', '7 Rue du hameau', '', '75015', 'Paris', 1, NULL, 'France', '0142506477', NULL, 'Esthéticienne depuis plus de 25 ans, diplômée d''état, avec une très vaste expérience et ayant été  formatrice nationale et internationale Fresia Vilches met à disposition ses connaissances par des soins de qualité affirmé dans un cadre simple et chaleureux avec des produits actifs de pointe\r\nqui répondent aux exigences de notre époque.\r\nSes spécialités sont reconnues dans le soin du visage, du corps, des Pieds, des mains, et des UVA.\r\n\r\nN''hésitez pas à demander votre carte de fidélité vous aurez des avantages immédiats\r\n\r\n', '9.60', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Vilches-Fresia-FV-Esthetique-_Paris_75015', 34, 14, 8),
(65, '65_attitude-beaute.jpg', 'Attitude beauté', '48 Avenue de la bourdonnais', '', '75007', 'Paris', 1, NULL, 'France', '0145501976', NULL, 'Attitude Beauté est partenaire\r\nCELLU M6 appareil de massage pour l''endermologie, le lipomassage et l''endermolift.                                           \r\nSPECIALISTE ANTI-AGE\r\noffrez vous un teint parfait ! Profitez de promotions exceptionnelles.\r\n\r\nVERNIS SHELLAC\r\nfini le vernis qui s''écaille, plus d''attente de séchage, tenue 14 jours.\r\n\r\nQUE CHOISIR nous récompense\r\nqualité des prestations excellentes, bon accueil,  prestations très professionnelles.', '9.70', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Attitude-beaute_Paris_75007', 34, 17, 8),
(66, '66_logo_ohm_original.JPG', 'OHM Institut Ranelagh', '91 Rue du ranelagh', '', '75016', 'Paris', 1, NULL, 'France', '', NULL, 'Nos instituts d''esthétique et de bronzage sont situés dans le 9éme et 16éme arrondissement de Paris.\r\n\r\nNous mettons à votre disposition un espace raffiné et convivial où nous accueillerons femmes et hommes dans une ambiance propice à la détente. Mincir, Rajeunir, Epiler et Bronzer sont nos maîtres mots!\r\nPour toutes nos prestations nous vous apportons le meilleur de notre savoir faire :\r\n\r\n    Les soins sont réalisés par des professionnelles diplômées qui bénéficient d’une formation permanente aux nouvelles technologies, et aux nouveaux produits.\r\n    Nous vous apportons, un diagnostique et un conseil personnalisés et vous assurons des conditions d’hygiène rigoureuses.\r\n    Nous vous proposons les meilleures technologies, notamment en ce qui concerne :\r\n    le bronzage, en vous proposant toutes les solutions de bronzage existantes, ainsi que des conseils de spécialistes ;\r\n    la dépilation durable avec des appareils high tech de la dernière génération ;\r\n    les solutions d’amincissement et anti-âges, corps et visage grâce à un nouveau concept de haute technologie, qui vous permettra d’obtenir des résultats rapides, durables, et visibles dés la première séance dans la plupart des cas.\r\n\r\n\r\n\r\nVotre temps est précieux ! Pour que vous vous ne le perdiez pas, nous travaillons avec et sans rendez-vous pour toutes nos prestations de bien-être. Les rendez vous sont assurés à 5 minutes près.\r\n\r\nBronzez sans rendez-vous avec nos 6 cabines solariums de Ranelagh et nos 7 solariums de Lafayette\r\nBienvenue chez Ranelagh et Lafayette !', '9.60', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/OHM-Institut-Ranelagh_Paris_75016', 124, 18, 8),
(67, '67_logo_ohm_original.JPG', 'OHM Institut Lafayette', '6 Rue de la victoire', '', '75009', 'Paris', 1, NULL, 'France', '', NULL, 'Nos instituts d''esthétique et de bronzage sont situés dans le 9éme et 16éme arrondissement de Paris.\r\n\r\nNous mettons à votre disposition un espace raffiné et convivial où nous accueillerons femmes et hommes dans une ambiance propice à la détente. Mincir, Rajeunir, Epiler et Bronzer sont nos maîtres mots!\r\nPour toutes nos prestations nous vous apportons le meilleur de notre savoir faire :\r\n\r\n    Les soins sont réalisés par des professionnelles diplômées qui bénéficient d’une formation permanente aux nouvelles technologies, et aux nouveaux produits.\r\n    Nous vous apportons, un diagnostique et un conseil personnalisés et vous assurons des conditions d’hygiène rigoureuses.\r\n    Nous vous proposons les meilleures technologies, notamment en ce qui concerne :\r\n    le bronzage, en vous proposant toutes les solutions de bronzage existantes, ainsi que des conseils de spécialistes ;\r\n    la dépilation durable avec des appareils high tech de la dernière génération ;\r\n    les solutions d’amincissement et anti-âges, corps et visage grâce à un nouveau concept de haute technologie, qui vous permettra d’obtenir des résultats rapides, durables, et visibles dés la première séance dans la plupart des cas.\r\n\r\n\r\n\r\nVotre temps est précieux ! Pour que vous vous ne le perdiez pas, nous travaillons avec et sans rendez-vous pour toutes nos prestations de bien-être. Les rendez vous sont assurés à 5 minutes près.\r\n\r\nBronzez sans rendez-vous avec nos 6 cabines solariums de Ranelagh et nos 7 solariums de Lafayette\r\nBienvenue chez Ranelagh et Lafayette !', '9.10', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/OHM-Institut-Lafayette_Paris_75009', 179, 18, 8),
(68, '68_photo-12.JPG', 'Le gorille blanc', '4 Impasse Guéménée', '', '75004', 'Paris', 1, NULL, 'France', '0142720845', NULL, 'Dans son cadre typique parisien, version relookée, les Sieurs Areny père et fils nous offrent tous les plaisirs d''une cuisine authentique qui fleure bon le sud ouest.\r\n\r\nUn vrai rayon de soleil appréciable en terrasse comme en intérieur.\r\n\r\n', '9.20', '99', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-gorille-blanc_Paris_75004', 34, 2, 1),
(69, '69_logo institut micheline.jpg', 'Institut Micheline', '16,Rue Pestalozzi', '', '75005', 'Paris', 1, NULL, 'France', '0143315880', NULL, 'Micheline, professionnelle de la beauté et du bien être à été formée par l''institut Esthederm, dans un cadre écologique pour une prise en charge globale afin de définir des programmes symbiotiques ( association réciproquement profitable pour une beauté durable ) car la peau est programmée pour vivre longtemps et il faut la traiter sur le long terme.', '9.80', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Institut-Micheline_Paris_75005', 257, 2, 8),
(70, '70_logo les thermes saint germain.jpg', 'Les Thermes Saint Germain', '26 Rue de l''échaudé', '', '75006', 'Paris', 1, NULL, 'France', '0156813111', NULL, 'Havre de paix niché au coeur de Saint Germain à l''abri des regards, élégant et discret, les Thermes Saint Germain vous accueillent dans un décor unique où se mèlent mosaiques orientales et ambiance zen, l''atmosphère y est enivrante et on ne peut plus relaxante.\r\n\r\nCe lieu magique vous surprendra agréablement : caves voutées éclairées de petites bougies, cabines douillettes, salon de thé orientale, poutres apparentes ...\r\n\r\nPartez à la découverte de massages venant des quatres coins du monde et laissez-vous charmer.', '9.00', '99', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Les-Thermes-Saint-Germain_Paris_75006', 1154, 2, 8),
(71, '71_reflet du liban.jpg', 'Reflets du liban', '25 Rue de Brantôme', '', '75003', 'Paris', 1, NULL, 'France', '0142774677', NULL, 'À deux pas du centre Pompidou et de Beaubourg, dans le 3ème arondt de Paris, le restaurant libanais Reflets du Liban vous propose un voyage culinaire au pays du Cèdre. La salle est spacieuse et très lumineuse. Vous apprécierez son côté rustique avec ses poutres au plafond et ses murs en pierre.\r\n\r\nDans l’assiette, vous découvrirez les douces saveurs et senteurs de la cuisine libanaise. Le Chef exécute des mets rafraîchissants comme le taboulé ou d''autres plus épicés. C’est selon vos goûts. La carte expose les grandes spécialités de la gastronomique libanaise. Et, pour les gourmands, on conseillera le spécial maison Atayef ! Un vrai délice !\r\n\r\nUne adresse incontournable pour les amoureux de la cuisine orientale ! A découvrir et à faire découvrir !', '8.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Reflets-du-liban_Paris_75003', 2781, 2, 1),
(72, '72_logo marlene ferreire.gif', 'Institut Marlène Ferreire', '25 avenue Carnot', '', '75017', 'Paris', 1, NULL, 'France', '0145744343', NULL, 'Nous vous accueillons aux pieds de l''Arc de Triomphe pour un moment de voyage et de douceur. Nous sommes le seul établissement du 17ème arrondissement à utiliser les produits de la marque FLEUR''S.\r\n\r\nLes produits Fleur’s contiennent des actifs 100% d’origine naturelle issus : du monde floral (cosmétologie jaune) essences florales, eaux florales, huiles essentielles de fleurs…et du\r\nmonde végétal (cosmétologie verte) extraits aqueux ou huileux de plantes, huiles essentielles de plantes, fruits…', '10.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Institut-Marlene-Ferreire_Paris_75017', 34, 2, 8),
(73, 'logo_company.gif', 'Institut Trois mondes', '8 Rue du père Guérin', '', '75013', 'Paris', 1, NULL, 'France', '0953573100', NULL, 'Europe, Orient, Asie... toute une palette de couleurs, de senteurs et de savoir-faire s''harmonise et se décline en de multiples possibilités de soins pour le visage, le corps et l'' esprit.\r\n \r\nLoin du stress et de la circulation dans une rue piétonne et calme, venez vous détendre et oublier votre quotidien dans notre espaceTrois Mondes. Vous y trouverez des soins esthétiques de qualité pour le visage et le corps.\r\nEvadez vous au cours d’un massage aux huiles essentielles sous les mains expertes de nos esthéticiennes.\r\n \r\nUn moment magique. Inoubliable !\r\nUn cadeau – divin - à se faire. Ou à offrir.\r\n \r\nBonne visite, et à bientôt !', '9.20', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Institut-Trois-mondes_Paris_75013', 34, 2, 8),
(74, '74_photo-30.JPG', 'Institut Frimousse', '14 Rue Trousseau', '', '75011', 'Paris', 1, NULL, 'France', '0143557553', NULL, 'Prenez soin de vous avec votre institut Frimousse !\r\nPerformance, modernité et prix attractifs\r\n\r\nUn institut de beauté traditionnel et chaleureux entre Bastille et Nation, où notre équipe d''esthéticiennes professionnelles sera à votre écoute pour mieux vous prendre en charge et vous conseiller sur votre beauté.\r\n\r\nUne large carte de prestations, exécutée avec les produits &quot;Institut Estherderm&quot; ou &quot;Phyt''s&quot; vous sera proposée.\r\n\r\nAinsi, les moments partagés à nos côtés seront pour vous une parenthèse agréable de &quot;soins de soi&quot;.\r\nQue faisons-nous ?\r\n\r\nBeauté, bien-être et jeunesse sont des valeurs montantes.\r\n\r\nRésultat : l''esthéticienne reçoit chaque jour, dans son institut ou dans sa parfumerie, de nouveaux clients. Sa mission : raffermir et améliorer la texture d''une peau, cacher les imperfections d''un visage ou d''un corps, retarder les effets du vieillissement...\r\nNotre savoir-faire\r\n\r\nIdentifier chaque type de peau, connaître les cosmétiques et les techniques de soin est primordial.\r\n\r\nPolyvalente, l''esthéticienne peut tour à tour épiler, maquiller, faire les ongles, appliquer un masque.\r\n', '9.90', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Institut-Frimousse_Paris_75011', 357, 2, 8),
(75, '75_photo-20.JPG', 'Angéline Coiffure', '13 Rue Mayet', '', '75006', 'Paris', 1, NULL, 'France', '0147834212', NULL, '', '9.50', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Angeline-Coiffure_Paris_75006', 354, 2, 19),
(76, 'logo_company.gif', 'Terrabea', '51 Rue de rochechouart', '', '75009', 'Paris', 1, NULL, 'France', '0148783049', NULL, 'L’institut propose une gamme complète de soins adaptés à vos souhaits et aux besoins de votre corps en partenariat\r\navec des Marques haut de gamme. Un moment de qualité, juste pour vous.', '9.70', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Terrabea_Paris_75009', 337, 2, 8),
(77, '77_logo ongles et beaute.jpg', 'Ongles et Beauté Charenton', '250 Rue de Charenton', '', '75012', 'Paris', 1, NULL, 'France', '0143405348', NULL, 'L''institut ONGLES ET BEAUTE ainsi que son équipe de professionnelles vous proposent d''entrer dans une ambiance de beauté et de détente pour vous procurer un moment d''évasion et de bien-être.\r\n\r\nL''institut vous propose un magasin spacieux, un espace onglerie, un salon d''attente, ainsi que trois cabines de soins et une cabine d''UV climatisée.\r\n\r\nClientèle UNIQUEMENT féminine acceptée. N''hésitez pas à nous contacter pour tout renseignement et pour prendre un rendez-vous. ', '9.50', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Ongles-et-Beaute-Charenton_Paris_75012', 515, 22, 8),
(78, 'logo_company.gif', 'Instant Magic', '10 Rue Alphonse Daudet', '', '75014', 'Paris', 1, NULL, 'France', '0145408606', NULL, 'Le Salon d''esthétique Instant Magic dans le 14e arrondissement de Paris vous accueille tous les jours de la semaine pour votre bien-être.', '9.70', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Instant-Magic_Paris_75014', 516, 2, 8),
(79, '79_comweekbizbeaute888-1.png_w124h124.jpg', 'Beaute 888', '47 Rue Letellier', '', '75015', 'Paris', 1, NULL, 'France', '0145792919', NULL, 'Beauté 888 vous accueille dans le 15ème arrondissement de Paris.\r\n\r\nBeauté 888, c''est le moment de détente lié aux bienfaits des massages esthétiques.\r\n\r\nNous vous proposons des soins énergétiques grâce à la chromo-énergie et aux produits naturels.\r\n \r\nNous réalisons également des épilations à la lumière pulsée et à l''orientale pour l''obtention d''une peau toute douce et nette.\r\n \r\nVenez prendre soin de vos mains avec une manucure et la pose d''ongles.\r\n \r\nDe plus, nous vous proposons des forfaits pour les séances UV afin de garder un teint hâlé toute l''année.\r\n \r\nDes forfaits sont aussi disponibles pour une cure d''amincissement !\r\n\r\nBeauté 888 vous accueille tout au long de l''année pour les soins de vos rêves alors, prenez rendez-vous!', '9.80', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Beaute-888_Paris_75015', 485, 2, 8),
(80, 'logo_company.gif', 'Ongles Aurélia', '62 Rue Ordener', '', '75018', 'Paris', 1, NULL, 'France', '0142524261', NULL, '', '9.70', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Ongles-Aurelia_Paris_75018', 619, 2, 8),
(81, '81_photo-31.JPG', 'Bruno Crescenzii', '42 Rue d''Artois', '', '75008', 'Paris', 1, NULL, 'France', '0145635536', NULL, 'Bruno Crescenzii, barbier et coiffeur pour hommes, est situé à Paris.\r\nNous proposons à notre clientèle des coupes traditionnelles aux ciseaux.\r\nQue vous soyez un homme au look branché ou au look classique, vos coiffeurs trouvent la coupe qui vous ressemble.\r\nNos barbiers rasent votre barbe ou votre moustache au coupe chou, accompagné de serviettes chaudes et de serviettes froides.\r\nVous trouverez également dans votre salon la vente de produits capillaires.\r\nBruno Crescenzii vous accueille dans une ambiance chaleureuse. Votre salon est plus qu''un salon de coiffure, c''est le lieu de rencontre et de détente pour les hommes au cœur de Paris.\r\nNotre équipe vous conseille et reste à votre disposition afin de vous faire passer un moment alliant détente et bien-être.', '9.90', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Bruno-Crescenzii_Paris_75008', 1687, 2, 19),
