(102, 'logo_company.gif', 'Michael Grinberg', '15 Rue des moines', '', '75017', 'Paris', 1, NULL, 'France', '0142288899', NULL, 'C''est d''un coup de baguette magique ... \r\nau sein de son atelier Leonor Greyl, dans le quartier très bobo des Batignolles : 15 rue des moines- Paris 17 ème, que Michaël Grinberg vous sublime dans une ambiance feutrée, d’où vous repartirez relaxées et enchantées.\r\n\r\nSalon de haute coiffure et institut du cheveu par les soins Leonor greyl, on vient se détendre avec des massages ciblés ( cuir chevelu,cervicales, épaules) très agréables  aux senteurs fleuries tout en appréciant la personnalisation des formules suivant la nature et le type de cheveux permettant d''obtenir des résultats instantanés et durables à base d’ingrédients 100 % naturels.   Il ne reste plus qu''à la magie d''opérer!\r\n\r\nVous découvrirez un artiste surnommé &quot;le magicien de la coiffure&quot;, qui du haut de ses 13 ans approchait déjà la coiffure et la magie avec les plus grands virtuoses dans leurs arts respectifs. Ses talents repérés, il fera ses classes au sein des plus prestigieux salons parisiens.          Directeur artistique, il sublimera les coupes, les couleurs et les mises en beauté (chignons, maquillage) de la jet-set internationale avant de se consacrer à sa clientèle de fidèles en quête d''une composition sur mesure. \r\n\r\nDes coupes classiques aux plus branchées et déstructurées, en véritable reloukeur avant gardiste, il révèle l''esthétisme de votre visage et réussit la communion parfaite entre le style créé et votre personnalité.\r\nDes couleurs bio, aux plantes, le coloriste cultive son engagement pour l''excellence qualitative de ses produits ainsi la magie des pigments naturels opère, maitrisée par sa graine de génie... Votre visage rayonne par des mèches aux nuances lumineuses subtilement fondues dans votre chevelure.                  \r\n\r\nSa passion ne s''arrête pas là, ce spécialiste du mariage ouvert le dimanche matin, réalise avec une dextérité déconcertante  des chignons d''exception, toutes les époques,tous les styles, il se fait à la fois sculpteur d''une matière vivante qu''il peut façonner avec  créativité, élégance et raffinement, et peintre d''une beauté captivante, singulière et juste pour un maquillage artistique, les deux réunis feront de vous la plus belle des femmes lors de ce jour exceptionnel.\r\n\r\nSarah Grinberg ', '9.70', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Michael-Grinberg_Paris_75017', 1473, 2, 19),
(103, '103_delices_180-28a37.jpg', 'Boulangerie Patisserie Le champ des délices', '145 Rue Saint Dominique', '', '75007', 'Paris', 1, NULL, 'France', '0145514386', NULL, '', '9.80', '100', 1, 1, 1, 1, 1, 1, 1, 'Commerces/Boulangerie-Patisserie-Le-champ-des-delices_Paris_75007', 1499, 2, 3),
