(108, '108_1708-amour-de-burger.jpg', 'Amour de Burger', '7 Rue Godot de Mauroy', '', '75009', 'Paris', 1, NULL, 'France', '0142657747', NULL, 'BURGER MANIA - Amoureux du burger, bienvenu au restaurant L’Amour du Burger, ici une farandole de burgers plus appétissants les uns que les autres vous attendent pour un festin où le plaisir sera au rendez-vous. Le tout-Paris y coure pour y dévorez ses spécialités d''outre-Atlantique !\r\nAMOUR DU BURGER - Le restaurant dispose de sa propre boulangerie et pâtisserie, ce qui permet la confection de pains à burger succulents et surprenants. Les recettes de ses sandwichs sont retravaillées par le Chef de l’établissement avec des produits du terroir français ! Burger à la viande de Salers aux pépites de foie gras ou façon Rossini, vous serez séduit ! \r\n\r\nAMBIANCE BURGER – Le cadre convivial accompagnera votre dégustation, au fil de vos venues vous varierez entre les trois salles du restaurant possédant chacune une ambiance propre !\r\n\r\nOUVERT DU LUNDI AU SAMEDI DE 11H30 A 15H ET DE 19H A 22H30 SAUF LE LUNDI SOIR ET LE DIMANCHE', '8.00', '98', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Amour-de-Burger_Paris_75009', 4805, 2, 1),
