(116, 'logo_company.gif', 'Pretty Hair', '96 Bis Rue Bobillot', '', '75013', 'Paris', 1, NULL, 'France', '0145883099', NULL, 'Le salon Pretty Hair vous propose ses services de coiffure, visagiste et coloriste. Nos coiffeurs professionnels vous conseillent et interviennent pour une coupe, une coloration ou une permanente. Nous sommes également spécialisés dans les lissages japonais, coréen et brésilien. L''équipe de Pretty Hair vous accueille dans un cadre chaleureux et convivial au 98 bis rue Bobillot à Paris 13eme.				\r\n', '9.70', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Pretty-Hair_Paris_75013', 34, 2, 19),
