(140, 'logo_company.gif', 'Alvarez Espace coiffure Martyrs', '41 Rue des martyrs', '', 'France', 'Paris', 1, NULL, 'France', '0148781331', NULL, 'C’est l’histoire de Jean-Fernand Alvarez, jeune artisan coiffeur qui s’est implanté rue des Martyrs côté 9e arrondissement en 1993, et qui, depuis, a conquis une clientèle de plus en plus large venant des 9e et 18e arrondissements. Le salon de coiffure s’est peu à peu élargi pour fournir de nombreuses prestations allant de l’esthétique aux soins du corps. En plus de la coiffure, l’espace Alvarez est véritablement dédié à la beauté.\r\n\r\nMais l’espace Martyrs n’étant pas extensible, Jean-Fernand Alvarez a choisi de s’agrandir, et pour satis­faire sa clientèle du 18e, d’ouvrir un deuxième espace rue Lepic.\r\n\r\nFort de son succès, une partie de l’équipe de professionnels de la rue des Martyrs est désormais installée au 48 de la rue Lepic depuis mi-dé­cembre. Car depuis presque vingt ans, Jean-Fernand Alvarez a fidélisé une équipe de collaborateurs qua­lifiés, et ce sont eux qui travaillent maintenant à l’espace Alvarez Paris, sous la direction d’Emmanuelle Bris­seau qui a 18 ans d’expérience rue des Martyrs.\r\n\r\nUne partie de la clientèle de la rue des Martyrs devrait donc suivre ces pro­fessionnels de la beauté. On peut se réjouir d’apprendre que ce deuxième espace devrait aussi créer six nou­veaux emplois. Venez donc découvrir ce nouvel espace de plus de 150m2 dédié à la beauté, où vous pourrez tout faire en même temps dans le même endroit, pour un rapport qua­lité/prix très appréciable.', '9.30', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Alvarez-Espace-coiffure-Martyrs_Paris_France', 2627, 2, 19),
