(144, 'logo_company.gif', 'La table d''anvers', '2 place d''anvers@', '', '75009', 'Paris', 1, NULL, 'France', '0148783521', NULL, '', '8.80', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/La-table-d-anvers_Paris_75009', 2, 2, 1),
(145, 'logo_company.gif', 'Di como', '16 Rue du bac', '', '75007', 'Paris', 1, NULL, 'France', '0142603774', NULL, '&quot;Di Como&quot; est une dédicace au lac de Côme, situé au Nord de l''Italie, en Lombardie, région natale du chef de cuisine, Alessandro Gelpi.\r\n\r\nCe restaurant est situé dans le quartier des antiquaires, à deux pas du musée d''Orsay. Alessandro concocte pour vous des plats savoureux, substantiels tout en respectant les traditions familiales transmises par ses grands-parents, eux mêmes restaurateurs.', '9.10', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Di-como_Paris_75007', 2712, 2, 1),
(146, 'logo_company.gif', 'La table d''Anvers', '2 place d''Anvers', '', '75009', 'Paris', 1, NULL, 'France', '0148783521', NULL, 'Dans un décor chic et tendance à la fois, venez découvrir l''ambiance détendue et agréable qui règne à La Table d''Anvers.\r\n\r\nAyant toujours mis l’accent sur la qualité, les plats proposés sont entièrement élaborés par les soins du Chef sur la base de produits du marché.\r\n\r\nIl s''agit d''un endroit incontournable dont la cuisine française et inventive ne manquera pas de surprendre vos papilles.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/La-table-d-Anvers_Paris_75009', 1, 2, 1),
(147, 'logo_company.gif', 'Le Bistro des Campagnes', '6 rue Léopold Robert', '', '75014', 'Paris', 1, NULL, 'France', '0140479127', NULL, 'Le restaurant Le Bistrot des Campagnes, situé dans le 14e arrondissement de Paris, entre Montparnasse et Port-Royal, vous invite à prendre place dans un cadre champêtre. La salle est boisée et de beaux tableaux bigarrés d’art contemporain tapissent les murs.\r\n\r\nVenez déguster une cuisine française traditionnelle composée avec des produits frais pour le plus grand bonheur de vos papilles délicates ! La carte est variée et propose un millefeuille de canard aux épices douces délicieux ! Ou encore la succulente choucroute de haddock fumé et pochée à l''Anglaise !\r\n\r\nPour vos événements festifs, l´établissement permet également la privatisation du lieu. Une adresse à découvrir et à faire découvrir tant pour le cadre que pour l’assiette !', '8.80', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Bistro-des-Campagnes_Paris_75014', 2739, 2, 1),
(148, 'logo_company.gif', 'Alvarez Espace coiffure Lepic', '48 rue Lepic', '', '75018', 'Paris', 1, NULL, 'France', '0175514593', NULL, 'C’est l’histoire de Jean-Fernand Alvarez, jeune artisan coiffeur qui s’est implanté rue des Martyrs côté 9e arrondissement en 1993, et qui, depuis, a conquis une clientèle de plus en plus large venant des 9e et 18e arrondissements. Le salon de coiffure s’est peu à peu élargi pour fournir de nombreuses prestations allant de l’esthétique aux soins du corps. En plus de la coiffure, l’espace Alvarez est véritablement dédié à la beauté.\r\n\r\nMais l’espace Martyrs n’étant pas extensible, Jean-Fernand Alvarez a choisi de s’agrandir, et pour satis­faire sa clientèle du 18e, d’ouvrir un deuxième espace rue Lepic.\r\n\r\nFort de son succès, une partie de l’équipe de professionnels de la rue des Martyrs est désormais installée au 48 de la rue Lepic depuis mi-dé­cembre. Car depuis presque vingt ans, Jean-Fernand Alvarez a fidélisé une équipe de collaborateurs qua­lifiés, et ce sont eux qui travaillent maintenant à l’espace Alvarez Paris, sous la direction d’Emmanuelle Bris­seau qui a 18 ans d’expérience rue des Martyrs.\r\n\r\nUne partie de la clientèle de la rue des Martyrs devrait donc suivre ces pro­fessionnels de la beauté. On peut se réjouir d’apprendre que ce deuxième espace devrait aussi créer six nou­veaux emplois. Venez donc découvrir ce nouvel espace de plus de 150m2 dédié à la beauté, où vous pourrez tout faire en même temps dans le même endroit, pour un rapport qua­lité/prix très appréciable.', '9.20', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Alvarez-Espace-coiffure-Lepic_Paris_75018', 2756, 2, 19),
(149, 'logo_company.gif', 'Eric Seror', '78 rue Mademoiselle', '', '75015', 'Paris', 1, NULL, 'France', '0142731761', NULL, '', '9.80', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Eric-Seror_Paris_75015', 3058, 2, 19),
(150, 'logo_company.gif', 'Axuria Restaurant', '54 avenue Félix FAURE', '', '75015', 'Paris', 1, NULL, 'France', '0145541391', NULL, 'Situé dans le 15ème arrondissement l''Axuria, anciennement La Chaumière fait peau neuve : les habitués et fidèles du quartier seront ravis de cette transformation.\r\nLa déco est contemporaine, les matières utilisées sont naturelles, basées sur une tendance écologique, signé Mounia.\r\nLe talentueux chef-propriétaire de l''Axuria Olivier Amestoy vous propose une cuisine généreuse vouée à l''océan où les poissons nobles sont à l''honneur. Le service est attentif et professionnel.', '9.20', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Axuria-Restaurant_Paris_75015', 2808, 2, 1),
(151, 'logo_company.gif', 'Al Ajami', '58 rue François 1er ', '', '750078', 'Paris', 1, NULL, 'France', '0142253844', NULL, 'Le restaurant Al-Ajami vous invite à un voyage gastronomique, à la découverte des goûts et parfums de l’Orient. \r\n\r\nVenez déguster une cuisine libanaise traditionnelle, empreinte de créativité et d’originalité. Ce savoir-faire culinaire, transmis de père en fils depuis 1920, a été récompensé par la Médaille d’Or du mérite en 1970, décernée par le Ministère du Tourisme, puis en 2000, par la Médaille d’Or des Arts de la table.\r\n\r\nAujourd’hui, de Beyrouth à Paris, l’histoire continue. Toute l’équipe vous accueille avec passion et dévouement pour embarquer direction l’Orient mythique.', '9.50', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Al-Ajami_Paris_750078', 2824, 2, 1),
(152, 'logo_company.gif', 'Chez Les Artistes', '25 rue de Faubourg Saint Martin', '', '75010', 'Paris', 1, NULL, 'France', '0142083433', NULL, 'En plein coeur du quartier des théâtres, Le Comptoir des Artistes est le restaurant idéal pour dîner avant ou après un spectacle. Tandis que le rouge chaleureux du décor rappelle les rideaux qui s''ouvrent sur une scène, les assiettes révèlent des valeurs sûres de bistrots parisiens (Escargots de Bourgogne, Sole meunière, Crêpe Suzette...) élaborées à partir de produits de qualité.', '9.20', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Chez-Les-Artistes_Paris_75010', 2745, 2, 1),
(153, 'logo_company.gif', 'Le Petit Chablisien', '44 rue de Londres', '', '75008', 'Paris', 1, NULL, 'France', '0143874615', NULL, 'Esprit bistrot 8ème – C’est à deux pas de Saint-Lazare et des grands magasins, dans l’élégant 8ème arrondissement parisien, que vous trouverez l’épicurien bistrot Le Petit Chablisien. Une situation idéale, un cadre cosy et épuré dans les tons noir et orangé, ce bistrot a vraiment tout pour lui.\r\n\r\nFraîche et joyeuse - La cuisine du Chef, à base de produits frais, s’adapte en fonction des saisons et se pare à chaque fois de nouvelles saveurs. Saint-Jacques ou caille rôtie, foie gras ou filet de bar et enfin moelleux ou financier… Du salé au sucré, vos papilles seront en fête.\r\n\r\nDisciple d’Épicure – Le Petit Chablisien ravira les amateurs de vins de Bourgogne et de Côte du Rhône grâce à une carte de vins sélectionnée avec soin et expérience. Demandez conseil au Chef au moment de choisir vos plats pour réussir les associations les plus savoureuses.', '8.70', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Petit-Chablisien_Paris_75008', 4691, 2, 1),
(154, 'logo_company.gif', 'Chez Rita', '67 rue des Orteaux', '', '75020', 'Paris', 1, NULL, 'France', '0144647609', NULL, 'Dans une toute petite rue, Rita la patronne des lieux vous attend chaleureusement avec le sourire. La carte méle à la fois spécialités françaises et spécialités portugaises et propose un grand choix de poissons et de viandes copieusement servis.', '9.60', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Chez-Rita_Paris_75020', 2832, 2, 1),
(155, 'logo_company.gif', 'MH COIFFURE', '15 Rue Boissy d''Anglas', '', '75008', 'Paris', 1, NULL, 'France', '0147421577', NULL, 'Vous garderez en mémoire la cabine de soins privée… tel un jardin aux senteurs bienfaisantes…\r\n\r\nIl apporte un sentiment de bien-être qu’une douce musique classique vient conforter. Diffusion d’images oniriques pour parfaire cette expérience de beauté.', '9.70', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/MH-COIFFURE_Paris_75008', 2909, 2, 19),
(156, 'logo_company.gif', 'La Famiglia', '71 rue du Faubourg Poissonière', '', '75009', 'Paris', 1, NULL, 'Paris', '0148244079', NULL, 'Vous recherchez une cuisine italienne authentique ? N’hésitez plus, faites un détour par la Porte de Maillot, et vous découvrirez le restaurant gastronomique La Famiglia.\r\n\r\nDepuis plus de 20 ans, ce restaurant propose l’excellence de la cuisine italienne : pâtes fraîches faites maison (Cappelletti, Gnocchi, Fusilli, Ravioli…), antipasto à l’italienne…\r\nLes mets proposés sont préparés à base de produits frais et cuisinés dans une atmosphère familiale.\r\nLes plats s’associeront avec magie à la sélection des vins italiens du restaurant.\r\n\r\nComme de nombreuses personnes célèbres, venez passer un agréable moment, à la découverte de nouvelles saveurs. La Famiglia vous promet de passer un moment d’exception dans son univers haut en couleur !', '9.80', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/La-Famiglia_Paris_75009', 2877, 2, 1),
(157, 'logo_company.gif', 'Café Renard ', 'Jardin des Tuilleries', '', '75001', 'Paris', 1, NULL, 'France', '0142965056', NULL, 'Au coeur du jardin des Tuileries se dresse un lieu magique et original : le Café Renard.\r\nCe restaurant propose une cuisine française traditionnelle (pavé de rumsteack, entrecôte, confit de canard, bavette à l''échalotte, saumon, filet de truite, cabillaud, salades). A l''approche des beaux jours, n''hésitez pas à profiter de la superbe terrasse pour prendre un verre.\r\nLe soir, l''atmosphère se fait plus intime et romantique avec des chandelles sur les tables.', '9.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Cafe-Renard-_Paris_75001', 2899, 2, 1),
(158, 'logo_company.gif', 'Comptoir Du 7e', '39 Avenue de la Motte-Picquet', '', '75007', 'Paris', 1, NULL, 'France', '0145559020', NULL, '', '9.30', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Comptoir-Du-7e_Paris_75007', 2847, 2, 1),
(159, 'logo_company.gif', 'Institut Carole Beauté', '12 rue Pradier', '', '75019', 'Paris', 1, NULL, 'France', '0142025854', NULL, '', '10.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Institut-Carole-Beaute_Paris_75019', 2835, 2, 8),
(160, 'logo_company.gif', 'Salon Tendance Plus', '186, rue Ordoner', '', '75018', 'Paris', 1, NULL, 'France', '0146277249', NULL, '', '9.70', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Salon-Tendance-Plus_Paris_75018', 2834, 2, 19),
(161, 'logo_company.gif', 'Shake\\''M Up', '24 rue de la Folie Méricourt', '', '75011', 'Paris', 1, NULL, 'France', '0143385832', NULL, '', '10.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Shake\\-M-Up_Paris_75011', 4526, 2, 1),
(162, 'logo_company.gif', 'Restaurant Au Moulin Vert', '33 rue du Moulin Vert', '', '75014', 'Paris', 1, NULL, 'France', '0145393131', NULL, 'Alfred de Musset, George Sand ou encore Victor Hugo avaient l’habitude de se retrouver ici, Au Moulin Vert. C’est un véritable îlot de verdure que vous découvrirez en plein cœur du 14ème arrondissement de Paris.\r\n\r\nInstallé sur le site d''un ancien moulin qui fut remplacé par une guinguette en 1848, le restaurant Au Moulin Vert vous reçoit dans un cadre lumineux et verdoyant avec sa grande verrière et sa végétation abondante.\r\nDans l’assiette, le Chef vous servira une cuisine française traditionnelle remise au goût du jour. C’est au marché de Rungis qu’il s’approvisionne en produits frais pour composer des mets qui sauront ravir vos papilles. La carte évolue au fil des saisons, mais les douces saveurs restent.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Restaurant-Au-Moulin-Vert_Paris_75014', 1, 2, 1),
(163, 'logo_company.gif', 'Siam House', '69 boulevard de Vaugirard', '', '75015', 'Paris', 1, NULL, 'France', '0145387282', NULL, 'THAÏ TOUCH – La cuisine thaï a le vent en poupe. Variée et colorée, elle séduit les amateurs de saveurs exotiques. Dans le 15ème, à Paris, à deux pas de Montparnasse, vous découvrirez le restaurant Siam House.\r\n\r\nTHAÏ DESIGN - Meubles aux couleurs acidulées, plantes et larges banquettes : le cadre invite à la détente. Une fusion réussie entre design et déco thaïlandaise traditionnelle. \r\n\r\nTHAÏ CUISINE – Une petite soupe aux fruits de mer pour commencer constituera une belle entrée en matière. Vous poursuivrez vos pérégrinations exotiques avec le poulet au curry vert ou le bœuf panang. Le Chef du Siam House connaît et maîtrise ses recettes et vous invite à découvrir la tradition culinaire de son pays.', '9.60', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Siam-House_Paris_75015', 2878, 2, 1),
(164, 'logo_company.gif', 'Le Patio Provençal', '116 rue des Dames', '', '75017', 'Paris', 1, NULL, 'France', '0142937373', NULL, 'Le Patio Provençal vous accueille depuis 1993 dans son ambiance aux accents du Sud et aux saveurs du Luberon…\r\nLe cadre, une salle où la lumière du jour perce à travers un véritable Patio où se déploient des plantes vertes donne l’impression de manger dans la cour d’un vieux mas provençal alors qu’on n’a pas quitté Paris.\r\n\r\nLes Plats principalement méridionaux chantent bons la Provence et achèvent le dépaysement. Sur la carte, gratin de légumes, pastilla au fromage de chèvre et filet de loup à la sauce vierge, côtoient les plats du jour inspirés tout droit du marché.\r\n\r\nEgalement du Sud une sélection de vins provenant du Luberon, de la vallée des Beaux de Provence ou encore du Var, ainsi qu’une très belle sélection d’apéritifs de Fortcalquier !', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Patio-Provençal_Paris_75017', 1, 2, 1),
(165, 'logo_company.gif', 'Un Air De Famille', '118 rue des Dames', '', '75017', 'Paris', 1, NULL, 'France', '0142933440', NULL, 'Un restaurant qui depuis sa création en 1984 ne désemplit pas... Dans son cadre rétro entre photos 1930 et vieux poêle fin 19ème, vous pourrez apprécier au déjeuner comme au dîner une vraie cuisine familiale et traditionnelle. Tous les produits sont du marché et varient selon les saisons et l''inspiration du moment..\r\n\r\n \r\nVous pourrez aussi découvrir et choisir votre propre bouteille de vin dans une authentique cave voûtée. De même, pour venir fêter un événement particulier le restaurant peut vous accueillir dans différents salons de 8 à 20 personnes...  \r\n\r\n\r\nAlors comme disait Epicure &quot;Hâtez-vous de succomber à la tentation avant qu''elle ne s''éloigne&quot;.  \r\n\r\n\r\nQui mieux que nos clients et nos critiques professionnels peuvent décrire notre restaurant de façon impartiale!', '9.50', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Un-Air-De-Famille_Paris_75017', 3513, 2, 1),
(166, 'logo_company.gif', 'Ongles et Beauté Courcelle', '38 rue de Courcelles', '', '75008', 'Paris', 1, NULL, 'France', '0153969267', NULL, 'Madame, Monsieur,\r\n\r\nVous trouverez en pièce jointe votre facture\r\n\r\nCordialement\r\n\r\nL''équipe Captain Opinion', '9.70', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Ongles-et-Beaute-Courcelle_Paris_75008', 2886, 2, 8),
(167, 'logo_company.gif', 'Willy La Biosthetique', '9 rue de l''Opéra', '', '75001', 'Paris', 1, NULL, 'France', '0142606368', NULL, '« Willy Hairline », c''est l''unique salon de coiffure parisien et de perruques à bénéficier d''une telle expérience professionnelle à Paris… depuis 5 générations maintenant !\r\n\r\nAujourd''hui, « Willy Hairline », c''est un salon de coiffure parisien de 180 M² sur deux étages, dans un nouvel espace beauté agréable et spacieux à deux pas du Louvre. Et c''est aussi une équipe internationale toujours prête à vous satisfaire. Il n''est pas rare d''entendre parler quatre ou cinq langues différentes à la fois.\r\n\r\nNous parlons français – wir sprechen deutsch – parliamo italiano – we speek english – koreen – portugais\r\n\r\nUn Salon pas comme les autres\r\nUn service personnalisé pour elle et lui\r\nNouvelles tendances coiffure et maquillage\r\nDes produits haut gamme de la Biosthetique «  Capillaire, cuirs chevelu, épiderme »\r\nUn espace perruque exclusif', '9.90', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Willy-La-Biosthetique_Paris_75001', 2849, 2, 19),
(168, 'logo_company.gif', 'Tavola Di Gio', '210 Boulevard Raspail', '', '75014', 'Paris', 1, NULL, 'France', '0143354717', NULL, 'Le propriétaire Giovanni, natif des Pouilles, a créé Tavola di Gio en 2008.\r\n\r\nAimant le design, il a voulu un décor épuré et moderne.\r\nPour faire vivre ce lieu, Giovanni s''est entouré d''une jeune équipe italienne.\r\n\r\nMarco, le chef de cuisine, vous fera découvrir une cuisine savoureuse avec\r\nles produits du terroir et inventive par leurs créations. Une cuisine du goût et du cœur !\r\n\r\nGiovanni a voulu faire partager également l''hospitalité, valeur reçue de ses parents bergers\r\nde la région de Martina Franca.\r\n\r\nRoberto, Alessio et Gennaro vous accueillent avec gentillesse pour vous faire vivre \r\ndes moments de plaisir et de convivialité.', '9.50', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Tavola-Di-Gio_Paris_75014', 3010, 2, 1),
(169, 'logo_company.gif', 'Restaurant Le Petit Villiers', '75 avenue de Villiers', '', '75017', 'Paris', 1, NULL, 'France', '0148889659', NULL, 'Découvrez Le Petit Villiers dans un menu au rapport qualité/prix exceptionnel.\r\nNous proposons une cuisine française de tradition préparée à partir de produits frais, entièrement élaborée sur place, le tout dans un cadre champêtre où vous pourrez dîner aux chandelles.\r\n\r\n\r\nNous disposons d''une terrasse chauffée, ouverte toute l''année, dans ce très beau quartier du 17ème arrondissement, proche du métro Wagram.\r\n\r\n\r\nPour vos repas de famille ou de groupe, nous disposons d''une salle pouvant accueillir 20 personnes.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Bar-et-night-club-/Restaurant-Le-Petit-Villiers_Paris_75017', 1, 2, 2),
(170, 'logo_company.gif', 'Accord Deléon', '47 rue de la Voûte', '', '75012', 'Paris', 1, NULL, 'France', '0146288860', NULL, 'L’atelier dédié à votre instrument préféré vous offre toutes les prestations attendues d’un spécialiste passionné aux bons soins de tous vos accordéons.A Paris.\r\nLoin des chimères du bon tarif au coin d’une boutique en ligne,\r\nou l’on achète l’image d’un produit rêvé, trop souvent générateur\r\nde déconvenues …et de frais inutiles et conséquents. Sans garanties aucunes.\r\nNi aucun interlocuteur impliqué et ou responsable !', '10.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Commerces/Accord-Deleon_Paris_75012', 2953, 2, 3),
(171, 'logo_company.gif', 'Ristorante Positano', '9 rue Guisarde', '', '75006', 'Paris', 1, NULL, 'France', '0143269052', NULL, '', '9.10', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Ristorante-Positano_Paris_75006', 3758, 2, 1),
(172, 'logo_company.gif', 'Le Père Fouettard', '9 rue de Pierre Lescot', '', '75001', 'Paris', 1, NULL, 'France', '0142337417', NULL, 'Le Père Fouettard est une brasserie traditionnelle française. Une équipe jeune et dynamique vous accueille 7 jours /7 dans cet établissement au décor chaleureux, rénové en 2011. Vous y dégusterez la cuisine généreuse et maline du Chef Laurent. \r\nService précis et diligent. \r\nLe Père Fouettard dispose d''une grande terrasse couverte et bien chauffée l''hiver, ainsi que de trois salles à l''intérieur indépendantes.\r\nA déguster ici:\r\nCochon de lait au miel, Os à Moelle, Fromages affinés  par Mme Nicole Barthélémy,  Crèpes Suzette,  et des Sourires à Volonté !', '9.40', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Pere-Fouettard_Paris_75001', 3097, 2, 1),
(173, 'logo_company.gif', 'Flottes', '2 rue Cambon', '', '75001', 'Paris', 1, NULL, 'France ', '0142608089', NULL, 'Un Esprit de Famille\r\nFLOTTES, c''est avant tout un esprit de Famille qui participe au bien-être de nos clients. Nous vous invitons à découvrir notre cuisine de Brasserie, généreuse et où la qualité des produits est primordiale à nos yeux. Les Brasseries Flottes sont des lieux où se croisent un public varié en toute simplicité (Familles, hommes d''affaires, touristes ...). L''essence même du mot &quot;Brasserie&quot; qui brasse les individus venant chercher un moment de Convivialité et de Bonheur.\r\n\r\nBelle découverte des Restaurants FLOTTES', '9.70', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Flottes_Paris_75001', 3055, 2, 1),
(174, 'logo_company.gif', 'Ô de Rose ', '20 avenue de Versailles', '', '75016', 'Paris', 1, NULL, 'France', '0140710600', NULL, 'Ô de Rose, l''élégante pâtisserie-salon de thé du 16e\r\nProche du Parc des Princes, Ô de Rose trône au 209 de l''Avenue de Versailles.\r\nMaracaibo, Trinidad, Végas, Vendôme, Elégance... partez à la rencontre des entremets d''exception élaborés par Philippe Parc, Meilleur Ouvrier de France.\r\nSaveurs subtiles, design avant-gardiste, choc audacieux entre le croquant et le moelleux, autant de bonnes surprises que vous réserve la découverte de la gamme Ô de Rose.\r\n\r\nÔ de Rose, chocolatier-confiseur\r\nÔ de Rose vous propose ses créations artisanales: noisettes caramélisées sucrées, noisettes salées, confitures maison, macarons multicolores...)\r\nÔ de Rose a eu l''excellente idée de réunir des produits fins:\r\n- excellent chocolat parvé d''Anvers &quot;My Chocolates&quot; (pièces variées)\r\n- dragées Medicis aux amandes ou au chocolat (galets Gianduja aux amandes grillées, chocolat et pâte de noisette, amandes Quirija à la crème de nougat et chocolat et notamment la ligne dragées 70% de chocolat avec 24 couleurs au choix !)\r\nVous y trouverez également un grand choix de vins haute gamme, des coffrets cadeaux originaux...\r\n\r\nÔ de Rose c''est également:\r\n- le Traiteur haut de gamme pour vos réceptions\r\n- un lieu de restauration agréable tous les midis ou à toute heure de la journée', '10.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Traiteur/o-de-Rose-_Paris_75016', 3002, 2, 22),
(175, 'logo_company.gif', 'Bubble Furry', '362 rue de Vaugirard', '', '75015', 'Paris', 1, NULL, 'France', '0145305582', NULL, '', '10.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Bubble-Furry_Paris_75015', 3771, 24, 1),
(176, 'logo_company.gif', 'FL RESTAURANT', '1 bis rue Augereau', '', '75007', 'Paris', 1, NULL, 'France', '0145510604', NULL, '', '9.90', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/FL-RESTAURANT_Paris_75007', 3796, 2, 1),
(177, 'logo_company.gif', 'FL Traiteur', '133 rue Saint Dominique ', '', '75007', 'Paris', 1, NULL, 'France', '0145557743', NULL, '', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Traiteur/FL-Traiteur_Paris_75007', 1, 2, 22),
(178, 'logo_company.gif', 'Galette Café', '2 rue de l''Université', '', '75007', 'Paris', 1, NULL, 'France', '0142602204', NULL, 'Galette café est un concept de restauration crée en 2012 par A. Bertin, un jeune entrepreneur de Rennes (Bretagne) qui après avoir été diplômé d''un Bac Hôtellerie-Restauration de l''école Hôtelière de Saint-Nazaire et d''une licence en Suisse, a décidé de réinventer la traditionnelle crêperie. Son souhait est de faire connaître la Gastronomie Bretonne en respectant et en valorisant le travail de ses artisans bretons.\r\n\r\nQuatre points essentiels déﬁnissent Galette Café: produits de qualité, un décor séduisant et moderne, une atmosphère conviviale et une équipe chaleureuse. Pour lui il n''est pas suffisant de seulement se contenter de garantir l''origine et la qualité de ses produits; il est aussi important de garantir à ses clients que ses artisans exercent leur métier dignement poussés par la passion aﬁn de préserver des méthodes artisanales.\r\n\r\nDernièrement, il reste persuadé que le plaisir de bien manger passe par la mise en valeur sincère des produits authentiques que ces artisans lui fournissent.', '9.20', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Galette-Cafe_Paris_75007', 4104, 2, 1),
(179, 'logo_company.gif', 'Auberge Du Père Louis', '7 rue de la Boule Rouge', '', '75009', 'Paris', 1, NULL, 'France', '0145231634', NULL, 'Notre Auberge idéalement situé au coeur du quartier hôtelier de Paris. \r\nFace Aux Folies Bergère, proche du Musée Grévin du Grand Rex, des Théâtres de Boulevards, des passages couverts de Paris (Panorama, Verdeaux et Geoffroy) de l’Opéra Garnier et l’hôtel des ventes de Drouot\r\nNotre Auberge  ouverte depuis 1903 vous accueille  tous les jours de 11H00 à 22H00  (Après spectacle uniquement pour les groupes,les comités d’entreprises  et les associations sur réservation). \r\n  Notre restaurant met à votre disposition 180 Places en trois salles sur deux niveaux entièrement climatisées.\r\n          Une salle au RdC de 76 Places dans laquelle vous pouvez admirer la magnifique rôtissoire sur laquelle sont préparées les viandes qui vous seront servies sous le regard des vedettes qui se sont restaurées chez nous.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Auberge-Du-Pere-Louis_Paris_75009', 1, 2, 1),
(180, 'logo_company.gif', 'Chez Paul', '13 Rue de Charonne', '', '75011', 'Paris', 1, NULL, 'France', '0177174542', NULL, 'Nous serons heureux de vous accueillir au 13 rue de Charonne pour vous faire découvrir nos plats les plus typiques de la gastronomie française en plein coeur de Paris. Emplacement idéal et ambiance particulière seront au rendez vous pour que votre repas devienne un moment de détente et de plaisir privilégié.', '9.40', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Chez-Paul_Paris_75011', 3032, 2, 1),
(181, 'logo_company.gif', 'Les Rillettes', '33 rue Navarin', '', '75009', 'Paris', 1, NULL, 'France', '0148740290', NULL, 'CUISINE FRANÇAISE - Bienvenue à la cantine de nos grands-mères ! Le restaurant Les Rillettes propose une carte où les produits du terroir tiennent les premiers rôles. \r\n\r\nGRANDE TABLÉES - Le restaurant Les Rillettes a pris place dans le 9ème arrondissement de Paris, quartier Saint-Georges. Le cadre est élégant, dans les tons de beige et de gris, et est joliment agencé. La salle est organisée en grandes tablées pour toujours plus de convivialité.\r\n\r\nPRODUITS DU TERROIR - Dans l’assiette, vous vous régalerez avec la cuisine française simple et raffinée du Chef. La carte fait la part belle aux produits du terroir. Chou farci, véritable quenelle lyonnaise de brochet ou encore estouffade de bœuf à la Camarguaise… Voici quelques mets à déguster allègrement!', '9.30', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Les-Rillettes_Paris_75009', 3060, 2, 1),
(182, 'logo_company.gif', 'Tesoro D''Italia Paradis', '41 rue du Paradis', '', '75010', 'Paris', 1, NULL, 'France', '0153340069', NULL, '', '8.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Tesoro-D-Italia-Paradis_Paris_75010', 4579, 2, 1),
(183, 'logo_company.gif', 'Tesoro d''Italia Rougemont', '7 Rue Rougemont', '', '75009', 'Paris', 1, NULL, 'France', '0147706311', NULL, '', '9.90', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Tesoro-d-Italia-Rougemont_Paris_75009', 4511, 2, 1),
(184, 'logo_company.gif', 'Tesoro d''Italia Saint-Marcel', '65 boulevard Saint-Marcel', '', '0143311764', 'Paris', 1, NULL, 'France', '0143311764', NULL, '', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Tesoro-d-Italia-Saint-Marcel_Paris_0143311764', 1, 2, 1),
(185, 'logo_company.gif', 'Le gardenia', '49 rue du Paradis', '', '75010', 'Paris', 1, NULL, 'France', '0153340890', NULL, 'Le Gardenia vous accueille en toute convivialité dans le 10e arrondissement de Paris, près du métro Poissonnière. La salle du restaurant vous fera penser à un bistrot parisien : le décor est sobre et convivial.\r\n\r\nLes plats proposés sont d’inspiration italienne avec une grande variété de pâtes à la carte comme les fusille alla sorrentina ou encore les lasagne carne : un délice !\r\n\r\nVoici une bonne adresse au rapport qualité prix indéniable. En famille ou entre amis, venez vite découvrir le Gardenia !', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-gardenia_Paris_75010', 1, 2, 1),
(186, 'logo_company.gif', 'BAR DU MARCHE DES BLANCS MANTEAUX', '53, rue Vieille du Temple', '', '75004', 'Paris', 1, NULL, 'France', '0142711414', NULL, '', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/BAR-DU-MARCHE-DES-BLANCS-MANTEAUX_Paris_75004', 1, 2, 1),
(187, 'logo_company.gif', 'RESTAURANT INDOCHINE', '38 rue du Mont Thabor', '', '75001', 'Paris', 1, NULL, 'France', '0142607979', NULL, 'INDOCHINE - Envie d’illuminer vos papilles par de nouvelles saveurs ? C’est au restaurant Au Coin des Gourmets que vous assouvirez vos désirs. Idéalement situé à deux pas de la place Vendôme et du jardin des Tuileries, ce restaurant traditionnel est venu tout droit d’Indochine pour vous offrir une escapade culinaire inoubliable.\r\n\r\nCUISINE VIETNAMIENNE - Surpris par ses noms, vous serez tout autant étonné par leur goût ! Bo bun, une soupe piquante aux nouilles de riz et au bœuf, Banh coun, une crêpe garnie de viande de porc et de champignons noirs… tant de mets qui ne pourront pas vous laissez indifférents !\r\n\r\nORIGINALITÉ – Le Chef du Coin des Gourmets, un grand passionné des vins français, sera à votre disposition pour vous conseiller le vin le plus approprié à votre dégustation.', '9.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/RESTAURANT-INDOCHINE_Paris_75001', 4700, 2, 1),
(188, 'logo_company.gif', 'Intuition Gourmande', '4 rue Petel', '', '75015', 'Paris', 1, NULL, 'France', '0145325876', NULL, 'Situé en plein cœur du 15ème arrondissement, dans un quartier calme à l’esprit « Village », le restaurant possède un vrai cachet « bistrot parisien » avec un décor cosy.\r\n\r\nD’accès facile (parking et métro à proximité), placé entre les rues Vaugirard et Lecourbe, proche du square Saint-Lambert et du quartier de la Convention, il conviendra parfaitement aux repas d’affaires comme aux sorties en famille ou entre amis.\r\n\r\nPetite astuce : laissez-vous tenter par un verre en terrasse avec vue sur la Tour Eiffel.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Intuition-Gourmande_Paris_75015', 1, 2, 1),
(189, 'logo_company.gif', 'Perla Coiffure', '86 avenue Saint-Mendé', '', '75012', 'Paris', 1, NULL, 'France', '0144879288', NULL, '', '9.90', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Perla-Coiffure_Paris_75012', 3096, 2, 19),
(190, 'logo_company.gif', 'Pizza Di Gio', '48 rue du Cherche-midi', '', '75006', 'Paris', 1, NULL, 'France', '0145481008', NULL, '', '9.90', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Pizza-Di-Gio_Paris_75006', 3637, 2, 1),
(191, 'logo_company.gif', 'Planet Coiffure Beauté', '14 Boulevard Beaumarchais', '', '75011', 'Paris', 1, NULL, 'France', '0143380938', NULL, 'Dimitri et son équipe sont heureux de vous accueillir dans leur espace &quot;PLANETE COIFFURE BEAUTE&quot;.\r\n\r\nLe concept du salon s''appuie sur 3 éléments primordiaux :\r\n- L''accueil et l''attention du client\r\n- Coiffer tous types de cheveux\r\n- Le conseil\r\n\r\nNotre accueil : En effet, l''une des choses importantes, c''est de pouvoir vous détendre, ainsi que vous faire plaisir. C''est pour cela que, dès votre entrée au salon, l''accueil que nous vous réservons est une chose primordiale. Ces bonnes conditions sont propissent au dialogue, afin de vous permettre de vous exprimer afin de remédier ensemble à tous problèmes rencontrés dans votre coiffure. En effet, un diagnostic bien réalisé est déjà une réussite. \r\n\r\nLa coiffure : Le deuxième élément primordial est de pouvoir coiffer tous types de cheveux, qu''il soit européen, méditerranéen, afro ; et de ne pas associer une technique à un type de cheveux. \r\n\r\nLe conseil : Nous ne sommes pas là uniquement pour vous écouter sur ce qui ne vous convient pas, mais aussi pour vous conseiller sur divers styles. Non seulement par le visagisme, mais aussi par rapport à votre personnalité. Car pour nous c''est bien plus qu''un service, elle fait partie de votre beauté, de votre bien être ainsi que de votre caractère.', '9.70', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Planet-Coiffure-Beaute_Paris_75011', 3204, 2, 19),
