(193, 'logo_company.gif', 'Société ATS', '38 rue Beaujon', '', '75008', 'Paris', 1, NULL, 'France', '0145742377', NULL, 'Entreprise artisanale. Prestations de services dans le domaine des technologies du bâtiment. Spécialisée dans les automatismes divers en fourniture et pose + contrat. Systèmes d''alarmes toutes marques et fumigène (diffuseur de brouillard opacifiant). Et l''électricité générale.', '9.30', '100', 1, 1, 1, 1, 1, 1, 1, 'Services/Societe-ATS_Paris_75008', 3247, 2, 6),
