(197, 'logo_company.gif', 'Ozio', '29 bis rue Saint-Didier', '', '75016', 'Paris', 1, NULL, 'France', '0147272070', NULL, 'Ozio vous accueil dans une ambiance élegante et décontracté, avec une grande terrasse été / hiver. Ideal pour vos repas d affaires entre amis ou en tete a tete, vous y dégustez une cuisine italienne travaillée avec des produits frais de saison.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Ozio_Paris_75016', 1, 2, 1),
(198, 'logo_company.gif', 'Restaurant Le Galion', '10 allée du bord de l''eau', '', '75016', 'Paris', 1, NULL, 'France', '0144142000', NULL, 'Galion de style XVème siècle - 3 mâts - 170 pieds (50 mètres)\r\nAmarré dans le bois de Boulogne, face à l''hippodrome de Longchamp.\r\nRécemment restauré, sa décoration toute en boiserie lui confère une ambiance chaleureuse.\r\nLa modularité de ses salles, ainsi que son immense pont terrasse en font un espace idéal de réception.\r\nLe Galion allie une restauration de qualité dans un cadre original.\r\nLe cadre comme la cuisine du Galion promettent un moment aussi savoureux que hors du commun. - Parking à proximité-\r\n\r\nLes salles \r\nElles se répartissent en un pont principal de 340 m², un pont inférieur de 120 m², et un pont terrasse de 350 m². Modulables et éclairées à la lumière du jour. Lumineuses, avec vue sur la seine ou le bois de Boulogne.\r\n\r\nRestauration \r\nLe Galion symbolise l''invitation au voyage et la découverte d''horizons lointains. Dans cet esprit, le chef a élaboré des propositions de menu, de buffet et de cocktail sur des thèmes tels que la Méditerranée, les Caraïbes, la mer du nord, sans pour autant renier la cuisine Française traditionnelle. \r\n\r\nSpécificités\r\nTout à bord à été pensé et conçu pour que chaque réception soit une réussite et laisse à vos invités un souvenir inoubliable ; originalité de la restauration, qualité du service, concept, décors et ambiance unique à Paris, possibilité de prestations à l''extérieur sur le pont terrasse. Sans limitation d''horaire, parking à proximité', '9.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Restaurant-Le-Galion_Paris_75016', 3283, 2, 1),
(199, 'logo_company.gif', 'Le Bistro d''à Côté Flaubert', '10 rue Gustave Flaubert', '', '75017', 'Paris', 1, NULL, 'France', '0142670581', NULL, 'Le Flaubert propose une cuisine de terroir et de qualité, inspirée des régions lyonnaises, de Savoie et de Provence, chères à Michel Rostang qui mêle des plats traditionnels et des créations aux saveurs plus atypiques: la Crème de Potimarron, poitrine de cochon rôtie, noisette torréfiée; la Volaille de Bresse « Miéral » rôtie entière en crapaudine; les Filets de Rougets masqués de tapenade, risetto au chorizo et piquillos; ou les petits pots de crème au chocolat à l’ancienne.', '8.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Bistro-d-a-Cote-Flaubert_Paris_75017', 3975, 2, 1),
(200, 'logo_company.gif', 'Dessirier', '9 place du Maréchal Juin', '', '75017', 'Paris', 1, NULL, 'France', '0142278214', NULL, 'Sur la place du Maréchal-Juin (ex-place Pereire), on trouve l’un des fameux restaurants créés et dirigés par Michel Rostang, celui-ci conçu dans l’esprit d’une « brasserie de la mer ». Un banc de fruits de mer à l''extérieur met l''eau à la bouche, et à l''intérieur on se régale de poissons nobles : le bar, le Saint-Pierre, le turbot...', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Dessirier_Paris_75017', 1, 2, 1),
(201, 'logo_company.gif', 'L''Absinthe', '24 place du Marché Saint-Honoré', '', '75001', 'Paris', 1, NULL, 'France', '0149269004', NULL, 'Tenu par la fille du célèbre Michel Rostang, l''Absinthe est un bistrot chaleureux, moderne et confortable (terrasse chauffée) situé dans une oasis de calme au cœur du quartier de l''Opéra. Caroline Rostang a choisi l''audace culinaire : ravioles de Romans aux langoustines, onglet de veau rôti et petites échalotes confites et, bien entendu, petits pots au chocolat selon une recette de papa.', '10.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/L-Absinthe_Paris_75001', 4692, 2, 1),
(202, 'logo_company.gif', 'L''Ilot Vache', '35 rue Saint Louis en l''Ile', '', '75004', 'Paris', 1, NULL, 'France', '0146335516', NULL, 'ESPRIT TERROIR - Une virée campagnarde et charmante au cœur de Paris ça vous dit ? Dans cette ravissante auberge fleurie aux poutres apparentes qu’est L’Ilot Vache, on savoure des petits plats traditionnels et authentiques en rêvant à l’Ile Saint-Louis. Un véritable bain de romantisme dans le 4ème arrondissement !\r\n\r\nPLATS RETRO - A l’affiche de cette table à l’esprit rural, des assiettes gourmandes : feuilleté de roquefort ou filet de bœuf aux trois sauces, magret de canard aux framboises ou homard grillé flambé au Cognac. Les amateurs de délices sucrés se laisseront tenter par une mousse aux deux chocolats ou du pain perdu sauce caramel…\r\n\r\nCHALEUREUX - En groupe ou pour un événement privé, voilà une table à tester !', '9.40', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/L-Ilot-Vache_Paris_75004', 3328, 2, 1),
(203, 'logo_company.gif', 'Michel Rostang Restaurant', ' 20 rue Rennequin', '', '75017', 'Paris', 1, NULL, 'France', '0147634077', NULL, 'Michel Rostang est indéniablement l’une des meilleures tables de la capitale. Marie-Claude Rostang, qui collectionne les beaux objets, a créé quatre salles &quot;thématiques&quot; : Art Contemporain, Art Nouveau, Lalique et Robj.\r\n\r\nFormé chez les plus Grands, de Lucas Carton à Lasserre, Michel Rostang a très vite proposé une cuisine simple et généreuse en quête de perfection. Découvrez ainsi la sole meunière avec sa marinière de coquillages ou la mythique quenelle de brochet façon Jo Rostang.\r\n\r\nEnfin la cave avec plus de 1300 crus est probablement l’une des plus belles de la capitale.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Michel-Rostang-Restaurant_Paris_75017', 1, 2, 1),
(204, 'logo_company.gif', 'Paris-Coiffure', '85 rue du Mont Cenis', '', '75018', 'Paris', 1, NULL, 'France', '0142648924', NULL, '', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Paris-Coiffure_Paris_75018', 1, 2, 19),
(205, 'logo_company.gif', 'Kok Ping', '4 rue de Balzac', '', '75008', 'Paris', 1, NULL, 'France', '0142252885', NULL, 'Situé à deux pas des Champs Elysées votre restaurant Kok Ping vous invite à venir déguster ses spécialités Thaï et Chinoises. Le restaurant Kok Ping, installé depuis 1985, vous reçoit avec le sourire de la Thaïlande et les saveurs exotiques chinoises. Les deux chefs cuisiniers vous préparent une palette de mets savoureux chinois et thaïlandais. Découvrez toute l''originalité de la cuisine thaïlandaise ou chinoise à travers ses savoureuses spécialités, canard laqué, poisson vapeur. Notre service de livraison à domicile gratuit vous permet aussi de vous savourer une cuisine d''ailleurs en toute tranquillité.\r\nUn brunch vous attend tous les dimanches midi.\r\nVenez faire plaisir à votre palet ! Nous vous accueillons le lundi, mardi, mercredi, jeudi, vendredi et dimanche de 12h à 15h et de 19h à 23h30 et le samedi de 19h à 23h30.', '9.50', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Kok-Ping_Paris_75008', 3764, 2, 1),
(206, 'logo_company.gif', 'Cyber Cube', '9 rue d''Odessa', '', '75014', 'Paris', 1, NULL, 'Paris', 'France', NULL, '', '10.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Cyber-Cube_Paris_75014', 3357, 2, 1),
(207, 'logo_company.gif', 'Le Patio Provençal', '116 rue des Dames', '', '75017', 'Paris', 1, NULL, 'France', '0144937373', NULL, 'Le Patio Provençal vous accueille depuis 1993 dans son ambiance aux accents du Sud et aux saveurs du Luberon…\r\n\r\n\r\nLe cadre, une salle où la lumière du jour perce à travers un véritable Patio où se déploient des plantes vertes donne l’impression de manger dans la cour d’un vieux mas provençal alors qu’on n’a pas quitté Paris.\r\n\r\nLes Plats principalement méridionaux chantent bons la Provence et achèvent le dépaysement. Sur la carte, gratin de légumes, pastilla au fromage de chèvre et filet de loup à la sauce vierge, côtoient les plats du jour inspirés tout droit du marché.\r\n\r\nEgalement du Sud une sélection de vins provenant du Luberon, de la vallée des Beaux de Provence ou encore du Var, ainsi qu’une très belle sélection d’apéritifs de Fortcalquier !\r\n\r\nToute l’équipe du Patio Provençal est heureuse de vous accueillir du lundi au samedi, le midi de 12h à 14h30 et le soir de 19h à 23h.\r\n\r\nNous vous conseillons vivement de réserver votre table et souhaitons avoir le plaisir de vous accueillir prochainement.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Patio-Provençal_Paris_75017', 1, 2, 1),
(208, 'logo_company.gif', 'Le Patio Provencal', '116 rue des Dames', '', '75017', 'Paris', 1, NULL, 'France', '0142937373', NULL, 'Le Patio Provençal vous accueille depuis 1993 dans son ambiance aux accents du Sud et aux saveurs du Luberon…\r\n\r\n\r\nLe cadre, une salle où la lumière du jour perce à travers un véritable Patio où se déploient des plantes vertes donne l’impression de manger dans la cour d’un vieux mas provençal alors qu’on n’a pas quitté Paris.\r\n\r\nLes Plats principalement méridionaux chantent bons la Provence et achèvent le dépaysement. Sur la carte, gratin de légumes, pastilla au fromage de chèvre et filet de loup à la sauce vierge, côtoient les plats du jour inspirés tout droit du marché.\r\n\r\nEgalement du Sud une sélection de vins provenant du Luberon, de la vallée des Beaux de Provence ou encore du Var, ainsi qu’une très belle sélection d’apéritifs de Fortcalquier !\r\n\r\nToute l’équipe du Patio Provençal est heureuse de vous accueillir du lundi au samedi, le midi de 12h à 14h30 et le soir de 19h à 23h.\r\n\r\nNous vous conseillons vivement de réserver votre table et souhaitons avoir le plaisir de vous accueillir prochainement.\r\n', '9.10', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Patio-Provencal_Paris_75017', 4296, 2, 1),
(209, 'logo_company.gif', 'Le Pharaon', '21 rue Auber', '', '75009', 'Paris', 1, NULL, 'France', '0147423085', NULL, '', '9.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Pharaon_Paris_75009', 3780, 2, 1),
(210, 'logo_company.gif', 'L''Etoile Marocaine', '56 rue Galilée', '', '75008', 'Paris', 1, NULL, 'France', '0147205445', NULL, 'A deux pas des Champs-Élysées, un astre émoustille les papilles des amateurs de la restauration marocaine.\r\n\r\n      Par sa réception soignée , vous y dégusterez une pléiade de mets ,couscous dont la semoule est roulée à la main, la fameuse pastilla, le savoureux méchoui d’agneau, toutes une variété de tajines, la cuisine marocaine par excellence.\r\n\r\n      Des menus sont spécialement dédiés aux repas d''affaires  ou à la   privatisation.', '9.10', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/L-Etoile-Marocaine_Paris_75008', 3394, 2, 1),
(211, 'logo_company.gif', 'L''Acropole', '3 rue de l''école de Médecine', '', '75006', 'Paris', 1, NULL, 'Paris', 'France', NULL, 'Situé juste en face de l''école de médecine, dans le 6ème arrondissement de Paris, le restaurant L''Acropole sert une cuisine grecque de qualité que les nombreux habitués aiment à retrouver depuis des années. \r\n\r\nLe temps d''un repas, vous apprécierez toute l''ambiance de la Grèce, sa convivialité et sa générosité. \r\n\r\nOuvert tous les jours, tenu par le même couple, pensez à réserver votre table pour profiter de ces spécialités !', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/L-Acropole_Paris_75006', 1, 2, 1);
