(212, 'logo_company.gif', 'Taokan', '8 rue du Sabot', '', '75006', 'Paris', 1, NULL, 'France', '0142841836', NULL, 'C’est au coeur de Saint Germain des Prés que tout commence…\r\n\r\nEn lieu et place de l’un des premiers restaurant asiatiques de Paris, au 8 de la rue du Sabot, s’écrit une nouvelle histoire… Celle de TaoKan, lieu où l’on honore la tradition de la gastronomie chinoise contemporaine tout en y proposant une vision nouvelle, celle d’une « cantine » haut de gamme qui réinvente les codes.\r\n\r\nLa carte offre un panorama inventif et raffiné dans lequel nombre de régions et de styles sont représentés et mettant à l’honneur les fameux Dim Sum faits maison, nouvelles stars cantonaises à la vapeur; dans un décor harmonieux d’ombres et de lumières signé par les architectes Hélène et Olivier Lempereur.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Taokan_Paris_75006', 1, 2, 1),
(213, 'logo_company.gif', 'Al Dente', '38 rue de Varenne', '', '75007', 'Paris', 1, NULL, 'France', '0145487964', NULL, 'A 2 pas du Bon Marché, du très vivant quartier Sèvres Babylone / St Germain des près et des ministères, se trouve cette séduisante et élégante trattoria contemporaine.\r\nA l’origine d’Al Dente, une idée simple : « proposer, enfin à Paris, dans un même lieu, une cuisine italienne de grande qualité, mais aussi de délicieuses pizzas fines et croustillantes », le tout orchestré par un talentueux chef  originaire du sud de l’Italie, « la seule garantie, trop rare à Paris, d’une cuisine italienne vraie » selon Sylvain Lindon et Marie, les propriétaires français d’Al Dente.\r\nUne règle aussi : le goût avant tout et le respect des traditions (« les pâtes constituent un plat à part entière et non pas un accompagnement comme en France ») pour proposer une carte à l’italienne, antipasti, primo piatto (les pâtes), secondo (viandes et poissons) et un choix sélectif de produits authentiques et de grande qualité au fil des saisons, « autre garantie d’une assiette italienne savoureuse et généreuse ».\r\nEnfin, une obsession pour les patrons d’Al Dente : satisfaire les clients en étant sans cesse attentifs à leurs besoins. « Ayant été longtemps clients avant de faire nous-mêmes ce métier, nous avons voulu créer le restaurant dans lequel nous aurions envie d’aller ».\r\nPari gagné après 5 ans d’existence puisque ici, la clientèle est constituée à 80% d’habitués.\r\nEt si vous voulez vous attabler à côté de touristes sortant du musée Rodin, d’une fashion victime entre 2 boutiques, d’un haut fonctionnaire ou conseiller du premier ministre, d’une famille du quartier ou d’une personne célèbre, on vous conseillera de réserver, le restaurant ne disposant que de 50 places.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Al-Dente_Paris_75007', 1, 2, 1),
(214, 'logo_company.gif', 'La Belle Vue', '41 boulevard Pasteur', '', '75015', 'Paris', 1, NULL, 'France', '0145689981', NULL, '', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Opticien/La-Belle-Vue_Paris_75015', 1, 2, 23),
(215, 'logo_company.gif', 'Le Zaccar', '12 Rue Bobillot', '', '75013', 'Paris', 1, NULL, 'France', '0145806663', NULL, 'A deux pas de la place d\\''Italie, dans le 13ème arrondissement de Paris, le restaurant Le Zaccar vous propose des spécialités du Nord de l\\''Afrique comme les couscous et tajines et autres grillades. \r\n\r\nLe budget moyen est de moins de 30€ sans les boissons ce qui en fait un bon rapport qualité/prix. Dans une bonne ambiance, vous apprécierez le service chaleureux et efficace. \r\nUne adresse où la réservation est conseillée.	\r\n\r\n \r\nLe restaurant Le Zaccar existe depuis plus de 25 ans et c\\''est toujours avec le sourire que vous êtes accueillis depuis toutes ces années.\r\n\r\nLa salle n\\''est pas très grande, d\\''où l\\''intérêt de réserver avant de venir, si vous êtes en groupe. Côté déco, c\\''est joli et typique avec des lampes, des tapis et des costumes d\\''Algérie.\r\n\r\nLe menu conseillé par la maison est à 15,50€ (entrée, plat garni, dessert ou café avec 4/5 choix par type de plat).\r\n\r\nLes amateurs de couscous seront fous de la semoule maison, fine et délicieuse.\r\n\r\nLe thé vert à la menthe, délicieux et pas trop sucré, est servi comme de coutume et avec le sourire. \r\n\r\nCe restaurant propose également des tajines, grillades, poissons, paella maison, amekfoul... et du couscous à emporter !', '9.20', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Zaccar_Paris_75013', 3759, 2, 1),
(216, 'logo_company.gif', 'La Charrette Créole', '15 rue Jules Chaplain', '', '75006', 'Paris', 1, NULL, 'France', '0143260310', NULL, 'Faites escale à la Charette Créole et venez découvrir la magie des ambiances créoles aux rythmes chaloupés...\r\n\r\nSylvain vous y attend avec toute son équipe pour faire partager sa passion des îles dans de longues soirées festives.\r\n\r\nVous dégusterez les spécialités de l''Océan Indien dans une ambiance détendue et conviviale tout en sirotant un bon rhum arrangé.\r\n\r\nSoyez les bienvenus à la Charette Créole !', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/La-Charrette-Creole_Paris_75006', 1, 2, 1),
(217, 'logo_company.gif', 'Farida B', '1 Rue Saint Sabin', '', '75011', 'Paris', 1, NULL, 'France', '0144889296', NULL, '', '8.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Farida-B_Paris_75011', 3574, 2, 19),
(218, 'logo_company.gif', 'Le Café de L''Epoque', '2 rue Bouloi', '', '75001', 'Paris', 1, NULL, 'France', '0142334070', NULL, '', '9.30', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Cafe-de-L-Epoque_Paris_75001', 3728, 2, 1),
(219, 'logo_company.gif', 'Joffo', '102 rue Saint-Lazare', '', '75009', 'Paris', 1, NULL, 'France', '0972992666', NULL, 'Coiffeur pour dame, coloriste MATRIX, esthéticienne,\r\ncoiffeur pour homme et barbier traditionnel', '9.60', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Joffo_Paris_75009', 3662, 2, 19),
(220, 'logo_company.gif', 'Mollard', '115 rue Saint-Lazare', '', '75008', 'Paris', 1, NULL, 'France', '0143875022', NULL, 'Au fil du temps, la Brasserie Mollard est devenu un lieu de légende à Paris. Datant de 1895, le bâtiment est désormais classé monument historique. L’essentiel du décor est d’origine. \r\n\r\nLes magnifiques fresques et mosaïques ainsi que les colonnes en font un cadre majestueux pour un repas tout aussi luxueux. Vous dégusterez poissons et crustacés et pourrez savourer du homard provenant du vivier du restaurant.\r\n\r\nUn décor unique pour un repas d''exception.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Mollard_Paris_75008', 1, 2, 1),
(221, 'logo_company.gif', 'Le Brandevin', '29-35 rue du Docteur Blanche', '', '75016', 'Paris', 1, NULL, 'France', '0142241933', NULL, 'Manger au Brandevin, dans ce sympathique bistrot parisien au coeur du 16ème arrondissement, c''est la certitude de passer un moment convivial et gourmand. Les plats du Brandevin sont servis avec générosité, à partir de produits rigoureusement sélectionnés sur le marché de Rungis. Ajoutez à cela la belle carte des vins du Brandevin, un service chaleureux et vous avez toutes les raisons de venir l''essayer.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Brandevin_Paris_75016', 1, 2, 1),
(222, 'logo_company.gif', 'Hôtel Opéra Saint Georges', '7 rue Navarin', '', '75009', 'Paris', 1, NULL, 'France', '0148785173', NULL, '', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Hotels-et-vacances/Hotel-Opera-Saint-Georges_Paris_75009', 1, 2, 4),
(223, 'logo_company.gif', 'Camarade Boris', '90 Quai de La Loire', '', '75019', 'Paris', 1, NULL, 'France', '0142023394', NULL, 'ODE A KARL MARX – Le concept est audacieux : faire revivre avec humour de grands personnages et de grands moments du communisme à travers un parcours culinaire. Vous n’aviez jamais goûté le filet de canette rôti à la Gorbatchev ? Et la Tarte Viet Cong ? \r\n\r\nRÉALISME SOVIÉTIQUE – Le grand espace a été minutieusement décoré dans un style purement industriel avec meubles de métier, chaises des années 50 en fer et luminaires de manufactures. On se croirait revenus au temps où l’Internationale galvanisait la classe ouvrière. \r\n\r\nBRUNCH CAPITAL – La révolution est en marche : le brunch roboratif et revigorant vous donnera du cœur à l’ouvrage tandis que la vue sur le canal de l’Ourcq vous fera rêver de lendemains prometteurs.', '9.10', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Camarade-Boris_Paris_75019', 4627, 2, 1),
(224, 'logo_company.gif', 'Le Picotin', '35 rue Sibuet', '', '75012', 'Paris', 1, NULL, 'France', '0146289900', NULL, 'Le Picotin vous attend dans le 12e arrondissement, non loin de la place de la Nation. Il vous accueille dans un cadre convivial et une ambiance typique de bistrot.\r\n\r\nOn vous concoctera une cuisine traditionnelle avec quelques touches d’originalité comme la lotte en écaille de chorizo. La carte propose les grands classiques comme la souris d’agneau ou la côte de bœuf.\r\n\r\nLa décoration est simple et chaleureuse : tables en bois, serviettes à carreaux rouges et blancs, ardoises et petits ballons de rouge.', '10.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Picotin_Paris_75012', 4849, 2, 1),
(225, 'logo_company.gif', 'Au Bistrot Du Passage', '14 passage Geoffroy Diderot', '', '75017', 'Paris', 1, NULL, 'France', '0143872810', NULL, '', '8.90', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Au-Bistrot-Du-Passage_Paris_75017', 4440, 2, 1),
(226, 'logo_company.gif', 'L''Etoile Du Kashmir', '63 rue de Charonne', '', '75011', 'Paris', 1, NULL, 'France', '0143555760', NULL, 'Profitant d’un emplacement central, rue de Charonne, L''Etoile du Kashmir vous promet une authentique escapade au pays de Gandhi. Son décor traditionnel au tons colorés et ses objets d’artisanat accrochés aux murs en font un lieu à l’ambiance feutrée et chaleureuse. \r\n\r\nVous pourrez savourer l’ensemble des spécialités de la cuisine indienne traditionnelle : des plats fins et savoureux pour un véritable voyage culinaire. Ici, tout est fait maison et succulent. Tandoori, biryani, samosas ou plats végétariens, il y a de quoi satisfaire les papilles de tous les gourmets !\r\n\r\nUne adresse qui vous transportera dans un univers aux senteurs subtiles, à découvrir au plus vite !', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/L-Etoile-Du-Kashmir_Paris_75011', 1, 2, 1),
(227, 'logo_company.gif', 'Café Zadig', '164 avenue Ledru Rollin', '', '75011', 'Paris', 1, NULL, 'France', '0143727947', NULL, 'Le Café Zadig vous propose une cuisine traditionnelle à l’ardoise, faite à partir de produits de saison.', '9.40', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Cafe-Zadig_Paris_75011', 3757, 2, 1),
(228, 'logo_company.gif', 'Le Diamant Rose', '161 boulevard du Montparnasse', '', '75006', 'Paris', 1, NULL, 'France', '0143545615', NULL, '', '10.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Diamant-Rose_Paris_75006', 4291, 2, 1),
(229, 'logo_company.gif', 'Le Diamant Rose', '161 boulevard du Montparnasse', '', '75006', 'Paris', 1, NULL, 'France', '0143545615', NULL, '', '10.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Diamant-Rose_Paris_75006', 3763, 2, 1),
(230, 'logo_company.gif', 'Le Mesturet', '77 rue de Richelieu', '', '75002', 'Paris', 1, NULL, 'France', '0142974068', NULL, 'Le restaurant &quot;Le Mesturet&quot; est un classique des bistrots parisiens, situé au coeur de Paris entre les Grands Boulevards et le Musée du Louvre. Notre cuisine traditionnelle française est élaborée avec passion et créativité par deux professionnels de la restauration: Alain Fontaine, propriétaire, et son chef Pascal Brot. Accompagnés d''une équipe dynamique en salle et en cuisine, ils créent une table de qualité où il est bon de s''attarder le midi et le soir.\r\n\r\nNos plats typiques de la cuisine française, nos délicieux desserts maison, notre carte des vins faite de découvertes, l''ambiance &quot;bistrot&quot; du Mesturet, ne vous laisseront pas indifférents.\r\n\r\nNotre salle de 86 couverts, climatisée, au décor chaleureux &quot;vieux Paris&quot; et  notre salon de 30 couverts, permettent également de réaliser des repas de groupe, des anniversaires et tout autre événement.\r\n \r\n\r\nSoyez les bienvenus !', '9.70', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Mesturet_Paris_75002', 3783, 2, 1),
(231, 'logo_company.gif', 'Au Moulin Vert', '34 bis rue des Plantes', '', '75014', 'Paris', 1, NULL, 'France', '0145393131', NULL, '\r\nA deux pas de Montparnasse, au seuil d''un quartier authentiquement parisien, le Moulin Vert vous reçoit toute l''année, 7 jours sur 7.\r\n Le restaurant, installé sur le site d''une auberge célèbre au XIXe siècle pour sa bonne chère et sa joie de vivre, propose une cuisine authentique variée, préparée exclusivement avec des produits frais d''origine certifiée, récompensée par le titre &quot; Maître Restaurateur &quot;.\r\n\r\n\r\nSalle à manger spacieuse bordée de terrasses verrières arborées au rez-de-chaussée, salons privatisables au premier étage : le Moulin Vert est un restaurant où l''on se sent bien, dans lequel la cuisine de qualité et l''accueil chaleureux donnent envie de revenir.', '9.30', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Au-Moulin-Vert_Paris_75014', 3840, 2, 1),
(232, 'logo_company.gif', 'Aux Produits Du sud Ouest', '21-23 rue d''Odessa', '', '75014', 'Paris', 1, NULL, 'France', '0143203407', NULL, 'Vous fondrez de plaisir en dégustant confits de canard maison, cassoulets, croustades aux pommes... ainsi que l''incontournable foie gras de canard mi-cuit au choix à la carte ou en menu.\r\n', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Aux-Produits-Du-sud-Ouest_Paris_75014', 1, 2, 1),
(233, 'logo_company.gif', 'Le Petit chablisien', '44 Rue de Londres', '', '75008', 'Paris', 1, NULL, 'France', '0153874615', NULL, 'Esprit bistrot 8ème – C’est à deux pas de Saint-Lazare et des grands magasins, dans l’élégant 8ème arrondissement parisien, que vous trouverez l’épicurien bistrot Le Petit Chablisien. Une situation idéale, un cadre cosy et épuré dans les tons noir et orangé, ce bistrot a vraiment tout pour lui.\r\n\r\n Fraîche et joyeuse - La cuisine du Chef, à base de produits frais, s’adapte en fonction des saisons et se pare à chaque fois de nouvelles saveurs. Saint-Jacques ou caille rôtie, foie gras ou filet de bar et enfin moelleux ou financier… Du salé au sucré, vos papilles seront en fête.\r\n\r\n Disciple d’Épicure – Le Petit Chablisien ravira les amateurs de vins de Bourgogne et de Côte du Rhône grâce à une carte de vins sélectionnée avec soin et expérience. Demandez conseil au Chef au moment de choisir vos plats pour réussir les associations les plus savoureuses. ', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Petit-chablisien_Paris_75008', 1, 2, 1),
(234, 'logo_company.gif', 'Le Café Des Initiés', '3 Place des Deux Ecus', '', '75001', 'Paris', 1, NULL, 'France', '0142337829', NULL, '\r\n\r\n\r\nSitué à deux pas du métro Louvre-Rivoli et de la ligne 1, le Café des initiés est un bar restaurant sympa d’une capacité de 120 places. C’est le lieu idéal pour prendre un verre entre amis ou pour se restaurer : le service est continu de 10h à 0h30 tous les jours. \r\n\r\nL’équipe est accueillante, la clientèle est branchée - mannequins, personnalités, aimant se faire plaisir. ', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Cafe-Des-Inities_Paris_75001', 1, 2, 1),
(235, 'logo_company.gif', 'Optique Du Dôme', '31 avenue Victor Hugo', '', '75116', 'Paris', 1, NULL, 'France', '0145017818', NULL, '', '10.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Opticien/Optique-Du-Dome_Paris_75116', 4324, 2, 23),
(236, 'logo_company.gif', 'Le Lotus de Jade Maubeuge', '15 Rue de Maubeuge', '', '75009', 'Paris', 1, NULL, 'France', '0148743275', NULL, 'Evacuez votre stress du quotidien, oubliez vos douleurs et courbatures et laissez nous vous relaxer avec nos massages traditionnels détendants.\r\n\r\nAvec ses soins du corps relaxants et divers massages asiatiques traditionnels, Lotus de jade vous invite à plonger dans un univers de bien être, un environnement unique où tous les sens sont en éveil.\r\n\r\nPour retrouver votre fraicheur et vitalité rien ne vaut un bon massage de la main d’un expert, Lotus de Jade a réuni pour vous, au cœur de Paris, la crème des traditions orientales, des massages, chacun ayant ses propres qualités et ses propres bienfaits, mais tous se réunissent pour la même fin : votre bien-être. \r\n\r\nRedécouvrez les massages et soins du corps avec Lotus de Jade, nous vous proposons des massages traditionnels (massage indien, thaï, chinois, japonais), originaux (massage aux pierres chaudes, massage express, massage à quatre mains) et aussi des massages thérapeutiques pour combattre la cellulite.\r\n\r\nNotre équipe de professionnels est à votre service pour vous écouter, savoir ce dont vous avez besoin et vous prodiguer les soins parfaitement adéquats à votre situation. \r\n\r\nOffrez vous un moment de détente et de bien-être avec les massages et soins du corps de Lotus de Jade.', '8.70', '100', 1, 1, 1, 1, 1, 1, 1, 'Salon-de-beaute-et-spas/Le-Lotus-de-Jade-Maubeuge_Paris_75009', 4373, 2, 8),
(237, 'logo_company.gif', 'Phyl Coiffure', '171 Rue Lafayette', '', '75010', 'Paris', 1, NULL, 'France', '0140351245', NULL, 'Originalité et authenticité\r\n\r\nDans ce monde moderne où la spécialité rime avec efficacité, rien ne doit être laisser au hasard. Venez découvrir nos talents, nos savoir-faire, le résultat de nos années de recherche.\r\n\r\nDans ce métier en pleine essor, notre but est de vous SERVIR, de vous faire PROFITER de notre créativité, de vous EMBELLIR afin de créer une métamorphose de votre PHYSIONOMIE aussi bien dans le cadre de votre CHEVELURE que de l’ensemble de votre CORPS.\r\n\r\nSalon spacieux, bien localisé, hygiénique, chaleureux, accueillant\r\noù tous vos désirs seront réalisés.', '9.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Phyl-Coiffure_Paris_75010', 4423, 2, 19),
(238, 'logo_company.gif', 'Latinogourmand', '117 rue de la Glacière', '', '75013', 'Paris', 1, NULL, 'France', '0145810945', NULL, '\r\n \r\n\r\nLa gastronomie péruvienne ne saurait se définir en une seule phrase.\r\n\r\n Riche des cultures inca, espagnole et africaine qui l\\''ont inspirée, la cuisine du restaurant péruvien,le Latinogourmand vous invite à un voyage exotique haut en couleurs. \r\n Willy Cooper et sa chaleureuse équipe proposent sans détour une cuisine traditionnelle du Pérou qui ravira vos papilles.\r\n Vous pourrez déguster par exemple, une entrée de pommes de terre au fromage blanc et au piment doux, suivie d\\''un plat d\\''émincé de poulet servi avec des pommes de terre et sa sauce au fromage.\r\n Vous vous délecterez enfin d\\''une savoureuse compote de maïs accompagnée de morceaux de fruits.\r\n Pour agrémenter votre repas, laissez-vous tenter par une bière péruvienne conseillée par le chef. \r\n\r\nAu terme de cette escapade gourmande, le personnel de ce charmant  restaurant péruvien se fera un plaisir de vous conter la richesse de sa culture au travers de diverses anecdotes.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Latinogourmand_Paris_75013', 1, 2, 1),
(239, 'logo_company.gif', 'Restaurant Agapes', '13 rue des Fossés Saint Marcel', '', '75005', 'Paris', 1, NULL, 'France', '0143316920', NULL, 'Vous êtes passionnés de bonne cuisine ? Alors vous avez frappé à la bonne porte !\r\nAgapes est un bistrot traditionnel français qui vous propose des plats exceptionnels aux saveurs insolites !\r\n\r\nAnciennement appelé « L\\''équitable » le bistrot Agapes se refait une nouvelle beauté pour vous faire voyager à travers de nouveaux plaisirs culinaires...\r\n\r\nNotre chef cuisinier a le plaisir de vous partager son expérience forgée dans les plus grands restaurants de Paris : Apicius et Lucas Carton.\r\n\r\n\r\nDécouvrez sur ce site notre carte et nos vins à déguster dans une ambiance chaleureuse et cosy.\r\n\r\n\r\nA bientôt dans notre bistrot!\r\n', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Restaurant-Agapes_Paris_75005', 1, 2, 1),
(240, 'logo_company.gif', 'Restaurant Les Trois Marmites', '8 rue Julien Lacroix', '', '75020', 'Paris', 1, NULL, 'France', '0140330565', NULL, 'Situé dans un lieu chargé d\\''histoire du 20 ème arrondissement de Paris, Les Trois Marmites vous propose une cuisine traditionnelle française avec des produits frais et de qualités.\r\n Laissez vous porter par les subtiles saveurs de chaque plat qui vous feront revenir à l\\''époque du célèbre Bal de l\\''Elysée Ménilmontant et venez profiter d\\''un cadre exceptionnel et conviviale.\r\n Les Trois Marmites est un bistro qui vous offre un excellent rapport qualité/prix, appréciable pour venir en famille, avec des amis ou en amoureux. ', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Restaurant-Les-Trois-Marmites_Paris_75020', 1, 2, 1),
(241, 'logo_company.gif', 'Les Jardins Contini', '49 avenue du Général Leclerc', '', '75014', 'Paris', 1, NULL, 'France', '0143202534', NULL, 'Depuis 25 ans, Les Jardins Contini vous accueillent tous les jours sans exception, au déjeuner comme au dîner pour vous servir ses généreuses et non moins délicieuses pizzas mais aussi ses plats italiens maison.\r\n\r\nNotre espace de 150 places vous permet de venir fêter vos anniversaires ou tout autre événement. Nous pouvons recevoir des groupes, et l’aménagement du restaurant facilite le déplacement des handicapés.\r\n\r\nN’oubliez pas que vous pouvez prendre à emporter nos pizzas, mais aussi tous nos plats !\r\n\r\nNotre expérience de 15 ans avec les Tour Operateur a fait de nous une référence en restauration de groupe.', '9.80', '100', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Les-Jardins-Contini_Paris_75014', 4510, 2, 1),
(242, 'logo_company.gif', 'Le Bercy Café', '118 rue de Bercy', '', '75012', 'Paris', 1, NULL, 'France', '143434429', NULL, 'Dans une ambiance bistro, savourez le meilleur de la restauration à la brasserie Le Bercy située à deux pas du Palais Omnisports de Paris Bercy dans le 12ème arrondissement de Paris.\r\n\r\n Le Bercy est une authentique brasserie parisienne qui vous ouvre ses portes dès 5h30 depuis 2004. La vie y prend tout son sens. Au moment du grand rush, la salle de 160 couverts fourmille. Ici, pas ou peu d\\''attente, l\\''équipe de 8 serveurs enchaîne les assiettes sans renier sur la qualité du service et des mets. Le choix varié de plats séduit les amateurs avec la formule du midi à 15€ (entrée + plat ou plat du dessert), les salades composées (Auvergnate, de Bercy...), les omelettes, les viandes (andouillette à la dijonnaise, confit de canard...) et les desserts.\r\n\r\nAvant ou après un concert, pour un petit-déjeuner, un repas de famille ou une soirée d\\''entreprise jusqu\\''à 1h ou 2h le matin le week-end, nous nous ferons un plaisir de vous faire découvrir notre brasserie au bon rapport qualité / prix.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Le-Bercy-Cafe_Paris_75012', 1, 2, 1),
(243, 'logo_company.gif', 'Cap 23', '23 bd des Capucines', '', '75002', 'Paris', 1, NULL, 'France', '0149240923', NULL, '', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Cap-23_Paris_75002', 1, 2, 1),
(244, 'logo_company.gif', 'Victor Hugo Pressing', '43 Avenue Victor Hugo', '', '92100', 'Boulogne billancourt', 9, NULL, 'France', '0950007979', NULL, '', '9.50', '100', 1, 1, 1, 1, 1, 1, 1, 'Pressing/Victor-Hugo-Pressing_Boulogne-billancourt_92100', 4635, 2, 24),
(245, 'logo_company.gif', 'Carmine', 'Café', '73 Avenue de suffren', '75007', 'Paris', 1, NULL, 'France', '0147349056', NULL, 'Situé près de la Tour Eiffel, le Carmine Café restaurant grill pizzeria et bar vous accueille pour une pause gourmande dans une ambiance cosy.\r\n\r\nProfitez entre deux visites, des plus beaux lieux de Paris, d\\''une pause savoureuse dans une ambiance chaleureuse et une décoration soignée pour le plaisir des sens et des yeux.\r\n\r\n\r\nAvec ses boiseries et ses fauteuils aux couleurs chaudes et feutrées, le lieu donne envie de s’y installer. Pour un repas sur le pouce après quelques visites touristiques, Le Carmine café est une adresse incontournable.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Carmine_Paris_75007', 1, 2, 1),
(246, 'logo_company.gif', 'Lorentz By Gérard', '37 boulevard Richard Wallace', '', '92800', 'Puteaux', 7, NULL, 'Paris', 'France', NULL, '', '10.00', '100', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Lorentz-By-Gerard_Puteaux_92800', 4878, 2, 19),
(247, 'logo_company.gif', 'L\\''Epicuriste', '41 boulevard Pasteur', '', '75015', 'Paris', 1, NULL, 'France', '0147341550', NULL, '', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/L\\-Epicuriste_Paris_75015', 1, 2, 1),
(248, 'logo_company.gif', 'Aliette Claverie Coiffure', '34 ave de la république', '', '14800', 'Deauville', 10, NULL, 'France', '0231491533', NULL, '', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Coiffeur/Aliette-Claverie-Coiffure_Deauville_14800', 1, 2, 19),
(249, 'logo_company.gif', 'O De Rose', '209 Avenue de Versailles', '', '75016', 'Paris', 1, NULL, 'France', '0140710600', NULL, 'Ô de Rose, la nouvelle fragrance du 16e\r\nAvenue de Versailles, proche de la Porte de St-Cloud, la devanture d\\''Ô de Rose vous charme et vous surprend. En effet, par ses allures de parfumerie, sa boutique traiteur est le reflet de la nouvelle mode culinaire qu\\''Ô de Rose entend vous faire découvrir.\r\nAudace, innovation, talent (celui de Philippe Parc, meilleur ouvrier de France), Ô de Rose dose savamment ces différents ingrédients pour sublimer vos réceptions en vous offrant des prestations jusque là inédites dans le monde du cacher.\r\n\r\nCuisine moléculaire\r\nÔ de Rose associe science et art culinaire pour vous proposer des produits d\\''avant-garde riches en nouvelles textures, nouvelles couleurs, nouvelles saveurs...\r\nBistronomie\r\nÔ de Rose revisite les plats simples style \\&quot;bistro\\&quot;... sous l\\''angle de la gastronomie.\r\nEat Art\r\nÔ de Rose étonnera vos invités par sa maîtrise du design culinaire où les aliments sont transformés en pièces artistiques.\r\n\r\nVotre \\&quot;Traiteur-conseil\\&quot;\r\nOutre ses produits d\\''exception, Ô de Rose saura vous conseiller sur le lieu, la décoration, l\\''animation, la vaisselle, pour vous offrir une réception personnalisée de grande qualité quelque soit le nombre de convives...\r\n\r\nÔ de Rose c\\''est aussi...\r\nUne nouvelle boutique qui vous propose un large éventail de pâtisseries françaises et orientales et un lieu convivial de restauration dans lequel vous pourrez déguster de délicieux plats cuisinés.', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Traiteur/O-De-Rose_Paris_75016', 1, 2, 22),
(250, 'logo_company.gif', 'Boeuf Grillé', '10/16 Rue d\\''astier de la vigerie', '', '75013', 'Paris', 1, NULL, 'France', '0145863900', NULL, '', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Boeuf-Grille_Paris_75013', 1, 2, 1),
