(257, 'logo_company.gif', 'Agapes Restaurant', '3 rue des Fossés Saint Marcel', '', '75005', 'Paris', 1, NULL, 'France', '0143316920', NULL, 'Vous êtes passionnés de bonne cuisine ? Alors vous avez frappé à la bonne porte !\r\nAgapes est un bistrot traditionnel français qui vous propose des plats exceptionnels aux saveurs insolites !\r\n\r\nAnciennement appelé « L\\''équitable » le bistrot Agapes se refait une nouvelle beauté pour vous faire voyager à travers de nouveaux plaisirs culinaires...\r\n\r\nNotre chef cuisinier a le plaisir de vous partager son expérience forgée dans les plus grands restaurants de Paris : Apicius et Lucas Carton.\r\n\r\n\r\nDécouvrez sur ce site notre carte et nos vins à déguster dans une ambiance chaleureuse et cosy.\r\n\r\n\r\nA bientôt dans notre bistrot !', '0.00', 'N.C.', 1, 1, 1, 1, 1, 1, 1, 'Restaurants-et-cafes/Agapes-Restaurant_Paris_75005', 1, 2, 1),
